INSERT INTO `queries` VALUES (0,1,'Reserved','SELECT 10000001'),(1,1,'Select Player Numbers','SELECT jerseyNumber FROM soccer.players limit 10;'),(2,1,'STFullName','SELECT TeamName FROM soccer.teams,soccer.UISelected where idteams=UISelected.SelectedTeam'),(3,1,'SPName','select Name from soccer.players,soccer.UISelected where playerid =  UISelected.SelectedPlayer'),(4,1,'SPSurname','select Surname from soccer.players,soccer.UISelected where playerid =  UISelected.SelectedPlayer'),(5,1,'SPJerseyNumber','select JerseyNumber from soccer.players,soccer.UISelected where playerid =  UISelected.SelectedPlayer'),(6,1,'SPLogo1','SELECT Logo \nFROM soccer.themelogos,soccer.UISelected \nwhere themelogos.theme = UISelected.SelectedTheme \nand themelogos.TeamId = UISelected.SelectedTeam \nand themelogos.LogoIndex = 4;'),(7,1,'HTName','select TeamName from soccer.teams b,soccer.match m,soccer.uiselected a where a.SelectedMatchID = m.Matchid AND m.HomeTeamID = b.IdTeams;'),(8,1,'HTShortName','select ShortName from soccer.teams b,soccer.match m,soccer.uiselected a where a.SelectedMatchID = m.Matchid AND m.HomeTeamID = b.IdTeams;'),(9,1,'HTAbbreviatedName','select AbbreviatedName from soccer.teams b,soccer.match m,soccer.uiselected a where a.SelectedMatchID = m.Matchid AND m.HomeTeamID = b.IdTeams;'),(10,1,'HTLogo1','SELECT Logo \nFROM soccer.themelogos,soccer.UISelected,soccer.match \nwhere UISelected.SelectedTheme = themelogos.theme\nand match.HomeTeamID = themelogos.TeamID\nand match.matchID = UISelected.SelectedMatchID\nand themelogos.LogoIndex = 1;'),(11,1,'HTLogo2','SELECT Logo \nFROM soccer.themelogos,soccer.UISelected,soccer.match \nwhere UISelected.SelectedTheme = themelogos.theme\nand match.HomeTeamID = themelogos.TeamID\nand match.matchID = UISelected.SelectedMatchID\nand themelogos.LogoIndex = 2;'),(12,1,'HTLogo3','SELECT Logo \nFROM soccer.themelogos,soccer.UISelected,soccer.match \nwhere UISelected.SelectedTheme = themelogos.theme\nand match.HomeTeamID = themelogos.TeamID\nand match.matchID = UISelected.SelectedMatchID\nand themelogos.LogoIndex = 3;'),(13,1,'ATName','select TeamName from soccer.teams b,soccer.match m,soccer.uiselected a where a.SelectedMatchID = m.Matchid AND m.AwayTeamID = b.IdTeams;'),(14,1,'ATShortName','select ShortName from soccer.teams b,soccer.match m,soccer.uiselected a where a.SelectedMatchID = m.Matchid AND m.AwayTeamID = b.IdTeams;'),(15,1,'ATAbbreviatedName','select AbbreviatedName  from soccer.teams b,soccer.match m,soccer.uiselected a where a.SelectedMatchID = m.Matchid AND m.AwayTeamID = b.IdTeams;'),(16,1,'ATLogo1','SELECT Logo \nFROM soccer.themelogos,soccer.UISelected,soccer.match \nwhere UISelected.SelectedTheme = themelogos.theme\nand match.AwayTeamID = themelogos.TeamID\nand match.matchID = UISelected.SelectedMatchID\nand themelogos.LogoIndex = 1;'),(17,1,'ATLogo2','SELECT Logo \r FROM soccer.themelogos,soccer.UISelected,soccer.match \r where UISelected.SelectedTheme = themelogos.theme\r and match.AwayTeamID = themelogos.TeamID\r and match.matchID = UISelected.SelectedMatchID\r and themelogos.LogoIndex = 2;'),(18,1,'ATLogo3','SELECT Logo \r FROM soccer.themelogos,soccer.UISelected,soccer.match \r where UISelected.SelectedTheme = themelogos.theme\r and match.AwayTeamID = themelogos.TeamID\r and match.matchID = UISelected.SelectedMatchID\r and themelogos.LogoIndex = 3;'),(19,1,'Venue','SELECT a.Venue FROM `soccer`.`venue` a,`soccer`.`match` b,`soccer`.`uiselected` c where a.idVenue=b.Venue and b.matchID = c.SelectedMatchID;'),(20,1,'Tournament','SELECT a.TournamentName FROM `soccer`.`tournament` a,`soccer`.`match` b,`soccer`.`uiselected` c where a.TournamentID=b.Tournament and b.matchID = c.SelectedMatchID;'),(21,1,'GameStageDescription','SELECT if(b.MatchStatus=50 AND b.SportCodeID = 4,\'FULL TIME\',a.GraphicsDescription) GameStage FROM `soccer`.`gamestages` a,`soccer`.`match` b,`soccer`.`uiselected` c where a.idGameStages=b.MatchStatus and b.matchID = c.SelectedMatchID;'),(22,1,'GameStageShortDescription','SELECT a.`Short Description` FROM `soccer`.`gamestages` a,`soccer`.`match` b,`soccer`.`uiselected` c where a.idGameStages=b.MatchStatus and b.matchID = c.SelectedMatchID;'),(23,1,'STLogo1','SELECT Logo \nFROM soccer.themelogos,soccer.UISelected \nwhere themelogos.theme = UISelected.SelectedTheme \nand themelogos.TeamId = UISelected.SelectedTeam \nand themelogos.LogoIndex = 1;'),(28,1,'STCoachNameAndSurname','select concat(Name,\' \',Surname) FROM soccer.players,soccer.UISelected where teamid=UISelected.SelectedTeam and  TeamListPosion =100 and PersonType IN (49,48,47,44);'),(29,1,'STCoachName','select Name FROM soccer.players,soccer.UISelected where teamid=UISelected.SelectedTeam and  TeamListPosion =100 and PersonType IN (49,48,47,44);'),(30,1,'STCoachSurname','select Surname FROM soccer.players,soccer.UISelected where teamid=UISelected.SelectedTeam and  TeamListPosion =100 and PersonType IN (49,48,47,44);'),(33,1,'MatchTournamentLogo','\nSELECT TournamentLogo FROM `soccer`.`match`,`soccer`.`uiselected` c where matchID = c.SelectedMatchID;'),(34,1,'STShortName','SELECT ShortName FROM soccer.teams,soccer.UISelected where idteams=UISelected.SelectedTeam'),(43,1,'HTStatsPossesion','SELECT GetHomeTeamPosession();'),(44,1,'ATStatsPossesion','SELECT GetAwayTeamPosession();'),(51,1,'SPIDForTemplate','select PlayerID from soccer.players,soccer.UISelected where playerid =  UISelected.SelectedPlayer'),(59,1,'TemplateIdentifier2','SELECT 10000002'),(104,4,'HTScoreSOCCER','select count(statevent) \r   FROM soccer.matchevents b,soccer.match  a ,`soccer`.`uiselected` c\r   where ((b.statevent = 40 or b.statevent = 42) and b.teamid = a.HomeTeamID and b.matchid = a.matchID and a.matchID = c.SelectedMatchID) \r   or (b.statevent = 41 and b.teamid = a.AwayTeamID and b.matchid = a.matchID and a.matchID = c.SelectedMatchID) \r   and a.matchID = c.SelectedMatchID;'),(105,4,'ATScoreSOCCER','select count(statevent) \r   FROM soccer.matchevents b,soccer.match  a ,`soccer`.`uiselected` c\r   where ((b.statevent = 40 or b.statevent = 42 ) and teamid = a.AwayTeamID and b.matchid = a.matchID and a.matchID = c.SelectedMatchID) \r   or (b.statevent = 41 and teamid = a.HomeTeamID and b.matchid = a.matchID and a.matchID = c.SelectedMatchID) \r   and a.matchID = c.SelectedMatchID;'),(106,4,'HTFoulsSOCCER','select GetHomeTeamStatCount(31);'),(107,4,'ATFoulsSOCCER','select GetAwayTeamStatCount(31);'),(108,4,'HTCornerKickSOCCER','select GetHomeTeamStatCount(32);'),(109,4,'ATCornerKickSOCCER','select GetAwayTeamStatCount(32);'),(110,4,'HTOffSideSOCCER','select GetHomeTeamStatCount(33);'),(111,4,'ATOffSideSOCCER','select GetAwayTeamStatCount(33);'),(112,4,'HTYellowCardSOCCER','select GetHomeTeamStatCount(34);'),(113,4,'ATYellowCardSOCCER','select GetAwayTeamStatCount(34);'),(114,4,'HTRedCardSOCCER','select GetHomeTeamStatCount(35);'),(115,4,'ATRedCardSOCCER','select GetAwayTeamStatCount(35);'),(116,4,'HTShotOnGoalSOCCER','select GetHomeTeamStatCount(36)+GetHomeTeamStatCount(37)+GetHomeTeamStatCount(40)+GetHomeTeamStatCount(42);'),(117,4,'ATShotOnGoalSOCCER','select GetAwayTeamStatCount(36)+GetAwayTeamStatCount(37)+GetAwayTeamStatCount(40)+GetAwayTeamStatCount(42);'),(118,4,'HTShotOnTargetSOCCER','select GetHomeTeamStatCount(37)+GetHomeTeamStatCount(40)+GetHomeTeamStatCount(42);'),(119,4,'ATShotOnTargetSOCCER','select GetAwayTeamStatCount(37)+GetAwayTeamStatCount(40)+GetAwayTeamStatCount(42);'),(120,4,'HTDirectFreeKickSOCCER','select GetHomeTeamStatCount(38);'),(121,4,'ATDirectFreeKickSOCCER','select GetAwayTeamStatCount(38);'),(122,4,'HTIndirectFreeKickSOCCER','select GetHomeTeamStatCount(39);'),(123,4,'ATIndirectFreeKickSOCCER','select GetAwayTeamStatCount(39);'),(124,4,'LastGoalScorerSurnameSOCCER','select surname from soccer.players where playerid = (select playerid_1 from soccer.matchevents  where matcheventid = (select GetLastGoalScorerMatchEventID()));'),(125,4,'LastGoalScorerNameSOCCER','select name from soccer.players where playerid = (select playerid_1 from soccer.matchevents  where matcheventid = (select GetLastGoalScorerMatchEventID()));'),(126,4,'LastGoalScorerNameAndSurnameSOCCER','select concat(name,\' \',surname) from soccer.players where playerid = (select playerid_1 from soccer.matchevents  where matcheventid = (select GetLastGoalScorerMatchEventID()));'),(127,4,'LastGoalScorerJerseySOCCER','select JerseyNumber from soccer.players where playerid = (select playerid_1 from soccer.matchevents  where matcheventid = (select GetLastGoalScorerMatchEventID()));'),(128,4,'LastGoalScorerNumberOfGoalsSOCCER','select GetSoccerLatGoalScorerNumberOfGoalsString();'),(129,1,'STJersey','select JerseyNumber FROM soccer.players,soccer.UISelected,soccer.sportcodes s,soccer.`match` m  where teamid=UISelected.SelectedTeam and  TeamListPosion > -1 and PersonType NOT IN (49,48,47,44)   and s.sportcodesid = m.sportcodeid and m.matchid = UISelected.SelectedMatchID and TeamListPosion < s.NumberOfPlayer order by TeamListPosion limit 30;'),(130,1,'STNameAndSurname','select if( PersonType != 46 ,concat(Name,\' \',Surname),concat(Name,\' \',Surname,\'(c)\')) PlayerNames FROM soccer.players,soccer.UISelected,soccer.sportcodes s,soccer.`match` m  where teamid=UISelected.SelectedTeam and  TeamListPosion > -1 and PersonType NOT IN (49,48,47,44)   and s.sportcodesid = m.sportcodeid and m.matchid = UISelected.SelectedMatchID and TeamListPosion < s.NumberOfPlayer order by TeamListPosion limit 30;'),(131,1,'STReplacementJersey','select JerseyNumber FROM soccer.players,soccer.UISelected ,soccer.sportcodes s,soccer.`match` m where teamid=UISelected.SelectedTeam and  TeamListPosion >-1 and PersonType NOT IN (49,48,47,44) and s.sportcodesid = m.sportcodeid and m.matchid = UISelected.SelectedMatchID and TeamListPosion >= s.NumberOfPlayer  order by TeamListPosion limit 30;'),(132,1,'STReplacementNameAndSurname','select concat(Name,\' \',Surname) FROM soccer.players,soccer.UISelected ,soccer.sportcodes s,soccer.`match` m where teamid=UISelected.SelectedTeam and  TeamListPosion >-1 and PersonType NOT IN (49,48,47,44) and s.sportcodesid = m.sportcodeid and m.matchid = UISelected.SelectedMatchID and TeamListPosion >= s.NumberOfPlayer  order by TeamListPosion limit 30;'),(133,4,'HTGoalListInisialAndSurnameGrouped','call GetSoccerGoalScorersList(3,0,0);'),(144,4,'HTGoalListTimeListGrouped','call GetSoccerGoalScorersList(2,0,0);'),(145,4,'HTGoalListRowCountGrouped','call GetSoccerGoalScorersList(5,0,0);'),(146,4,'ATGoalListInisialAndSurnameGrouped','call GetSoccerGoalScorersList(3,0,1);'),(147,4,'ATGoalListTimeListGrouped','call GetSoccerGoalScorersList(2,0,1);'),(148,4,'ATGoalListRowCountGrouped','call GetSoccerGoalScorersList(5,0,1);'),(149,1,'SPInitialAndSurname','select concat(left(name,1),\'. \', Surname) from soccer.players,soccer.UISelected where playerid =  UISelected.SelectedPlayer;'),(150,1,'SecondarySelectedPlayerInitialAndSurname','select concat(left(name,1),\'. \', Surname) from soccer.players,soccer.UISelected where playerid =  UISelected.SecondaryPlayer;'),(151,1,'SecondarySelectedPlayerName','select Name from soccer.players,soccer.UISelected where playerid =  UISelected.SecondaryPlayer;'),(152,1,'SecondarySelectedPlayerSurname','select Surname from soccer.players,soccer.UISelected where playerid =  UISelected.SecondaryPlayer;'),(153,1,'SecondarySelectedPlayerJersey','select JerseyNumber from soccer.players,soccer.UISelected where playerid =  UISelected.SecondaryPlayer;'),(154,1,'SPNameAndSurname','select concat(Name,\' \',surname) from soccer.players,soccer.UISelected where playerid =  UISelected.SelectedPlayer;'),(155,1,'SecondarySelectedPlayerNameAndSurname','select concat(Name,\' \',surname) from soccer.players,soccer.UISelected where playerid =  UISelected.SecondaryPlayer;'),(156,4,'LastGoalScorerLogoSOCCER','SELECT themelogos.Logo  \r FROM soccer.themelogos,soccer.uiselected\r where themelogos.TeamID = (select TeamID from soccer.matchevents  where matcheventid = (select GetLastGoalSc