INSERT INTO `queries_touch` VALUES (1,1,'LeagueTeamNameSOCCER','SELECT GetTeamNameFromID(Teamid),TeamID FROM soccer.soccertournamentLog where Groupid = 1 order by points desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(2,1,'STJerseyNumber','select JerseyNumber,PlayerID FROM soccer.players,soccer.UI_Selected_touch,soccer.sportcodes s,soccer.`match` m  where teamid=UI_Selected_touch.SelectedTeam and  TeamListPosion > -1 and PersonType NOT IN (49,48,47,44)   and s.sportcodesid = m.sportcodeid and m.matchid = UI_Selected_touch.SelectedMatchID  and TeamListPosion < s.NumberOfPlayer order by TeamListPosion limit 30;'),(3,1,'STReplacementJersey','select JerseyNumber,PlayerID FROM soccer.players,soccer.UI_Selected_touch ,soccer.sportcodes s,soccer.`match` m where teamid=UI_Selected_touch.SelectedTeam and  TeamListPosion >-1 and PersonType NOT IN (49,48,47,44) and s.sportcodesid = m.sportcodeid and m.matchid = UI_Selected_touch.SelectedMatchID and TeamListPosion >= s.NumberOfPlayer  order by TeamListPosion limit 30;'),(4,1,'STName','select Name,PlayerID FROM soccer.players,soccer.UI_Selected_touch,soccer.sportcodes s,soccer.`match` m  where teamid=UI_Selected_touch.SelectedTeam and  TeamListPosion > -1 and PersonType NOT IN (49,48,47,44)   and s.sportcodesid = m.sportcodeid and m.matchid = UI_Selected_touch.SelectedMatchID  and TeamListPosion < s.NumberOfPlayer order by TeamListPosion limit 30;'),(5,1,'STSurName','select SurName,PlayerID FROM soccer.players,soccer.UI_Selected_touch,soccer.sportcodes s,soccer.`match` m  where teamid=UI_Selected_touch.SelectedTeam and  TeamListPosion > -1 and PersonType NOT IN (49,48,47,44)   and s.sportcodesid = m.sportcodeid and m.matchid = UI_Selected_touch.SelectedMatchID  and TeamListPosion < s.NumberOfPlayer order by TeamListPosion limit 30;'),(6,1,'STReplacementName','select Name,PlayerID FROM soccer.players,soccer.UI_Selected_touch ,soccer.sportcodes s,soccer.`match` m where teamid=UI_Selected_touch.SelectedTeam and  TeamListPosion >-1 and PersonType NOT IN (49,48,47,44) and s.sportcodesid = m.sportcodeid and m.matchid = UI_Selected_touch.SelectedMatchID  and TeamListPosion >= s.NumberOfPlayer  order by TeamListPosion limit 30;'),(7,1,'STReplacementSurName','select SurName,PlayerID FROM soccer.players,soccer.UI_Selected_touch ,soccer.sportcodes s,soccer.`match` m where teamid=UI_Selected_touch.SelectedTeam and  TeamListPosion >-1 and PersonType NOT IN (49,48,47,44) and s.sportcodesid = m.sportcodeid and m.matchid = UI_Selected_touch.SelectedMatchID  and TeamListPosion >= s.NumberOfPlayer  order by TeamListPosion limit 30;'),(8,1,'STCoachName','select Name,PlayerID FROM soccer.players,soccer.UI_Selected_touch where teamid=UI_Selected_touch.SelectedTeam and  TeamListPosion > -1 and PersonType IN (49,48,47,44);'),(9,1,'STCoachSurname','select Surname,PlayerID FROM soccer.players,soccer.UI_Selected_touch where teamid=UI_Selected_touch.SelectedTeam and  TeamListPosion > -1 and PersonType IN (49,48,47,44);'),(10,1,'STCoachTitle','select CASE PersonType WHEN 48 THEN \'Coach: \' WHEN 47 THEN \'Assistant Coach: \' WHEN 44 THEN \'Caretaker Coach: \' WHEN 49 THEN \'Manager: \' ELSE TeamName END PersonType,PlayerID FROM soccer.players,soccer.UI_Selected_touch,Teams t where players.teamid=UI_Selected_touch.SelectedTeam and t.idTeams = UI_Selected_touch.SelectedTeam and  TeamListPosion > -1 and PersonType IN (49,48,47,44) LIMIT 1;'),(11,1,'STCoachNameAndSurname','select concat(Name,\' \',Surname),PlayerID FROM soccer.players,soccer.UI_Selected_touch where teamid=UI_Selected_touch.SelectedTeam and  TeamListPosion > -1 and PersonType IN (49,48,47,44) Limit 1;'),(12,1,'STSurnameWithCaptain','select if( PersonType !=46 ,Surname,concat(Surname,\'(c)\')),PlayerID FROM soccer.players,soccer.UI_Selected_touch,soccer.sportcodes s,soccer.`match` m  where teamid=UI_Selected_touch.SelectedTeam and  TeamListPosion > -1 and PersonType NOT IN (49,48,47,44)   and s.sportcodesid = m.sportcodeid and m.matchid = UI_Selected_touch.SelectedMatchID  and TeamListPosion < s.NumberOfPlayer order by TeamListPosion limit 11;'),(13,1,'STLogo','SELECT Logo,TeamID FROM soccer.themelogos,soccer.UI_Selected_touch where themelogos.theme = UI_Selected_touch.SelectedTheme and themelogos.TeamId = UI_Selected_touch.SelectedTeam and themelogos.LogoIndex = 1;'),(14,1,'STOpponentFullName','SELECT TeamName,idTeams FROM soccer.teams,soccer.match m ,soccer.UI_Selected_touch WHERE idteams =IF(m.HomeTeamID =SelectedTeam,m.AwayTeamID,m.HomeTeamID) AND m.MatchID = SelectedMatchID;'),(15,1,'STFullName','SELECT TeamName,idTeams FROM soccer.teams,soccer.UI_Selected_touch where idteams=UI_Selected_touch.SelectedTeam'),(16,1,'STShortName','SELECT ShortName,idTeams FROM soccer.teams,soccer.UI_Selected_touch where idteams=UI_Selected_touch.SelectedTeam'),(17,1,'STFixtureTournament','SELECT a.TournamentName,Matchid FROM `soccer`.`tournament` a,`soccer`.`match` b,`soccer`.`UI_Selected_touch` c where a.TournamentID=b.Tournament and b.matchID = c.SelectedMatchID;'),(18,1,'Empty','SELECT \'\',0'),(19,1,'LeagueTeamNameBASKETBALL','SELECT GetTeamNameFromID(Teamid),Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(20,1,'LeagueTeamLogoBASKETBALL','SELECT GetTeamLogoFromID(Teamid,1),Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(21,1,'LeagueTeamPlayedBASKETBALL','SELECT Played,Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(22,1,'LeagueTeamWinBASKETBALL','SELECT Win,Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(23,1,'LeagueTeamLostBASKETBALL','SELECT lost,Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(24,1,'LeagueTeamDrawBASKETBALL','SELECT Draw,Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(25,1,'LeagueTeamAvePPGBASKETBALL','SELECT ROUND(GoalsFor/Played,0) AVGPPG,Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(26,1,'LeagueTeamShortNameBASKETBALL','SELECT GetTeamNameShortFromID(Teamid),Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(27,1,'LeagueTeamPointsBASKETBALL','SELECT Points,Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(28,1,'LeagueTeamGoalsForBASKETBALL','SELECT goalsfor,Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(29,1,'LeagueTeamGoalsAgainstBASKETBALL','SELECT GoalsAgainst,Teamid FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid);'),(30,1,'LeagueTeamPosBASKETBALL','SELECT (@cnt := @cnt + 1) Pos ,Teamid FROM soccer.BasketballTournamentLog,(select  @cnt := 0) as t;'),(31,1,'STFixtureHTName','select TeamName,m.HomeTeamID from soccer.teams b,soccer.`match` m,soccer.ui_selected_touch a where a.SelectedMatchID = m.Matchid AND m.HomeTeamID = b.IdTeams;'),(32