CREATE DEFINER=`root`@`localhost` FUNCTION `ClearAdminTournamentSportCodeData`(iSportCode int,iadminTournament int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	DELETE FROM `soccer`.`match` WHERE MatchID >= 0 AND (AdminTournament <> iadminTournament OR SportCodeID <> iSportCode);	
	DELETE FROM `soccer`.`Teams` WHERE idTeams >= 0 AND TeamType <>  iSportCode;
	
	
	
	DELETE FROM `soccer`.`Queries` WHERE QueriesID >= 0 AND SportCode <> iSportCode;
	DELETE FROM `soccer`.`soccerformations` WHERE idSoccerFormations >= 0;

RETURN 1;
END ;;
