CREATE DEFINER=`root`@`localhost` FUNCTION `crConvertBallsToOvers`(Balls int) RETURNS float
    DETERMINISTIC
BEGIN


declare TotalOvers float default 0;
select  Balls div 6 into TotalOvers;
select TotalOvers+((Balls-TotalOvers*6)/10) into TotalOvers;


RETURN TotalOvers;
END ;;
