CREATE DEFINER=`root`@`localhost` FUNCTION `crEndOfOver`() RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare returnEndOfover int default 0;
	declare crMatchOvers float default 0;
	declare crValidBall float default 0;
    

		
		
		
        
        SELECT substring_index(ballnumber,'.',-1)+1,ValidBall
		INTO crMatchOvers,crValidBall
		FROM soccer.crball WHERE idcrball = (SELECT MAX(idcrBall) FROM soccer.crball);

		if ((crMatchOvers = 6) AND (crValidBall != -1)) then
				set returnEndOfover = 1;
			else
				set returnEndOfover = 0;
			end if;

		RETURN returnEndOfover;
END ;;
DELIMITER ;
