CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBallExtraRunsFromExtras`(iBallid bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare TotalBallRunsFromExtras int default 0;
	declare crByes int default 0;
	declare crLegByes int default 0;
	declare crWides int default 0;
	declare crNoBalls int default 0;
	declare crBatsmanHitNoBalls int default 0;
	
	SELECT Byes,LegByes,Wides,NoBalls,Singles into crByes,crLegByes,crWides,crNoBalls,crBatsmanHitNoBalls
	FROM soccer.crball where idcrBall = iBallid;

	if(crByes > 0) then
		return crByes;
	elseif(crLegByes > 0) then
		return crLegByes;
	elseif(crWides > 0) then
		return (crWides-1);	
	elseif(crNoBalls > 0 AND crBatsmanHitNoBalls=0) then
		return (crNoBalls-1);
	elseif(crNoBalls > 0 AND crBatsmanHitNoBalls>0) then
		return crBatsmanHitNoBalls;
	else
		return 0;
	end if;

END ;;
DELIMITER ;
