CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBallRuns`(iBallid bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare TotalBallRuns int default 0;

	SELECT Singles+(fours*4)+(Sixes*6)+(TargetHit*10)+Byes+LegByes+Wides+NoBalls+Penalties into TotalBallRuns
	FROM soccer.crball where idcrBall = iBallid;

	RETURN TotalBallRuns;
END ;;
