CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBallsInOver`(_MatchID bigint, _Innings int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare crBallsInOver int default 0;
	declare crOvers float default 0;

	
	SELECT Overs into crOvers  FROM soccer.crmatchdetails WHERE Matchid = _MatchID AND Innings = _Innings;
	SELECT ROUND(TRUNCATE(Mod(crOvers,6),1) *10,0) into crBallsInOver;

	return crBallsInOver;
END ;;
