CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBallsLeftFromOver`(_MatchID bigint, _Innings int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare BallsPerOverVAR int default 6;

declare myBalls int default 0;
declare numballs int default 0;
SELECT BallsPerOver into BallsPerOverVAR FROM `soccer`.`crgamesetup` where matchid = _MatchID;

select crGetNumberOfValidBallsInInnings(_Innings,_MatchID,-1) into myBalls;
select ((floor(myBalls/BallsPerOverVAR)+1)*BallsPerOverVAR) -myBalls into numballs;
RETURN numballs;
END ;;
