CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanAdjustment`(_matchid bigint,_Innings int,_playerid bigint, iselectedColumn int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare returnedResult int default 0;

case iselectedColumn 
		when 1 then
			SELECT Runs into returnedResult  FROM soccer.`crbattingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
    	when 2 then 
			SELECT Balls into returnedResult  FROM soccer.`crbattingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
    	when 3 then 
			SELECT DotBalls into returnedResult  FROM soccer.`crbattingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
		when 4 then 
			SELECT Singles into returnedResult  FROM soccer.`crbattingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
    	when 5 then 
			SELECT Fours into returnedResult  FROM soccer.`crbattingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
    	when 6 then 
			SELECT Sixes into returnedResult  FROM soccer.`crbattingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;

    
end case;

RETURN returnedResult;
END ;;
DELIMITER ;
