CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanBatted`(_MatchID BIGINT,_Innings INT,_PlayerID BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

		declare returnStatus int default 0;
		
		SELECT EXISTS(SELECT idcrBall FROM soccer.crball 
        WHERE (FacingBatsmanID = _PlayerID or NonFacingBatsmanID=_PlayerID) 
        and Matchid = _MatchID and Innings = _Innings) batsmanBatted into returnStatus;
        
		RETURN returnStatus;
END ;;
