CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanCareerStats`(_playerid bigint,_iGameType int, iselectedColumn int) RETURNS varchar(100) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare returnedResult varchar(100) default 0;

case iselectedColumn 

		when 0 then 
			SELECT matches into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 1 then 
			SELECT Innings into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 2 then 
			SELECT NotOut into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 3 then 
			SELECT Runs into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 4 then 
			SELECT HighScore into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 5 then 
			SELECT Ave into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
		when 6 then 
			SELECT BallFaced into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 7 then 
			SELECT StrikeRate into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 8 then 
			SELECT 100 into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 9 then 
			SELECT 50 into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 10 then 
			SELECT 4s into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 11 then 
			SELECT 6s into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
		when 12 then 
			SELECT Catches into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    	when 13 then 
			SELECT Stumps into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
		when 14 then 
			SELECT Ave into returnedResult  FROM soccer.crbattingcareerstats where playerid =_playerid and idcrgametype = _iGameType ;
    
end case;

RETURN returnedResult;
END ;;
DELIMITER ;
