CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanDots`(_MatchID BIGINT,_Innings BIGINT,_PlayerID BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare TotalDotBalls int default 0;
if _PlayerID = -1 then
return 0;
else
select IFNULL(sum(Dot),0) DotBalls into TotalDotBalls from soccer.crball where validball = 1 and Innings = _Innings and MatchID = _MatchID and `FacingBatsmanID` =_PlayerID;
end if;

RETURN TotalDotBalls;
END ;;
