CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanFours`(_MatchID BIGINT,_Innings BIGINT,_PlayerID BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare Totalfours int default 0;
if _PlayerID = -1 then
return 0;
else
select IFNULL(sum(fours),0) fours into Totalfours from soccer.crball where (validball = 1 or (Noballs> 0 and validball = -1)) and Innings = _Innings and MatchID = _MatchID and `FacingBatsmanID` =_PlayerID;
end if;

RETURN Totalfours;
