CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanFoW`(_MatchID BIGINT,_Innings INT,_PlayerID BIGINT,_WicketFall int,_idcrBall bigint) RETURNS varchar(80) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN
	
	declare crBatsmanFow varchar(80) default '--';
    declare idExist int default -1;
    
    
    select idcrFallOfWickets into idExist from `soccer`.`crfallofwickets` 
    where Matchid = _MatchID and Innings = _Innings and Playerid=_PlayerID;

	if (_WicketFall = 1 or _WicketFall = 2)  and (select `crGetBatsmanidAfterWicket`(_idcrBall,1) =_PlayerID or (select `crGetBatsmanidAfterWicket`(_idcrBall,2) =_PlayerID))  then
	
    
    select idcrFallOfWickets into idExist from `soccer`.`crfallofwickets` where Matchid = _MatchID and Innings = _Innings and Playerid=_PlayerID;
    
    if idExist = -1 then
    
		INSERT INTO `soccer`.`crfallofwickets`
		(`idcrFallOfWickets`,
		`Matchid`,
		`Innings`,
		`Playerid`,
		`WicketNumber`,
		`WicketScore`,
		`idcrBall`)
		VALUES
		(null,
		_MatchID,
		_Innings,
		_PlayerID,
		(select `crGetBatsmanWicketNumber`(_MatchID,_Innings,_PlayerID)),
		(select `crGetBatsmanWicketScore`(_MatchID,_Innings,_PlayerID)),
		_idcrBall);

	else
    
		UPDATE `soccer`.`crfallofwickets`
		SET
			`WicketNumber` = (select `crGetBatsmanWicketNumber`(_MatchID,_Innings,_PlayerID)),
			`WicketScore` = (select `crGetBatsmanWicketScore`(_MatchID,_Innings,_PlayerID)),
			`idcrBall` = _idcrBall
		WHERE `idcrFallOfWickets` = idExist;
    
    end if;
    
	end if;
	
	RETURN crBatsmanFow;
END ;;
DELIMITER ;
