CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanidAfterWicket`(_ballid bigint,iSelWicket int ) RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare crMatchOvers float default 0;
	declare batsmanid bigint(30) default 0;

	if iSelWicket = 1 then 
	SELECT BatsmanID1 into batsmanid
	FROM soccer.crball WHERE idcrball = _ballid AND (WicketFall IN (1,2) or Batsmanid1 <> 0);
    else
    	SELECT BatsmanID2 into batsmanid
	FROM soccer.crball WHERE idcrball = _ballid AND (WicketFall IN (1,2) or Batsmanid1 <> 0);
    end if;

	return batsmanid;

END ;;
DELIMITER ;
