CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanOnStrike`() RETURNS bigint(30)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare crballSwapBatsman int default 0;
    declare crballSwapBatsmanEndOver int default 0;
	declare crFacingBatsman bigint default 0;
	declare crNonfacingBatsman bigint default 0;
    declare crOverBalls int default 0;
    declare crValidBall int default 0;
    
    
	SELECT if(locate('.',BallNumber)>0,substring_index(ballnumber,'.',-1)+1,1) BallsInOver,
	FacingBatsmanid,NonFacingBatsmanid,
    be.SwapBatsMan,be.SwapBatsManEndOfOver,ValidBall
    into crOverBalls,crFacingBatsman,crNonfacingBatsman,crballSwapBatsman,crballSwapBatsmanEndOver,crValidBall
	FROM soccer.crball b,soccer.crballevents be WHERE idcrball = (select max(idcrball) from soccer.crball) and b.crickButtonIndex = be.idcrballevents;    
    
    if crOverBalls=6 and crValidBall=1 then
    
		if crballSwapBatsmanEndOver=0 then
			return crFacingBatsman;
		else
			return crNonfacingBatsman;
		end if;
    
    else
    
		if crballSwapBatsman=0 then
			return crFacingBatsman;
		else
			return crNonfacingBatsman;
		end if;
    
    end if;


END ;;
DELIMITER ;
