CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanOnStrikeFromExtras`() RETURNS bigint(30)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	
	declare ballrunsFromExtras float default 0;
	declare crMatchOvers float default 0;
	declare crFacingBatsman bigint default 0;
	declare crNonfacingBatsman bigint default 0;
    declare crValidBall int default -1;

	SELECT substring_index(ballnumber,'.',-1)+1 BallsInOver,
    IFNULL(crGetBallExtraRunsFromExtras(idcrball),0) extraruns,FacingBatsmanid,NonfacingBatsmanid,ValidBall 
	INTO crMatchOvers,ballrunsFromExtras,crFacingBatsman,crNonfacingBatsman,crValidBall
	FROM soccer.crball WHERE ValidBall <> 0 and idcrball = (select max(idcrball) from soccer.crball);

	if ((MOD(ballrunsFromExtras,2)) = 1) then
		
		if (crMatchOvers= 6 and crValidBall=1) then
			return crFacingBatsman;
		else
			return crNonfacingBatsman;
		end if;
	else
		
		if (crMatchOvers= 6 and crValidBall=1) then
			return crNonfacingBatsman;
		else
			return crFacingBatsman;
		end if;
		
	end if;
END ;;
DELIMITER ;
