CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanOutStatBolwerString`(crBallid bigint,crWicketMethod int, crAssistedBy bigint) RETURNS varchar(80) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare ReturnBatsmanOutStatusString VARCHAR(80) default '';
	
		
		IF crWicketMethod IN (1,5)  THEN
			select CONCAT('b ',GetPlayerSurnameIncludeInitialIfDupInTeamFromID(BowlerID)) BowledBy into ReturnBatsmanOutStatusString
			from soccer.crwicketmethods wm,soccer.crBall b
			where idcrWicketMethods = crWicketMethod and b.idcrBall = crBallid;
		
		ELSEIF crWicketMethod IN (2,11) THEN
			select CONCAT(ShortDescription,' ',GetPlayerSurnameIncludeInitialIfDupInTeamFromID(BowlerID)) BatsmanStatus into ReturnBatsmanOutStatusString
			from soccer.crwicketmethods wm,soccer.crBall b
			where idcrWicketMethods = crWicketMethod and b.idcrBall = crBallid;
		
		ELSEIF crWicketMethod= 3 THEN
			return ReturnBatsmanOutStatusString;
		
		ELSEIF crWicketMethod= 4 THEN
			select CONCAT('b ',GetPlayerSurnameIncludeInitialIfDupInTeamFromID(BowlerID)) BowledBy into ReturnBatsmanOutStatusString
			from soccer.crwicketmethods wm,soccer.crBall b
			where idcrWicketMethods = crWicketMethod and b.idcrBall = crBallid;
		
		ELSE
			return ReturnBatsmanOutStatusString;

	END IF;

	RETURN ReturnBatsmanOutStatusString;
END ;;
DELIMITER ;
