CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanOutStatString`(crBallid bigint,crWicketMethod int, crAssistedBy bigint) RETURNS varchar(80) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare ReturnBatsmanOutStatusString VARCHAR(80) default '';
	
		
		IF crWicketMethod IN (1,5)  THEN
			select CONCAT(ShortDescription,' ',if(GetPlayerIndexFromID(crAssistedBy)>10,'(sub) ',''),GetPlayerSurnameIncludeInitialIfDupInTeamFromID(crAssistedBy)) BatsmanStatus into ReturnBatsmanOutStatusString
			from soccer.crwicketmethods wm,soccer.crBall b
			where idcrWicketMethods = crWicketMethod and b.idcrBall = crBallid;
		
		ELSEIF crWicketMethod IN (2,11) THEN
		return ReturnBatsmanOutStatusString;
		
		ELSEIF crWicketMethod= 3 THEN
			select CONCAT(ShortDescription,' (',if(GetPlayerIndexFromID(crAssistedBy)>10,'sub ',''),GetPlayerSurnameIncludeInitialIfDupInTeamFromID(crAssistedBy),')') BatsmanStatus into ReturnBatsmanOutStatusString
			from soccer.crwicketmethods wm,soccer.crBall b
			where idcrWicketMethods = crWicketMethod and b.idcrBall = crBallid;

		ELSE
			select ShortDescription into ReturnBatsmanOutStatusString
			from soccer.crwicketmethods wm,soccer.crBall b
			where idcrWicketMethods = crWicketMethod and b.idcrBall = crBallid;

	END IF;

	RETURN ReturnBatsmanOutStatusString;
END ;;
DELIMITER ;
