CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanRuns`(_MatchID BIGINT,_Innings INT,_PlayerID BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare TotalRuns int default 0;
if _PlayerID = -1 then
return 0;
else
select IFNULL((sum(Singles)+(sum(fours)*4)+(sum(Sixes)*6)+(sum(TargetHit)*10)),0) into TotalRuns from soccer.crball where (validball = 1 or Noballs > 0) and Innings = _Innings and MatchID = _MatchID and _PlayerID=`FacingBatsmanID`;
end if;

RETURN TotalRuns;
END ;;
