CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanSeriesStats`(_playerid bigint,_iGameType int, iselectedColumn int) RETURNS float
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare returnedResult float default 0;

case iselectedColumn 

		when 0 then 
			select count(*)  into returnedResult from (SELECT playerid  FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType group by b.matchid) as t;
    	when 1 then 
			SELECT count(b.Innings) into returnedResult  FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType;
		when 2 then 
			SELECT count(*) into returnedResult  FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType and (b.batsmanStatus like 'not out' or b.batsmanStatus like 'Did Not Bat');
    	when 3 then 
			SELECT ifnull(sum(runs),0) into returnedResult FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType  and m.Matchid = b.Matchid and g.idgametype = _iGameType;
    	when 4 then 
			SELECT ifnull(runs,0) into returnedResult FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and m.idgametype = _iGameType order by runs desc limit 1;
		when 6 then 
			SELECT ifnull(sum(balls),0) into returnedResult FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType;
    	when 8 then 
			SELECT count(*) into returnedResult  FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType and b.runs >= 100;
    	when 9 then 
			SELECT count(*) into returnedResult  FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType and b.runs >= 50 and b.runs < 100;
    	when 10 then 
			SELECT ifnull(sum(fours),0) into returnedResult FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType;
    	when 11 then 
			SELECT ifnull(sum(sixes),0) into returnedResult FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType;
		when 12 then
			 SELECT if(BatsmanStatus like 'not out',0,1) notOutflag into returnedResult FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and m.idgametype = _iGameType
            order by runs desc,(case BatsmanStatus when  'not out' then 0 else 1 end) asc  limit 1;
		when 13 then 
			SELECT count(*) into returnedResult  FROM soccer.crbattingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType and b.runs >= 30 and b.runs < 50;
    
end case;

RETURN returnedResult;
END ;;
DELIMITER ;
