    READS SQL DATA
    DETERMINISTIC
BEGIN

declare TotalSingles int default 0;
if _PlayerID = -1 then
return 0;
else
select IFNULL(sum(Singles),0) into TotalSingles from soccer.crball where (validball = 1 OR (Noballs > 0 AND Singles > 0)) and Innings = _Innings and MatchID = _MatchID and FacingBatsmanID =_PlayerID;
end if;

RETURN TotalSingles;
END ;;
