CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanStatus`(_MatchID BIGINT,_Innings INT,_PlayerID BIGINT,iBatsManOrBowler int,idball bigint) RETURNS varchar(80) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare crBatsmanStatus VARCHAR(80) default '';
	declare crBallid bigint default 0;
	declare crWicketFall int default 0;
	declare crBatsmanID1 bigint default 0;
	declare crBatsmanID2 bigint default 0;
	declare crWicketFallMethod1 int default 0;
	declare crWicketFallMethod2 int default 0;
	declare crWicketAssistedBy1 bigint default 0;
	declare crWicketAssistedBy2 bigint default 0;

	if idball = -1 then

		SELECT idcrball,WicketFall,BatsmanID1,WicketMethod1,AssistedBy1,BatsmanID2,WicketMethod2,AssistedBy2 INTO 
		   crBallid,crWicketFall,crBatsmanID1,crWicketFallMethod1,crWicketAssistedBy1,crBatsmanID2,crWicketFallMethod2,crWicketAssistedBy2
		FROM soccer.crball ORDER BY idcrball DESC LIMIT 1;
	else

	SELECT idcrball,WicketFall,BatsmanID1,WicketMethod1,AssistedBy1,BatsmanID2,WicketMethod2,AssistedBy2 INTO 
		   crBallid,crWicketFall,crBatsmanID1,crWicketFallMethod1,crWicketAssistedBy1,crBatsmanID2,crWicketFallMethod2,crWicketAssistedBy2
	FROM soccer.crball WHERE idcrball = idball;

	end if;
		
		if(crBatsmanID1 <> 0 AND crBatsmanID1 = _PlayerID) then
			if(iBatsManOrBowler=0) then
				SELECT crGetBatsmanOutStatString(crBallid,crWicketFallMethod1,crWicketAssistedBy1) INTO crBatsmanStatus;
			else
				SELECT crGetBatsmanOutStatBolwerString(crBallid,crWicketFallMethod1,crWicketAssistedBy1) INTO crBatsmanStatus;
			end if;
		elseif(crBatsmanID2 <> 0 AND  crBatsmanID2 = _PlayerID) then
			if(iBatsManOrBowler=0) then
				SELECT crGetBatsmanOutStatString(crBallid,crWicketFallMethod2,crWicketAssistedBy2) INTO crBatsmanStatus;
			else
				SELECT crGetBatsmanOutStatBolwerString(crBallid,crWicketFallMethod2,crWicketAssistedBy2) INTO crBatsmanStatus;
			end if;
	
		else
		if(iBatsManOrBowler=0) then
			set crBatsmanStatus = 'not out';
		else
			set crBatsmanStatus = '';
		end if;

	end if;





	RETURN crBatsmanStatus;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
