CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanStatusUpdate`(_MatchID bigint,_Innings int,_BatsmanID bigint,idball bigint) RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare idcrBattingCurrentEntry bigint default -1;
declare crBatsmanStatus VARCHAR(80) DEFAULT '';
declare crBatsmanStatusBowledBy VARCHAR(80) DEFAULT '';
declare crBatsmanFoW VARCHAR(80) DEFAULT '';

if idball <> -1 then

SELECT idcrBattingCurrent into idcrBattingCurrentEntry FROM `soccer`.`crbattingcurrent` where PlayerID = _BatsmanID and MatchID =_MatchID and Innings = _Innings;

select  IFNULL(crGetBatsmanStatus(_MatchID,_Innings,_BatsmanID,0,idball),''),
		IFNULL(crGetBatsmanStatus(_MatchID,_Innings,_BatsmanID,1,idball),''),
		IFNULL(crGetBatsmanFoW(_MatchID,_Innings,_BatsmanID,crGetBallWicketFallStatus(),idball),0)
		
 into crBatsmanStatus,crBatsmanStatusBowledBy,crBatsmanFoW;

UPDATE `soccer`.`crbattingcurrent` 
SET `BatsmanStatus` = crBatsmanStatus,`Bowler`=crBatsmanStatusBowledBy,`FoW` = crBatsmanFoW
WHERE idcrBattingCurrent=idcrBattingCurrentEntry;

end if;


RETURN idcrBattingCurrentEntry;
END ;;
DELIMITER ;
