CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBatsmanWicketStatus`(_MatchID BIGINT,_Innings INT,_PlayerID BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	

	declare crBatsmanStatus varchar(45) default '';

	SELECT CONCAT(BatsmanStatus,' ',Bowler) into crBatsmanStatus
	FROM soccer.crbattingcurrent WHERE MatchID = _MatchID AND Innings= _Innings 
	AND PlayerID = _PlayerID;
	
	if crBatsmanStatus = 'not out' or crBatsmanStatus = '' then
		return 0;

	elseif crBatsmanStatus = 'retired not out' or crBatsmanStatus = 'retired hurt' then
		return 2;
	else
		return 1;
end if;

END ;;
