	declare TeamRuns int default 0;
	
	SELECT IFNULL(sum(Singles)+(sum(fours)*4)+(sum(Sixes)*6)+sum(Byes)+sum(LegByes)+sum(Wides)+sum(NoBalls)+sum(Penalties)
    +(sum(TargetHit)*10),0) + crGetBattingTeamRunsPPPlusOver(_MatchID,_Innings) into TeamRuns
