CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBestFiguresComparison`(bbi1 varchar(40) ,bbi2 varchar(40)) RETURNS varchar(40) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare Result  varchar(40) default '';
declare Wickets1 int default 0;
declare Runs1 int default 0;
declare Wickets2 int default 0;
declare Runs2 int default 0;

if bbi1 = '-' or bbi1 = '0' then
set bbi1 = '0-0';
end if; 


if bbi2 = '-' or bbi2 = '0' then
set bbi2 = '0-0';
end if; 


select substring_index(bbi1,'-',1),substring_index(bbi1,'-',-1),
	   substring_index(bbi2,'-',1),substring_index(bbi2,'-',-1) into Wickets1,Runs1,Wickets2,Runs2;

case when  Wickets1 > Wickets2 then 
	set Result = bbi1;
    when  Wickets1 < Wickets2 then 
	set Result = bbi2;
    when  (Wickets1 = Wickets2 and Runs1 < Runs2) then  
	set Result = bbi1;
	when  (Wickets1 = Wickets2 and Runs1 > Runs2) then  
	set Result = bbi2;
    else
    set Result = bbi1;

end case;

RETURN Result;
END ;;
DELIMITER ;
