CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBowlerAdjustment`(_matchid bigint,_Innings int,_playerid bigint, iselectedColumn int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare returnedResult int default 0;

case iselectedColumn 
		when 1 then
			SELECT Balls into returnedResult  FROM soccer.`crbowlingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
    	when 2 then 
			SELECT Runs into returnedResult  FROM soccer.`crbowlingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
    	when 3 then 
			SELECT Wkts  into returnedResult  FROM soccer.`crbowlingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
		when 4 then 
			SELECT DotBalls into returnedResult  FROM soccer.`crbowlingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
		when 5 then 
			SELECT Wides into returnedResult  FROM soccer.`crbowlingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
        when 6 then 
			SELECT Noballs into returnedResult  FROM soccer.`crbowlingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;
    	when 7 then 
			SELECT Maidens into returnedResult  FROM soccer.`crbowlingcurrentadjustment` where playerid =_playerid and matchid = _matchid and Innings = _Innings;

end case;

RETURN returnedResult;
END ;;
