CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBowlerAve`(_MatchID BIGINT,_Innings INT,_PlayerID BIGINT) RETURNS varchar(45) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

		declare crBowlerAve varchar(45) default '--';
		
		SELECT IFNULL(ROUND(crGetBowlerRuns(_MatchID,_Innings,_PlayerID)+ (crGetBowlerAdjustment(_MatchID,_Innings,_PlayerID,2))/crGetBowlerWkts(_MatchID,_Innings,_PlayerID)+ (crGetBowlerAdjustment(_MatchID,_Innings,_PlayerID,3)),2),'--') into crBowlerAve;
		RETURN crBowlerAve;
END ;;
