    READS SQL DATA
    DETERMINISTIC
BEGIN

declare TotalMaidens int default 0;
 
select sum(oversbowled) Maidens into TotalMaidens from
(
SELECT 
case crGetOverValidBalls(Matchid,Innings,BallNumber,_PlayerID) when 6 then if(crGetOverRuns(Matchid,Innings,BallNumber)=0,1,0) else 0 end oversbowled 
FROM soccer.crball 
where  MatchID = _MatchID AND Innings = _Innings AND BowlerID=_PlayerID group by substring_index(BallNumber,'.',1)
 ) as t;
 
RETURN TotalMaidens;
END ;;
