CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBowlerOnStrike`() RETURNS bigint(30)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare crMatchOvers float default 0;
	declare bowlerid bigint(30) default 0;
    declare BallExtra int default  0;

	SELECT IFNULL(crConvertBallsToOvers(crGetNumberOfValidBallsForBowlerInInnings(Innings,MatchID,-1)),0),(NoBalls+Wides) INTO crMatchOvers,BallExtra FROM soccer.crball ORDER BY idcrball DESC LIMIT 1;

if(BallExtra = 0) then
	if (MOD(crMatchOvers,1)) > 0 then
		SELECT `crGetActiveBowlerID`() INTO bowlerid;
	else
		SELECT `crGetInActiveBowlerID`() INTO bowlerid;
	end if;
    
    else
SELECT `crGetActiveBowlerID`() INTO bowlerid;
end if;

	RETURN bowlerid;
END ;;
DELIMITER ;
