CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBowlerSeriesStats`(_playerid bigint,_iGameType int, iselectedColumn int) RETURNS varchar(20) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare returnedResult varchar(20) default 0;

case iselectedColumn 

		when 0 then 
			select count(*)  into returnedResult  from (SELECT playerid FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType group by b.matchid) as t;
    	when 1 then 
			SELECT count(b.Innings) into returnedResult  FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType;
		when 2 then 
			SELECT ifnull(sum(wkts),0) into returnedResult  FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType;
    	when 3 then 
			SELECT ifnull(sum(runs),0) into returnedResult FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType  and m.Matchid = b.Matchid and g.idgametype = _iGameType;
		when 4 then 
			SELECT ifnull(sum(balls),0) into returnedResult FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType;
    	when 5 then 
			SELECT count(wkts) into returnedResult  FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType and Wkts = 4;    	
        when 6 then 
			SELECT count(wkts) into returnedResult  FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType and Wkts = 5; 
    	when 7 then 
			select count(10w)  into returnedResult from (SELECT ifnull(sum(wkts),0) 10w FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType
            group by m.matchid) as w
            where 10w >= 10;
    	when 8 then 
			SELECT concat(wkts,'-',runs) bbi  into returnedResult FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType
            order by wkts desc,runs asc,concat(wkts,'-',runs) desc limit 1;
		when 9 then
			SELECT ifnull(CAST(concat(sum(wkts),'-',sum(runs)) as char),0) bbm into returnedResult FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType
            group by m.matchid
            order by sum(wkts) desc,sum(runs) asc limit 1;
		when 10 then 
			SELECT ifnull(sum(Overs),0) into returnedResult  FROM soccer.crbowlingcurrent b,`soccer`.`match` m,soccer.crgametype g
			where b.playerid =_playerid and m.idGameType = g.idGameType and m.Matchid = b.Matchid and g.idgametype = _iGameType;
    
end case;

RETURN returnedResult;
END ;;
DELIMITER ;
