CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBowlerSR`(_MatchID BIGINT,_Innings INT,_PlayerID BIGINT) RETURNS varchar(45) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

		declare crBowlerSR varchar(45) default '--';
		
		SELECT IFNULL(ROUND(crGetNumberOfValidBallsForBowlerInInnings(_Innings,_MatchID,_PlayerID) + (crGetBowlerAdjustment(_MatchID,_Innings,_PlayerID,1))/crGetBowlerWkts(_MatchID,_Innings,_PlayerID),2) + (crGetBowlerAdjustment(_MatchID,_Innings,_PlayerID,3)),'--') into crBowlerSR;
		RETURN crBowlerSR;
END ;;
DELIMITER ;
