CREATE DEFINER=`root`@`localhost` FUNCTION `crGetBowlerWides`(_MatchID BIGINT,_Innings BIGINT,_PlayerID BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare TotalWides int default 0;
if _PlayerID = -1 then
return 0;
else
select IFNULL(sum(Wides),0) wides into TotalWides from soccer.crball where Wides > 0 and Innings = _Innings and MatchID = _MatchID and `BowlerID` =_PlayerID;
end if;

RETURN TotalWides;
END ;;
