    READS SQL DATA
    DETERMINISTIC
BEGIN

declare TotalWkts int default 0;
if _PlayerID = -1 then
return 0;
else
select IFNULL(sum(WicketFall),0) into TotalWkts from soccer.crball where validball = 1 and Innings = _Innings and WicketMethod1 != 3 and WicketMethod2 != 3 and MatchID = _MatchID and _PlayerID=`BowlerID`;
end if;

RETURN TotalWkts;
END ;;
