CREATE DEFINER=`root`@`localhost` FUNCTION `crGetMatchDetailsInningsAdjustment`(_matchid bigint,_Innings int, iselectedColumn int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare returnedResult int default 0;

case iselectedColumn 
		when 1 then
			SELECT MatchScore into returnedResult  FROM soccer.`crmatchdetailsadjustment` where matchid = _matchid and Innings = _Innings;
    	when 2 then 
			SELECT Wickets into returnedResult  FROM soccer.`crmatchdetailsadjustment` where matchid = _matchid and Innings = _Innings;
    	when 3 then 
			SELECT Fours into returnedResult  FROM soccer.`crmatchdetailsadjustment` where matchid = _matchid and Innings = _Innings;
		when 4 then 
			SELECT Sixes into returnedResult  FROM soccer.`crmatchdetailsadjustment` where matchid = _matchid and Innings = _Innings;
    	when 5 then 
			SELECT Wides into returnedResult  FROM soccer.`crmatchdetailsadjustment` where matchid = _matchid and Innings = _Innings;
    	when 6 then 
			SELECT NoBalls into returnedResult  FROM soccer.`crmatchdetailsadjustment` where matchid = _matchid and Innings = _Innings;
		when 7 then 
			SELECT LegBytes into returnedResult  FROM soccer.`crmatchdetailsadjustment` where matchid = _matchid and Innings = _Innings;
		when 8 then 
			SELECT Byes into returnedResult  FROM soccer.`crmatchdetailsadjustment` where matchid = _matchid and Innings = _Innings;
		when 9 then 
			SELECT Penalties into returnedResult  FROM soccer.`crmatchdetailsadjustment` where matchid = _matchid and Innings = _Innings;
		when 10 then 
			SELECT PPPlusOverRuns into returnedResult  FROM soccer.`crmatchdetailsadjustment` where matchid = _matchid and Innings = _Innings;
		
end case;

RETURN returnedResult;
END ;;
DELIMITER ;
