CREATE DEFINER=`root`@`localhost` FUNCTION `crGetMatchExtras`(_MatchID bigint,_Innings int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare TotalExtras int default 0;
	
    SELECT IFNULL(Byes+LegBytes+NoBalls+Wides+PPPlusOverRuns,0) into TotalExtras FROM soccer.crmatchdetails  WHERE MatchID = _MatchID AND Innings = _Innings;
    
    if(TotalExtras > 0) then 
	RETURN TotalExtras;
    else
    return 0;
    end if;
END ;;
