CREATE DEFINER=`root`@`localhost` FUNCTION `crGetMatchExtrasString`(_MatchID bigint,_Innings int) RETURNS varchar(45) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare TotalExtrasString varchar(45) default 0;
    
	SELECT if(PPPlusOverRuns=0,CONCAT(if(Byes>0,concat('B',Byes,'  '),''),if(LegBytes>0,concat('LB',LegBytes,'  '),''),if(NoBalls>0,concat('NB',NoBalls,'  '),''),if(Wides>0,concat('WD',Wides,'  '),'')),CONCAT(if(Byes>0,concat('B',Byes,'  '),''),if(LegBytes>0,concat('LB',LegBytes,'  '),''),if(NoBalls>0,concat('NB',NoBalls,'  '),''),if(Wides>0,concat('WD',Wides,'  '),''),if(PPPlusOverRuns>0,concat('PP',PPPlusOverRuns,'  '),''))) extras into TotalExtrasString FROM soccer.crmatchdetails  WHERE MatchID = _MatchID AND Innings = _Innings;
	RETURN TotalExtrasString;
END ;;
