CREATE DEFINER=`root`@`localhost` FUNCTION `crGetMatchstatus`(_MatchID bigint, iWinOrWon int) RETURNS varchar(200) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare igameMatchStatus int default -1;
declare igameType int default -1;
declare Result varchar(300) default '';

SELECT MatchStatus,idgametype into igameMatchStatus,igameType  FROM soccer.`match` WHERE Matchid= _MatchID;

if(igameType IN (4,7)) then

select crGetMatchStatusTestsFormatLong(_MatchID,0) into Result;

else


case when igameMatchStatus=177 then 

	SELECT concat(GetTeamNameFromID(battingTeam),': ',MatchScore,'-',Wickets) 1stInningsScore
    into Result 
	FROM soccer.crmatchdetails WHERE Matchid = _MatchID And Innings = igameMatchStatus;
    
    when igameMatchStatus=178 then
    
    
		select 
	
				case when(m2.InningsEnded= 0) and (g.TotalWickets <> m2.Wickets) and (((m1.MatchScore) >= (m2.MatchScore)) and ((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1)))>0)) then
                (
					case
						when ((m1.MatchScore+1) > (m2.MatchScore)) then
							concat(GetTeamNameFromID(m2.BattingTeam),' need ',(m1.MatchScore)+1-(m2.MatchScore),
                        if((m1.MatchScore+1)-(m2.MatchScore)>1,' runs off ',' run off '),(g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1))),if((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1)))>1, ' balls to win',' ball to win'))
					end 
				)
			else
            				
					case when ((g.TotalWickets = m2.Wickets) or ((m2.InningsEnded= 1 or g.TotalBalls=crGetNumberOfValidBallsInInnings(178,_MatchID,-1)) and (m1.MatchScore > m2.MatchScore))) then 
                    
							concat(GetTeamNameFromID(m2.BowlingTeam),if(iWinOrWon=0,' WIN BY ',' WON BY '),((m1.MatchScore)-(m2.MatchScore)), 
							if(((m1.MatchScore)-(m2.MatchScore))>1,' RUNS',' RUN'))
                    
						when ((m1.MatchScore) < (m2.MatchScore))  then
    
							concat(GetTeamNameFromID(m2.BattingTeam),if(iWinOrWon=0,' WIN BY ',' WON BY '),g.TotalWickets - m2.Wickets, 
							if((g.TotalWickets - m2.Wickets)>1,' WICKETS',' WICKET'))
                            
						when ((m1.MatchScore) = (m2.MatchScore)) then
							concat('match drawn')
				
            
					end
                    
			
			end 
            
            into Result
	FROM soccer.crmatchdetails m1,soccer.crmatchdetails m2, soccer.crgamesetup g
    WHERE m1.Matchid = _MatchID and g.matchid = _MatchID  and m1.Matchid = m2.matchid
    And m1.Innings = 177 and m2.innings = 178;
 
    

end case;

end if;



return result;


END ;;
DELIMITER ;
