    DETERMINISTIC
BEGIN
    DECLARE varResults VARCHAR(200);
   SELECT CASE WHEN (f.Innings = 178) THEN
(

          select case when((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1)))>0) then
          (
              SELECT case when(f.Wickets=g.TotalWickets  ) then
              (
                  select case when((g.Target-1) = f.MatchScore) then
                  (
                       select 'match drawn'
