                    select case when (g.TotalWickets-f.Wickets) > 1 then
                        (
                          select concat (t.teamname,' win by ',g.TotalWickets-f.Wickets,' Wickets')
                        )
                        else
                        (
                          select concat (t.teamname,' win by ',g.TotalWickets-f.Wickets,' Wicket')
                        )end
                )else
                (

                 select case when(f.InningsEnded= 0) then
                (
					 case when iBallsOrOvers=0 then
                      (select case when((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1))) =1)and((g.Target)-f.MatchScore =1) then
                      (
                     select concat(t.teamname, ' need ',(g.Target)-f.MatchScore,' run off ',(g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1))), ' ball to win')
                      )when((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1))) >1)and((g.Target)-f.MatchScore =1) then
                      (
                     select concat(t.teamname, ' need ',(g.Target)-f.MatchScore,' run off ',(g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1))), ' balls to win')
                      )when((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1))) =1)and((g.Target)-f.MatchScore >1) then
                      (
                     select concat(t.teamname, ' need ',(g.Target)-f.MatchScore,' runs off ',(g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1))), ' ball to win')
                      )when((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1))) >1)and((g.Target)-f.MatchScore >1) then
                      (
                     select concat(t.teamname, ' need ',(g.Target)-f.MatchScore,' runs off ',(g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1))), ' balls to win')
                      )end
                      )
                      
                      else
                      
                      (select case when((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1))) =1)and((g.Target)-f.MatchScore =1) then
                      (
                     select concat(t.teamname, ' need ',(g.Target)-f.MatchScore,' run off ',crConvertBallsToOvers((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1)))), ' over to win')
                      )when(crConvertBallsToOvers((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1)))) >1)and((g.Target)-f.MatchScore =1) then
                      (
                     select concat(t.teamname, ' need ',(g.Target)-f.MatchScore,' run off ',crConvertBallsToOvers((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1)))), ' overs to win')
                      )when(crConvertBallsToOvers((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1)))) =1)and((g.Target)-f.MatchScore >1) then
                      (
                     select concat(t.teamname, ' need ',(g.Target)-f.MatchScore,' runs off ',crConvertBallsToOvers((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1)))), ' over to win')
                      )when(crConvertBallsToOvers((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1)))) >1)and((g.Target)-f.MatchScore >1) then
                      (
                     select concat(t.teamname, ' need ',(g.Target)-f.MatchScore,' runs off ',crConvertBallsToOvers((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,_MatchID,-1)))), ' overs to win')
                      )end
                      )
                      end

                ) else
                (
                                 select case when (((g.Target-1)-f.MatchScore) >1) then
                                (
                                           select concat (p.teamname,' win by ',(g.Target-1)-f.MatchScore,' runs')
                                   )else
                                   (
                                          select concat (p.teamname,' win by ',(g.Target-1)-f.MatchScore,' run')

                                )end
                                
                )end


                )end
              )end


          )else
          (
             

             select case when((g.Target-1) = f.MatchScore) then
             (
               select 'match drawn'
             )
             when((g.Target-1) > f.MatchScore) then
             (
                select case when (((g.Target-1)-f.MatchScore) >1) then
                (
                   select concat (p.teamname,' win by ',(g.Target-1)-f.MatchScore,' runs')
                )else
