                        )
                        else
                        (
                          select concat (t.teamname,' win by ',g.TotalWickets-f.Wickets,' Wicket')
                        )end
                )


             end


          )end

)
ELSE
(
    select case when (f.MatchScore=1) then
    (

      SELECT CONCAT (t.teamname,' Lead by ',f.MatchScore,' Run')
    )
    ELSE
    (
      SELECT CONCAT (t.teamname,' Lead by ',f.MatchScore,' Runs')
    )END
)
END   INTO varResults

FROM  soccer.crmatchdetails f,teams t,teams p,soccer.crmatchdetails q ,soccer.uiselected m,soccer.crgamesetup g
WHERE f.MatchId = _MatchID and q.MatchId = _MatchID AND f.Innings =178 AND t.idTeams = f.BattingTeam and p.idTeams =q.BattingTeam and q.Innings =177 AND g.Matchid =_MatchID;
return varResults;
