CREATE DEFINER=`root`@`localhost` FUNCTION `crGetMatchStatusTestsFormat`(_MatchID bigint,_bowlingWinning int) RETURNS varchar(300) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare igameMatchStatus int default -1;
declare Result varchar(300) default '';

SELECT MatchStatus into igameMatchStatus  FROM soccer.`match` WHERE Matchid= _MatchID;

case when igameMatchStatus=177 then 

	SELECT concat(GetTeamNameFromID(battingTeam),': ',MatchScore,'-',Wickets) 1stInningsScore
    into Result 
	FROM soccer.crmatchdetails WHERE Matchid = _MatchID And Innings = igameMatchStatus;
    
    when igameMatchStatus=178 then
    
    	SELECT 
    case when (m1.MatchScore > m2.MatchScore) then 
			concat(GetTeamNameFromID(m2.BattingTeam),' TRAIL BY ',(m1.MatchScore - m2.MatchScore))
		 when (m1.MatchScore = m2.MatchScore) then
			concat('SCORE LEVEL')
		 when (m1.MatchScore < m2.MatchScore) then
			concat(GetTeamNameFromID(m2.BattingTeam),' LEAD BY ',(m2.MatchScore - m1.MatchScore))
	end 2ndInningsScore
    into Result 
	FROM soccer.crmatchdetails m1,soccer.crmatchdetails m2,soccer.uiselected 
    WHERE m1.Matchid = SelectedMatchID And m1.Innings = 177 and m1.Matchid = m2.matchid and m2.innings = 178;
    
    
    when igameMatchStatus=179 then
    
    	SELECT 
    
			case
				when m3.FollowOn=0 then
    
				case when (g.TotalWickets = m3.Wickets) AND ((m1.MatchScore+m3.MatchScore) < m2.MatchScore) then
    
					concat(GetTeamNameFromID(m2.BattingTeam),' WIN BY AN INNINGS AND ',(m2.MatchScore-(m1.MatchScore+m3.MatchScore)), 
					if((m2.MatchScore-(m1.MatchScore+m3.MatchScore))>1,' RUNS',' RUN'))
    
    
				else
    
    
					case when ((m1.MatchScore+m3.MatchScore) < m2.MatchScore) then 
						concat(GetTeamNameFromID(m3.BattingTeam),' TRAIL BY ',(m2.MatchScore-(m1.MatchScore+m3.MatchScore)))
					when (m1.MatchScore = m2.MatchScore) then
						concat('SCORE LEVEL')
					when ((m1.MatchScore+m3.MatchScore) > m2.MatchScore) then
						concat(GetTeamNameFromID(m3.BattingTeam),' LEAD BY ',((m1.MatchScore+m3.MatchScore)-m2.MatchScore))
					end
				end
	
			when m3.FollowOn=1 then
         
				case when (g.TotalWickets = m3.Wickets) AND ((m2.MatchScore+m3.MatchScore) < m1.MatchScore) then
         
					concat(GetTeamNameFromID(m1.BattingTeam),' WIN BY AN INNINGS AND ',(m1.MatchScore-(m2.MatchScore+m3.MatchScore)), 
					if((m1.MatchScore-(m2.MatchScore+m3.MatchScore))>1,' RUNS',' RUN'))
         
				else
         
						case when ((m2.MatchScore+m3.MatchScore) < m1.MatchScore) then 
							concat(GetTeamNameFromID(m3.BattingTeam),' TRAIL BY ',(m1.MatchScore-(m2.MatchScore+m3.MatchScore)))
							when (m1.MatchScore = (m2.MatchScore+m3.MatchScore)) then
							concat('SCORE LEVEL')
							when ((m2.MatchScore+m3.MatchScore) > m1.MatchScore) then
							concat(GetTeamNameFromID(m3.BattingTeam),' LEAD BY ',((m1.MatchScore+m3.MatchScore)-m2.MatchScore))
						end
				end
		
		end 3rdInningsScore
       into Result 
	FROM soccer.crmatchdetails m1,soccer.crmatchdetails m2,
	soccer.crmatchdetails m3,soccer.uiselected, soccer.crgamesetup g
    WHERE m1.Matchid = SelectedMatchID and g.matchid = SelectedMatchID  and m1.Matchid = m2.matchid and m1.Matchid = m3.matchid 
    And m1.Innings = 177 and m2.innings = 178 and m3.Innings = 179;
    
    when igameMatchStatus=180 then
    
	SELECT 
			case when(m4.InningsEnded= 0) then
                (
					case
						when ((m1.MatchScore+m3.MatchScore) > (m2.MatchScore+m4.MatchScore)) AND _bowlingWinning =0  AND (g.TotalWickets <> m4.Wickets) then
							concat(GetTeamNameFromID(m4.BattingTeam),' NEED ',(m1.MatchScore+m3.MatchScore)+1-(m2.MatchScore+m4.MatchScore),
                        if((m1.MatchScore+m3.MatchScore)-(m2.MatchScore+m4.MatchScore)>1,' RUNS TO WIN',' RUN TO WIN'))
                        
                        when ((m1.MatchScore+m3.MatchScore) > (m2.MatchScore+m4.MatchScore)) AND _bowlingWinning =1  AND (g.TotalWickets <> m4.Wickets) then
							concat(GetTeamNameFromID(m4.BowlingTeam),' NEED ',g.TotalWickets - m4.Wickets,
                        if(g.TotalWickets - m4.Wickets>1,' WICKETS TO WIN',' WICKET TO WIN'))
					end 
				)
			else
				
					case when (g.TotalWickets = m4.Wickets) then 
                    
							concat(GetTeamNameFromID(m4.BowlingTeam),' WIN BY ',((m1.MatchScore+m3.MatchScore)-(m2.MatchScore+m4.MatchScore)), 
							if(((m1.MatchScore+m3.MatchScore)-(m2.MatchScore+m4.MatchScore))>1,' RUNS',' RUN'))
                    
						when ((m1.MatchScore+m3.MatchScore) < (m2.MatchScore+m4.MatchScore)) then
    
							concat(GetTeamNameFromID(m4.BattingTeam),' WIN BY ',g.TotalWickets - m4.Wickets, 
							if((g.TotalWickets - m4.Wickets)>1,' WICKETS',' WICKET'))
				
            
					end
			
			end 4thInningsScore
     into Result
	FROM soccer.crmatchdetails m1,soccer.crmatchdetails m2,
	soccer.crmatchdetails m3,soccer.crmatchdetails m4,soccer.uiselected, soccer.crgamesetup g
    WHERE m1.Matchid = SelectedMatchID and g.matchid = SelectedMatchID  and m1.Matchid = m2.matchid and m1.Matchid = m3.matchid and m1.Matchid = m4.matchid 
    And m1.Innings = 177 and m2.innings = 178 and m3.Innings = 179 and m4.Innings = 180;

end case;



RETURN Result;
END ;;
