                concat('TARGET ',(m1.MatchScore+m3.MatchScore)-m2.MatchScore)
                
                when m3.FollowOn=1 then
                
                concat('TARGET ',(m2.MatchScore+m3.MatchScore)-m1.MatchScore)
                
		end 4thInningsScore
