CREATE DEFINER=`root`@`localhost` FUNCTION `crGetOverDetailsString`(_MatchID bigint,_Innings int,iSelectedOver int) RETURNS varchar(80) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare crthisover varchar(80) default '';
    
    select group_concat(case 
	when CrickButtonIndex=0  then if(b.wicketfall=1,if(b.singles>0,CONCAT(b.singles,'+W'),'W'),0)
	when wicketfall=1  then if(b.singles>0,CONCAT(b.singles,'+W'),'W')
	when CrickButtonIndex=1  then 1 
	when CrickButtonIndex=2  then 2
	when CrickButtonIndex=3  then 3
	when CrickButtonIndex=4  then 4
	when CrickButtonIndex=5  then 6
	when CrickButtonIndex=6  then b.Singles
	when CrickButtonIndex=7  then b.Singles
	when CrickButtonIndex between 8 and 13  then CONCAT(b.Byes,'b')
	when CrickButtonIndex between 14 and 18 then if((b.Noballs-1)>0,CONCAT((b.Noballs-1),'nb'),'0nb')
	when CrickButtonIndex between 19 and 24 then CONCAT(b.Singles+(b.fours*4)+(b.Sixes*6),'+nb')
	when CrickButtonIndex between 25 and 30 then if((b.Wides-1)>0,CONCAT((b.Wides-1),'wd'),'0wd')
	when CrickButtonIndex between 31 and 36 then CONCAT(b.LegByes,'lb')
	end  separator '    ') overdetails into crthisover  from crball b,soccer.crmatchdetails m  where m.matchid = _MatchID and m.Innings = _Innings
 and m.Innings = b.Innings and m.matchid = b.matchid and `BallNumber`>(iSelectedOver-0.1) and `BallNumber`<(iSelectedOver+1.00);

	
	RETURN crthisover;
END ;;
DELIMITER ;
