CREATE DEFINER=`root`@`localhost` FUNCTION `crGetOverRuns`(_MatchID bigint,_Innings int,iSelectedOver int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare crthisoverRuns int default -1;
    declare returnResult int default 0;
        
	select IFNULL(sum(Singles)+(sum(fours)*4)+(sum(Sixes)*6)+sum(Byes)+sum(LegByes)+sum(Wides)+sum(NoBalls)+sum(Penalties) +(sum(TargetHit)*10),0)
    into crthisoverRuns 
    from soccer.crball  where 
    `MatchID`=_MatchID
	and `Innings`=_Innings and `BallNumber`>(iSelectedOver-0.1) and `BallNumber`<(iSelectedOver+1.00);
    
    SELECT crGetOverRunsPPPlus(_MatchID,_Innings,iSelectedOver)+crthisoverRuns into returnResult;
	
	RETURN returnResult;
END ;;
