CREATE DEFINER=`root`@`localhost` FUNCTION `crGetPartnershipAdjustment`(_partnershipid bigint, iselectedColumn int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare returnedResult int default 0;

case iselectedColumn 
		when 1 then
			SELECT FirstBatsmanRuns into returnedResult FROM soccer.crpartnershipsadjustment where idcrpartnerships =_partnershipid;
    	when 2 then 
			SELECT FirstBatsmanBalls into returnedResult FROM soccer.crpartnershipsadjustment where idcrpartnerships =_partnershipid;
    	when 3 then 
			SELECT SecondBatsmanRuns into returnedResult FROM soccer.crpartnershipsadjustment where idcrpartnerships =_partnershipid;
		when 4 then 
			SELECT SecondBatsmanBalls into returnedResult FROM soccer.crpartnershipsadjustment where idcrpartnerships =_partnershipid;
    	when 5 then 
			SELECT Runs into returnedResult FROM soccer.crpartnershipsadjustment where idcrpartnerships =_partnershipid;
    	when 6 then 
			SELECT Balls into returnedResult FROM soccer.crpartnershipsadjustment where idcrpartnerships =_partnershipid;
		when 7 then 
			SELECT Fours into returnedResult FROM soccer.crpartnershipsadjustment where idcrpartnerships =_partnershipid;
		when 8 then 
			SELECT Sixes into returnedResult FROM soccer.crpartnershipsadjustment where idcrpartnerships =_partnershipid;
		when 9 then 
			SELECT Wides into returnedResult FROM soccer.crpartnershipsadjustment where idcrpartnerships =_partnershipid;
		when 10 then 
			SELECT NoBalls into returnedResult FROM soccer.crpartnershipsadjustment where idcrpartnerships =_partnershipid;
            

    
end case;

RETURN returnedResult;
END ;;
DELIMITER ;
