CREATE DEFINER=`root`@`localhost` FUNCTION `crGetPartnershipRuns`(_Matchid bigint,_Innings int,PartnerFacingID bigint,PartnerNonFacingID bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	
		declare crPartnershipruns int default 0;
        	declare crPartnershipPPlusOverRuns int default 0;
	
		SELECT IFNULL(sum(Singles) + (sum(fours)*4) + (sum(Sixes)*6) + sum(Byes) + sum(LegByes) + sum(Wides) + sum(NoBalls) + sum(Penalties) + (sum(TargetHit)*10) ,0) into crPartnershipPPlusOverRuns
		FROM soccer.crball where _Innings = Innings and _MatchID = MatchID 
        and ((FacingBatsmanID = PartnerFacingID and NonFacingBatsmanID = PartnerNonFacingID) or  (FacingBatsmanID =PartnerNonFacingID  and NonFacingBatsmanID = PartnerFacingID))
        and crMatchTypeMenuID=34;

	

		SELECT IFNULL(sum(Singles)+(sum(fours)*4)+(sum(Sixes)*6),0)+sum(Byes)+sum(LegByes)+sum(Wides)+sum(NoBalls)+sum(Penalties) +(sum(TargetHit)*10) + crPartnershipPPlusOverRuns into crPartnershipruns
		FROM soccer.crball b
		WHERE ((FacingBatsmanID = PartnerFacingID and NonFacingBatsmanID = PartnerNonFacingID) or  (FacingBatsmanID =PartnerNonFacingID  and NonFacingBatsmanID = PartnerFacingID))
        AND (ValidBall = 1 OR Noballs > 0 OR Wides > 0) AND Matchid =_Matchid and Innings =  _Innings;


		RETURN crPartnershipruns;
END ;;
