CREATE DEFINER=`root`@`localhost` FUNCTION `crGetPartnershipWicketNumber`(_Matchid bigint,_Innings int,PartnerID bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	
		declare crPartshipWicketNumber int default -1;
        
        declare cridBallExist bigint default -1;
        
        SELECT idcrBall into cridBallExist FROM soccer.crfallofwickets where Playerid = PartnerID and Matchid = _Matchid and Innings = _Innings;
        
        if cridBallExist <> -1 then
			SELECT WicketNumber into crPartshipWicketNumber FROM soccer.crfallofwickets where Playerid = PartnerID and Matchid = _Matchid and Innings = _Innings;
            else 
            SELECT ifnull(MAX(WicketNumber),1) into crPartshipWicketNumber FROM soccer.crfallofwickets where Matchid=_Matchid and Innings = _Innings;
           
        end if;
     
		RETURN crPartshipWicketNumber;
END ;;
