BEGIN
	
		declare crPartshipWicketScore int default -1;
        declare cridBallExist bigint default null;
        
        SELECT idcrBall into cridBallExist FROM soccer.crfallofwickets where Playerid = PartnerID  and Matchid = _Matchid and Innings = _Innings;
        
        if cridBallExist is not null then

		SELECT IFNULL(sum(Singles)+(sum(fours)*4)+(sum(Sixes)*6)+sum(Byes)+sum(LegByes)+sum(Wides)+sum(NoBalls)+sum(Penalties) +(sum(TargetHit)*10),0)
		+ crGetBattingTeamRunsPPPlusOver(Matchid,Innings) into crPartshipWicketScore
