CREATE DEFINER=`root`@`localhost` FUNCTION `crGetPowerPlayRuns`(_MatchID BIGINT,_Innings INT,_iStartOver int,_EndOver int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare TotalRuns int default 0;

select sum(runs) into TotalRuns  from (SELECT crGetOverRuns(c.Matchid,c.Innings,BallNumber) runs FROM soccer.crball c,soccer.crmatchdetails m 
where  c.MatchID = m.Matchid AND c.Innings = m.Innings AND (BallNumber between (_iStartOver-1) and (_EndOver-1)) and m.Matchid = _MatchID 
and m.Innings= _Innings   group by substring_index(BallNumber,'.',1))as t;


return TotalRuns;
END ;;
DELIMITER ;
