CREATE DEFINER=`root`@`localhost` FUNCTION `crGetSessionRunRate`(_MatchID bigint,_Innings int,_Menuid int) RETURNS float
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare SessionRunRate float default 0;
    declare SessionBalls int default 0;
    
    select IFNULL(count(idcrBall),0) into SessionBalls from soccer.crball where (validball = 1 or  validball = 2)  and MatchID = _MatchID and crMatchTypeMenuID=_Menuid;
    
    SELECT IFNULL(ROUND((crGetSessionRuns(_MatchID,_Innings,_Menuid)/SessionBalls)*6 ,2),0) into SessionRunRate;

	RETURN SessionRunRate;
END ;;
