CREATE DEFINER=`root`@`localhost` FUNCTION `crGetSessionRuns`(_MatchID bigint,_Innings int,_Menuid int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare SessionRuns int default 0;
	
	SELECT IFNULL(sum(Singles)+(sum(fours)*4)+(sum(Sixes)*6)+sum(Byes)+sum(LegByes)+sum(Wides)+sum(NoBalls)+sum(Penalties) +(sum(TargetHit)*10),0) + crGetBattingTeamRunsPPPlusOver(_MatchID,_Innings) into SessionRuns
	FROM soccer.crball where  _MatchID = MatchID and crMatchTypeMenuID=_Menuid;

	RETURN SessionRuns;
END ;;
