CREATE DEFINER=`root`@`localhost` FUNCTION `crGetTeamWithMostPlayersForHideShowBars`(MatchID BIGINT,InningsID int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare HomeTeamPlayers int default 0;
	declare AwayTeamPlayers int default 0;

	select count(*) into HomeTeamPlayers FROM soccer.players,soccer.UISelected,soccer.sportcodes s,soccer.`match` m  where teamid=m.HomeTeamid and  TeamListPosion > -1 and PersonType NOT IN (49,48,47,44)   and s.sportcodesid = m.sportcodeid and m.matchid = UISelected.SelectedMatchID and TeamListPosion < s.NumberOfPlayer order by TeamListPosion limit 30;
	select count(*) into AwayTeamPlayers FROM soccer.players,soccer.UISelected,soccer.sportcodes s,soccer.`match` m  where teamid=m.AwayTeamid and  TeamListPosion > -1 and PersonType NOT IN (49,48,47,44)   and s.sportcodesid = m.sportcodeid and m.matchid = UISelected.SelectedMatchID and TeamListPosion < s.NumberOfPlayer order by TeamListPosion limit 30;
	
	if HomeTeamPlayers > AwayTeamPlayers then
		return HomeTeamPlayers;
	else 
		return AwayTeamPlayers;
	end if;

END ;;
DELIMITER ;
