CREATE DEFINER=`root`@`localhost` FUNCTION `crGetWormValuesLineYAxis`(_Innings int) RETURNS varchar(2000) CHARSET utf8
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare yLineValues varchar(2000) default '';
set @firstInningsTotal := 0;

SELECT Matchscore  into @firstInningsTotal FROM soccer.crmatchdetails,soccer.uiselected where Innings=177 and matchid = SelectedMatchID;

select concat('-10,',group_concat(round(((@WormRuns:=@WormRuns+OverRuns)/@firstInningsTotal) * 300,0) separator ',')) into yLineValues from ( select crGetOverRuns(c.Matchid,c.Innings,BallNumber) OverRuns  FROM soccer.crball c,soccer.uiselected u,soccer.crmatchdetails m 
where  c.MatchID = u.selectedMatchid AND c.Innings = m.Innings and m.Matchid = selectedMatchid and m.Innings= _Innings  and (BallNumber <> -1) group by substring_index(BallNumber,'.',1)  order by BallNumber) as r,
(select @WormRuns:=0) as w
;

RETURN yLineValues;
END ;;
