CREATE DEFINER=`root`@`localhost` FUNCTION `crGetWormYAxis`(iIndex int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare ireturnNumber int default 0;
declare iDivision int default 0;
declare iMaxOverRuns int default 0;

SELECT Matchscore  into iMaxOverRuns FROM soccer.crmatchdetails,soccer.uiselected where Innings=177 and matchid = SelectedMatchID;

if (mod(iMaxOverRuns,2) > 0) then

set  iMaxOverRuns = iMaxOverRuns + 1;

end if;

set iDivision = iMaxOverRuns / 4;

case iIndex when 1 then
set ireturnNumber = iMaxOverRuns - (iDivision * 3);
when 2 then
set ireturnNumber = iMaxOverRuns - (iDivision * 2);
when 3 then
set ireturnNumber = iMaxOverRuns - iDivision;
when 4 then
set ireturnNumber = iMaxOverRuns;
end case;




RETURN ireturnNumber;
END ;;
DELIMITER ;
