CREATE DEFINER=`root`@`localhost` FUNCTION `crGreyBowlerAfterCompletingOver`(_Matchid bigint,_Innings int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare crEndOver int default 0;
	declare crTempBowlerid bigint default 0;
	declare crActiveBowlerid bigint default 0;
	
	SELECT IFNULL(PlayerID,0) into crTempBowlerid  FROM crtemp WHERE idcrtemp = 0;
	SELECT Bowlerid into crActiveBowlerid FROM soccer.crball WHERE idcrBall = -1;
	
	SELECT EndofOver into crEndOver  FROM soccer.crmatchdetails where Matchid = _Matchid AND Innings =_Innings ;
	
    if(crEndOver=1 AND (crTempBowlerid = crActiveBowlerid OR crActiveBowlerid=0)) then
		return 1;
	else
		return 0;
	end if;
END ;;
