CREATE DEFINER=`root`@`localhost` FUNCTION `crUpdateBallsPerFifty`(_MatchID bigint,_Innings int,_idcrball bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare iFifyCount int default 0;
    declare iExistid int default 0;
    declare currentScore int default 0;
    
    
    SELECT ifnull(MAX(FiftyNumber),0) into iFifyCount FROM soccer.crballsperfifty Where MatchID=_MatchID and innings = _Innings;
    
    
    SELECT IFNULL(sum(Singles)+(sum(fours)*4)+(sum(Sixes)*6)+sum(Byes)+sum(LegByes)+sum(Wides)+sum(NoBalls)+sum(Penalties) +(sum(TargetHit)*10),0) 
		+ crGetBattingTeamRunsPPPlusOver(_MatchID,_Innings) score
	into currentScore
	FROM soccer.crball where Innings=_Innings and MatchID=_MatchID and idcrBall <= _idcrball;
    
    if (currentScore>=50 AND iFifyCount=0) then
		
        INSERT INTO `soccer`.`crballsperfifty` (`idcrBallperFifty`,`Matchid`,`Innings`,`FiftyNumber`,`idcrballEnd`)
        VALUES (null,_MatchID,_Innings,1,_idcrball);
        
        elseif (currentScore>=100 AND iFifyCount=1) then
		
        INSERT INTO `soccer`.`crballsperfifty` (`idcrBallperFifty`,`Matchid`,`Innings`,`FiftyNumber`,`idcrballEnd`)
        VALUES (null,_MatchID,_Innings,2,_idcrball);
        
        elseif (currentScore>=150 AND iFifyCount=2) then
		
        INSERT INTO `soccer`.`crballsperfifty` (`idcrBallperFifty`,`Matchid`,`Innings`,`FiftyNumber`,`idcrballEnd`)
        VALUES (null,_MatchID,_Innings,3,_idcrball);
        
        elseif (currentScore>=200 AND iFifyCount=3) then
		
        INSERT INTO `soccer`.`crballsperfifty` (`idcrBallperFifty`,`Matchid`,`Innings`,`FiftyNumber`,`idcrballEnd`)
        VALUES (null,_MatchID,_Innings,4,_idcrball);
        
        elseif (currentScore>=250 AND iFifyCount=4) then
		
        INSERT INTO `soccer`.`crballsperfifty` (`idcrBallperFifty`,`Matchid`,`Innings`,`FiftyNumber`,`idcrballEnd`)
        VALUES (null,_MatchID,_Innings,5,_idcrball);
        
         elseif (currentScore>=300 AND iFifyCount=5) then
		
        INSERT INTO `soccer`.`crballsperfifty` (`idcrBallperFifty`,`Matchid`,`Innings`,`FiftyNumber`,`idcrballEnd`)
        VALUES (null,_MatchID,_Innings,6,_idcrball);
        
        
         elseif (currentScore>=350 AND iFifyCount=6) then
		
        INSERT INTO `soccer`.`crballsperfifty` (`idcrBallperFifty`,`Matchid`,`Innings`,`FiftyNumber`,`idcrballEnd`)
        VALUES (null,_MatchID,_Innings,7,_idcrball);
        
        elseif (currentScore>=400 AND iFifyCount=7) then
		
        INSERT INTO `soccer`.`crballsperfifty` (`idcrBallperFifty`,`Matchid`,`Innings`,`FiftyNumber`,`idcrballEnd`)
        VALUES (null,_MatchID,_Innings,8,_idcrball);
        
       elseif (currentScore>=450 AND iFifyCount=8) then
		
        INSERT INTO `soccer`.`crballsperfifty` (`idcrBallperFifty`,`Matchid`,`Innings`,`FiftyNumber`,`idcrballEnd`)
        VALUES (null,_MatchID,_Innings,9,_idcrball);
        
        
        elseif (currentScore>=500 AND iFifyCount=9) then
		
        INSERT INTO `soccer`.`crballsperfifty` (`idcrBallperFifty`,`Matchid`,`Innings`,`FiftyNumber`,`idcrballEnd`)
        VALUES (null,_MatchID,_Innings,10,_idcrball);
        
	end if;
    

	RETURN currentScore;
END ;;
DELIMITER ;
