CREATE DEFINER=`root`@`localhost` FUNCTION `crUpdateBatting`(_MatchID bigint,_Innings int,_BatsmanID bigint,idball bigint) RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare idcrBattingCurrentEntry bigint default -1;
declare NumberOfBallsFaced int default 0;
declare NumberOfRuns int default 0;
declare NumberOfFours int default 0;
declare NumberOfDotballs int default 0;
declare NumberOfSingles int default 0;
declare NumberOfSixes int default 0;
declare crBatsmanSR VARCHAR(45) default 0;
declare crBatsmanAve int default 0;
declare crBatsmanBatted int default 0;
declare idUpdateBatsmanStatus int default -1;

if(_BatsmanID != 0) then

SELECT idcrBattingCurrent into idcrBattingCurrentEntry FROM `soccer`.`crbattingcurrent` where PlayerID = _BatsmanID and MatchID =_MatchID and Innings = _Innings;

if idcrBattingCurrentEntry = -1 then

INSERT INTO `soccer`.`crbattingcurrent` ( `PlayerID`, `MatchID`, `Innings`) VALUES (_BatsmanID,_MatchID,_Innings);
 select LAST_INSERT_ID()  into idcrBattingCurrentEntry ;
end if;

select IFNULL(crGetNumberOfValidBallsInInnings(_Innings,_MatchID,_BatsmanID)+ (crGetBatsmanAdjustment(_MatchID,_Innings,_BatsmanID,2)),0),
		IFNULL(crGetBatsmanRuns(_MatchID,_Innings,_BatsmanID)+ (crGetBatsmanAdjustment(_MatchID,_Innings,_BatsmanID,1)),0) ,
		IFNULL(crGetBatsmanFours(_MatchID,_Innings,_BatsmanID)+ (crGetBatsmanAdjustment(_MatchID,_Innings,_BatsmanID,5)),0),
		IFNULL(crGetBatsmanSixes(_MatchID,_Innings,_BatsmanID)+ (crGetBatsmanAdjustment(_MatchID,_Innings,_BatsmanID,6)),0),
		IFNULL(crGetBatsmanDots(_MatchID,_Innings,_BatsmanID)+ (crGetBatsmanAdjustment(_MatchID,_Innings,_BatsmanID,3)),0),
		IFNULL(crGetBatsmanSR(_MatchID,_Innings,_BatsmanID),'--'),
		IFNULL(crGetBatsmanSingles(_MatchID,_Innings,_BatsmanID),0)+ (crGetBatsmanAdjustment(_MatchID,_Innings,_BatsmanID,4)),
        ifnull(crGetBatsmanBatted(_MatchID,_Innings,_BatsmanID),0),
        IFNULL(crGetBatsmanStatusUpdate(_MatchID,_Innings,_BatsmanID,idball),'')
		
		
 into NumberOfBallsFaced,NumberOfRuns,NumberOfFours,NumberOfSixes,NumberOfDotballs,crBatsmanSR,NumberOfSingles,crBatsmanBatted,idUpdateBatsmanStatus;

UPDATE `soccer`.`crbattingcurrent` 
SET `Balls` = NumberOfBallsFaced,`Runs`=NumberOfRuns,`Dotballs`=NumberOfDotballs,`SR`=crBatsmanSR,`Fours` =NumberOfFours,`Sixes` =NumberOfSixes,`Singles`=NumberOfSingles,`BatsmanBatted`=crBatsmanBatted
WHERE idcrBattingCurrent=idcrBattingCurrentEntry;
end if;

RETURN idcrBattingCurrentEntry;
END ;;
DELIMITER ;
