CREATE DEFINER=`root`@`localhost` FUNCTION `crUpdateBowlerSpells`(_MatchID bigint,_Innings int,_idcrball bigint,_playerid bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare sbowlerspell int default -1;
    declare sbowlerspellover int default -1;
	declare CurrentOver int default -1;
    declare idcrspells int default -1;
    
    
    if(_idcrball <> -1) then
    
    select ifnull(Max(Over),-1),ifnull(Max(SpellNumber),-1),idcrBowlerSpells into sbowlerspellover,sbowlerspell,idcrspells FROM soccer.crbowlerspells s,soccer.crball b where s.Matchid=_MatchID And s.innings = _Innings
	AND s.Matchid=b.Matchid and s.innings =b.innings and Playerid = _playerid;
    
    SELECT substring_index(BallNumber,'.',1) into CurrentOver  FROM soccer.crball where matchid = _MatchID and innings =_Innings and bowlerid =_playerid and idcrball =_idcrball;
    
    if((CurrentOver-sbowlerspellover) > 2 or sbowlerspellover=-1) then
    
		INSERT INTO `soccer`.`crbowlerspells` (`idcrBowlerSpells`,`Matchid`,`Innings`,`playerid`,`Over`,`SpellNumber`,`idcrball`)
		VALUES(null,_MatchID,_Innings,_playerid,CurrentOver,(sbowlerspell+1),_idcrball);
        
		UPDATE `soccer`.`crball`
		SET `BowlerSpell` = (sbowlerspell+1)
		WHERE `idcrBall` = _idcrball;
        RETURN (sbowlerspell+1);
        
	else
    
		UPDATE `soccer`.`crbowlerspells`
		SET `idcrball` = _idcrball
		WHERE `idcrBowlerSpells` = idcrBowlerSpells;
        
        UPDATE `soccer`.`crball`
		SET `BowlerSpell` = sbowlerspell
		WHERE `idcrBall` = _idcrball;
        RETURN sbowlerspell;
    
    end if;
    
    end if;

END ;;
DELIMITER ;
