CREATE DEFINER=`root`@`localhost` FUNCTION `crUpdateBowling`(_MatchID bigint,_Innings int,_BowlerID bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare idcrBowlingCurrentEntry bigint default -1;
declare NumberOfOversBowled float default 0;
declare NumberOfRuns int default 0;
declare NumberOfWkts int default 0;
declare NumberOfDotballs int default 0;
declare NumberOfWides int default 0;
declare NumberOfNoballs int default 0;
declare NumberOfballs int default 0;
declare crBowlerEcon VARCHAR(45) default 0;
declare crBowlerSR VARCHAR(45) default 0;
declare crBowlerAve VARCHAR(45) default 0;
declare crBallsPerOverVAR int default 0;
declare crOvers int default 0;
declare crBalls int default 0;
declare crMaidens int default 0;
declare crBowlerBowled int default 0;

SELECT BallsPerOver into crBallsPerOverVAR FROM `soccer`.`crgamesetup` where matchid = _MatchID;
SELECT idcrBowlingCurrent into idcrBowlingCurrentEntry FROM `soccer`.`crbowlingcurrent` where PlayerID = _BowlerID and MatchID =_MatchID and Innings = _Innings;

if(_BowlerID NOT IN(0,-1)) then
if idcrBowlingCurrentEntry = -1 then

INSERT INTO `soccer`.`crbowlingcurrent` ( `PlayerID`, `MatchID`, `Innings`) VALUES (_BowlerID,_MatchID,_Innings);
 select LAST_INSERT_ID()  into idcrBowlingCurrentEntry ;
end if;


SELECT crGetNumberOfValidBallsForBowlerInInnings(_Innings,_MatchID,_BowlerID) + (crGetBowlerAdjustment(_MatchID,_Innings,_BowlerID,1)) into crBalls;


select IFNULL(crConvertBallsToOvers(crBalls),0),
		IFNULL(crGetBowlerRuns(_MatchID,_Innings,_BowlerID)+ (crGetBowlerAdjustment(_MatchID,_Innings,_BowlerID,2)),0) ,
		IFNULL(crGetBowlerWkts(_MatchID,_Innings,_BowlerID)+ (crGetBowlerAdjustment(_MatchID,_Innings,_BowlerID,3)),0),
		IFNULL(crGetBowlerDots(_MatchID,_Innings,_BowlerID)+ (crGetBowlerAdjustment(_MatchID,_Innings,_BowlerID,4)),0),
		IFNULL(Round(((crGetBowlerRuns(_MatchID,_Innings,_BowlerID)+ crGetBowlerAdjustment(_MatchID,_Innings,_BowlerID,2))/crGetNumberOfValidBallsForBowlerInInnings(_Innings,_MatchID,_BowlerID) + (crGetBowlerAdjustment(_MatchID,_Innings,_BowlerID,1)))*crBallsPerOverVAR,2),'--'),
		IFNULL(crGetBowlerWides(_MatchID,_Innings,_BowlerID)+ (crGetBowlerAdjustment(_MatchID,_Innings,_BowlerID,5)),0),
		IFNULL(crGetBowlerNoBalls(_MatchID,_Innings,_BowlerID)+ (crGetBowlerAdjustment(_MatchID,_Innings,_BowlerID,6)),0),
		IFNULL(crGetBowlerSR(_MatchID,_Innings,_BowlerID),'--'),
		IFNULL(crGetBowlerAve(_MatchID,_Innings,_BowlerID),'--'),
		
        ifnull(crGetBowlerMaidens(_MatchID,_Innings,_BowlerID)+ (crGetBowlerAdjustment(_MatchID,_Innings,_BowlerID,7)),0),
        crGetBowlerBowled(_MatchID,_Innings,_BowlerID),
        crBalls


 into NumberOfOversBowled,NumberOfRuns,NumberOfWkts,NumberOfDotballs,crBowlerEcon,NumberOfWides,NumberOfNoballs,crBowlerSR,crBowlerAve,crMaidens,crBowlerBowled,NumberOfballs;

UPDATE `soccer`.`crbowlingcurrent` 
SET `overs` = NumberOfOversBowled,`Runs`=NumberOfRuns,`Wkts`=NumberOfWkts,`DotBalls` =NumberOfDotballs,`Wides` =NumberOfWides,`Econ` =crBowlerEcon,`NoBalls` =NumberOfNoballs,`SR` =crBowlerSR,`Ave` =crBowlerAve,`Maidens`=crMaidens,`BowlerBowled` =crBowlerBowled,`Balls`=NumberOfballs
WHERE idcrBowlingCurrent=idcrBowlingCurrentEntry;
end if;

RETURN idcrBowlingCurrentEntry;
END ;;
DELIMITER ;
