CREATE DEFINER=`root`@`localhost` FUNCTION `crUpdateMatchDetials`(_MatchID bigint,_Innings int) RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
BEGIN


declare MatchDetailsIDreturn bigint default 0;
declare numberOfBalls int default 0;
declare TotalRuns int default 0;
declare TotalSixes int default 0;
declare TotalFours int default 0;
declare TotalByes int default 0;
declare TotalLegByes int default 0;
declare TotalWides int default 0;
declare TotalNoBalls int default 0;
declare TotalPenalties int default 0;
declare TotalDotBalls int default 0;
declare crRunRate int default 0;
declare crRequiredRR int default 0;
declare TotalFallenWickets int default 0;
declare TotalPPPlusOverRuns int default 0;

 select idMatchDetailsCricket into MatchDetailsIDreturn FROM soccer.crmatchdetails where _Innings = Innings and _MatchID = MatchID;

 if MatchDetailsIDreturn = 0  then 
 INSERT INTO `soccer`.`crmatchdetails`  ( `MatchID`,`Innings`)VALUES(_MatchID,_Innings);
 select LAST_INSERT_ID()  into MatchDetailsIDreturn ;
end if ;

select IFNULL(crGetNumberOfValidBallsInInnings(_Innings,_MatchID,-1),0) into numberOfBalls;
select IFNULL(crGetBattingTeamRuns(_MatchID,_Innings)+ (crGetMatchDetailsInningsAdjustment(_MatchID,_Innings,1)),0),
	   IFNULL(sum(fours)+ (crGetMatchDetailsInningsAdjustment(_MatchID,_Innings,3)),0),
       IFNULL(sum(Sixes)+ (crGetMatchDetailsInningsAdjustment(_MatchID,_Innings,4)),0),
       IFNULL(sum(Byes)+ (crGetMatchDetailsInningsAdjustment(_MatchID,_Innings,8)),0),
       IFNULL(sum(LegByes)+ (crGetMatchDetailsInningsAdjustment(_MatchID,_Innings,7)),0),
       IFNULL(sum(Wides)+ (crGetMatchDetailsInningsAdjustment(_MatchID,_Innings,5)),0),
       IFNULL(sum(NoBalls)+ (crGetMatchDetailsInningsAdjustment(_MatchID,_Innings,6)),0) ,
       IFNULL(sum(Penalties)+ (crGetMatchDetailsInningsAdjustment(_MatchID,_Innings,9)),0),
       IFNULL(sum(DOT),0),
       crGetBattingTeamWickets(_MatchID,_Innings)+ (crGetMatchDetailsInningsAdjustment(_MatchID,_Innings,2)),
       IFNULL(crGetBattingTeamRunsPPPlusOver(_MatchID,_Innings)+ (crGetMatchDetailsInningsAdjustment(_MatchID,_Innings,10)),0)
into TotalRuns, TotalFours,TotalSixes,TotalByes,TotalLegByes,TotalWides,TotalNoBalls,TotalPenalties,TotalDotBalls,TotalFallenWickets,TotalPPPlusOverRuns
FROM soccer.crball where _Innings = Innings and _MatchID = MatchID;

UPDATE `soccer`.`crmatchdetails`
SET

`MatchScore` = TotalRuns,
`Wickets` = TotalFallenWickets,
`Fours`= TotalFours,
`Sixes`= TotalSixes,
`Wides`= TotalWides,
`NoBalls`= TotalNoBalls,
`LegBytes`= TotalLegByes,
`Byes`= TotalByes,
`Penalties`= TotalPenalties,
`DotBalls` = TotalDotBalls,
`PPPlusOverRuns` = TotalPPPlusOverRuns,
`EndOfOver` = crEndOfOver(),
`InningsEnded` = 0


WHERE idMatchDetailsCricket=MatchDetailsIDreturn;
RETURN MatchDetailsIDreturn;
END ;;
DELIMITER ;
