CREATE DEFINER=`root`@`localhost` FUNCTION `crUpdateMatchInningsStatsRecalculate`(iMatchid bigint ,iInnings int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare val1 int default 0;
declare val2 int default 0;
declare val3 int default 0;
declare val4 int default 0;
declare val5 int default 0;

DELETE FROM `soccer`.`crbattingcurrent` WHERE idcrBattingCurrent > 0 AND Matchid =iMatchid and Innings =iInnings;
DELETE FROM `soccer`.`crbowlingcurrent` WHERE idcrBowlingcurrent > 0 AND Matchid = iMatchid and Innings =iInnings;
DELETE FROM `soccer`.`crpartnerships`	WHERE idcrpartnerships > 0 AND Matchid = iMatchid and Innings =iInnings;

SELECT `soccer`.`crUpdateBatting`(MatchID,Innings,FacingBatsmanID,idcrBall) UpdatedFacingBatsman ,
			   `soccer`.`crUpdateBatting`(MatchID,Innings,NonFacingBatsmanID,idcrBall) UpdatedNonFacingBatsman,
			   `soccer`.`crUpdateBowling`(MatchID,Innings,BowlerID) UpdatedActiveBowler,
			   `soccer`.`crUpdatePartnerships`(MatchID,Innings,FacingBatsmanID,NonFacingBatsmanID,idcrball),
			   `soccer`.`crUpdateTempTable`(MatchID,Innings,FacingBatsmanID,NonFacingBatsmanID,idcrball) into val1,val2,val3,val4,val5
		FROM soccer.crBall WHERE Matchid = iMatchid and Innings =iInnings;

RETURN 1;
END ;;
DELIMITER ;
