CREATE DEFINER=`root`@`localhost` FUNCTION `crUpdatePartnerships`(_MatchID bigint,_Innings int,_BatsmanID1 bigint,_BatsmanID2 bigint,_idcrball bigint) RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare idcrPartnershipEntry bigint default -1;
declare crPartnerAContribution int default 0;
declare crPartnerBContribution int default 0;
declare crPartnerABallsContribution int default 0;
declare crPartnerBBallsContribution int default 0;
declare crWicketNumber int default 0;
declare crBalls int default 0;
declare crRuns int default 0;
declare crfours int default 0;
declare crSixes int default 0;
declare crWides int default 0;
declare crNoBall int default 0;
declare crFallOfwicketScore int default 0;
declare crActive int default 0;
declare tempBatsmanID1 bigint default -1;
declare tempBatsmanID2 bigint default -1;

if(_idcrball <> -1) then

SELECT ifnull(idcrpartnerships,-1),`FirstBatsmanID`,`SecondBatsmanID` into idcrPartnershipEntry,tempBatsmanID1,tempBatsmanID2 FROM `soccer`.`crpartnerships` 
where ((SecondBatsmanID = _BatsmanID1 and FirstBatsmanID = _BatsmanID2) OR (FirstBatsmanID = _BatsmanID1 and SecondBatsmanID = _BatsmanID2) ) 
and MatchID =_MatchID and Innings = _Innings;


if idcrPartnershipEntry = -1  then

SELECT FacingBatsmanID,NonFacingBatsmanID into tempBatsmanID1,tempBatsmanID2  FROM soccer.crball where idcrBall = -1;

if ((_BatsmanID1=tempBatsmanID1 and _BatsmanID2=tempBatsmanID2) OR (_BatsmanID1=tempBatsmanID2 and _BatsmanID2=tempBatsmanID1) ) then

INSERT INTO `soccer`.`crpartnerships` (`MatchID`, `Innings`,`FirstBatsmanID`,`SecondBatsmanID`) VALUES (_MatchID,_Innings,tempBatsmanID1,tempBatsmanID2);
else

INSERT INTO `soccer`.`crpartnerships` (`MatchID`, `Innings`,`FirstBatsmanID`,`SecondBatsmanID`) VALUES (_MatchID,_Innings,_BatsmanID1,_BatsmanID2);
select _BatsmanID1,_BatsmanID2 into tempBatsmanID1,tempBatsmanID2;
end if;

 select LAST_INSERT_ID()  into idcrPartnershipEntry ;
end if;

	SELECT IFNULL(crGetPartnershipBatsmanContribution(MatchID,Innings,tempBatsmanID1,tempBatsmanID2) + (crGetPartnershipAdjustment(idcrPartnershipEntry,1)),0) PartnerAruns,
	IFNULL(crGetPartnershipBatsmanContribution(MatchID,Innings,tempBatsmanID2,tempBatsmanID1)+ (crGetPartnershipAdjustment(idcrPartnershipEntry,3)),0)  PartnerBruns,
    case when idcrball > -1 then crGetPartnershipWicketNumber(MatchID,Innings,crGetBatsmanidAfterWicket(idcrball,1)) end WktNo,
	IFNULL(crGetNumberOfValidBallsForPartnershipInInnings(MatchID,Innings,FacingBatsmanID,NonFacingBatsmanID)+ (crGetPartnershipAdjustment(idcrPartnershipEntry,6)),0) PartnershipBalls,
    IFNULL(crGetPartnershipRuns(MatchID,Innings,FacingBatsmanID,NonFacingBatsmanID)+ (crGetPartnershipAdjustment(idcrPartnershipEntry,5)),0) PartnershipRuns,
	IFNULL(crGetPartnershipFours(MatchID,Innings,FacingBatsmanID,NonFacingBatsmanID)+ (crGetPartnershipAdjustment(idcrPartnershipEntry,7)),0) 4s,
    IFNULL(crGetPartnershipSixes(MatchID,Innings,FacingBatsmanID,NonFacingBatsmanID)+ (crGetPartnershipAdjustment(idcrPartnershipEntry,8)),0) 6s,
    case when idcrball > -1 then crGetPartnershipWicketScore(MatchID,Innings,crGetBatsmanidAfterWicket(idcrball,1))  end,
	IFNULL(crGetPartnershipWides(MatchID,Innings,FacingBatsmanID,NonFacingBatsmanID)+ (crGetPartnershipAdjustment(idcrPartnershipEntry,9)),0) Wide,
    IFNULL(crGetPartnershipNoballs(MatchID,Innings,FacingBatsmanID,NonFacingBatsmanID)+ (crGetPartnershipAdjustment(idcrPartnershipEntry,10)),0) Noball,
    IFNULL(crGetPartnershipBatsmanBallsContribution(MatchID,Innings,tempBatsmanID1,tempBatsmanID2)+ (crGetPartnershipAdjustment(idcrPartnershipEntry,2)),0)PartnerABalls,
    IFNULL(crGetPartnershipBatsmanBallsContribution(MatchID,Innings,tempBatsmanID2,tempBatsmanID1)+ (crGetPartnershipAdjustment(idcrPartnershipEntry,4)),0) PartnerBBalls,
    case when idcrball > -1 then  if(crGetBatsmanidAfterWicket(idcrball,1)=0,1,0) end Active
	into 
	crPartnerAContribution,crPartnerBContribution,crWicketNumber,crBalls,crRuns,crfours,crSixes,crFallOfwicketScore,crWides,crNoBall,crPartnerABallsContribution,crPartnerBBallsContribution,crActive
	FROM soccer.crball b
	WHERE idcrball = _idcrball;

	UPDATE `soccer`.`crpartnerships` 
	SET `FirstBatsmanRuns` = crPartnerAContribution,`SecondBatsmanRuns`=crPartnerBContribution,
		`WicketNumber`=crWicketNumber,`Overs` =crConvertBallsToOvers(crBalls),`Runs` =crRuns,
		`Balls` = crBalls,`Fours` = crfours,`Sixes` = crSixes,
		`Wides`=crWides,`NoBalls` = crNoBall,`RunRate` = 0,`FallOfWicketScore` = crFallOfwicketScore,`Matchid` =_MatchID,`Innings` =_Innings,`FirstBatsmanBalls` =crPartnerABallsContribution,`SecondBatsmanBalls` =crPartnerBBallsContribution,`Active` =crActive
	WHERE idcrpartnerships=idcrPartnershipEntry;

end if;
	RETURN idcrPartnershipEntry;
END ;;
DELIMITER ;
