CREATE DEFINER=`root`@`localhost` FUNCTION `crUpdateTempTable`(_MatchID BIGINT,_InningsID int,_FacingBatsmanPlayerID BIGINT,_NonFacingBatsmanPlayerID BIGINT,vbowlerid bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare crFacingAsterik varchar(20) default '';
	declare crNonFacingAsterik varchar(20) default '';
	declare crEndOver int default 0;
	
	SELECT if(FacingBatsmanID=crGetBatsmanOnStrike() ,'*',''),if(NonFacingBatsmanID=crGetBatsmanOnStrike() ,'*','') into crFacingAsterik,crNonFacingAsterik FROM soccer.crball WHERE idcrBall = -1;
	SELECT EndOfOver into crEndOver FROM soccer.crmatchdetails m WHERE m.MatchID = _Matchid AND m.Innings = _InningsID AND m.InningsEnded != 1;
	
	if crEndOver = 0 then
	UPDATE `soccer`.`crtemp`
	SET `FacingBatsmanAsterik` = crFacingAsterik,
		 `NonFacingBatsmanAsterik` = crNonFacingAsterik,
		 `Playerid` = vbowlerid
		WHERE `idcrTemp` = 0;

	end if;
RETURN 1;
END ;;
