CREATE DEFINER=`root`@`localhost` FUNCTION `funGetMatchstatuswithovers`(MatchID int) RETURNS varchar(80) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN
    DECLARE varResults VARCHAR(80);
   SELECT CASE WHEN (f.Innings = 2) THEN
(

          select case when(f.TeamBallsLeft>0) then
          (
              SELECT case when(f.MatchWickets=10  ) then
              (
                  select case when((f.Target-1) = f.MatchTotal) then
                  (
                       select 'match drawn'
                  )else
                  (


                       select case when (10-f.MatchWickets) > 1 then
                        (
                          select concat (t.fullname,' won by ',10-f.MatchWickets,' Wickets')
                        )
                        else
                        (
                          select concat (t.fullname,' won by ',10-f.MatchWickets,' Wicket')
                        )end
                  )
                  end
              )else
              (
                select case when((f.Target-1) < f.MatchTotal) then
                (
                       
                    select case when (10-f.MatchWickets) > 1 then
                        (
                          select concat (t.fullname,' won by ',10-f.MatchWickets,' Wickets')
                        )
                        else
                        (
                          select concat (t.fullname,' won by ',10-f.MatchWickets,' Wicket')
                        )end
                )else
                (

                                select case when(f.InningsEnded= 0) then
                (

                      select case when(f.teamballsleft =1)and((f.Target)-f.MatchTotal =1) then
                      (
                     select concat(t.shortname, ' need ',(f.Target)-f.MatchTotal,' run of ',f.teamballsleft, ' ball ')
                      )when(f.teamballsleft >1)and((f.Target)-f.MatchTotal =1) then
                      (
                     select concat(t.shortname, ' need ',(f.Target)-f.MatchTotal,' run of ',f.teamballsleft, ' balls ')
                      )when(f.teamballsleft =1)and((f.Target)-f.MatchTotal >1) then
                      (
                     select concat(t.shortname, ' need ',(f.Target)-f.MatchTotal,' runs of ',f.teamballsleft, ' ball ')
                      )when(f.teamballsleft >1)and((f.Target)-f.MatchTotal >1) then
                      (
                     select concat(t.shortname, ' need ',(f.Target)-f.MatchTotal,' runs of ',f.teamballsleft, ' balls ')
                      )end
                ) else
                (

                                 select case when ((f.Target-1)-f.MatchTotal >1) then
                                (
                                           select concat (p.shortname,' won by ',(f.Target-1)-f.MatchTotal,' runs',case when m.MatchMethod=0 then ' 'when  m.MatchMethod=1 then ', VJD Method'when m.MatchMethod=2 then ', DL Method' end)
                                   )else
                                   (
                                          select concat (p.shortname,' won by ',(f.Target-1)-f.MatchTotal,' run',case when m.MatchMethod=0 then ' 'when  m.MatchMethod=1 then ', VJD Method'when m.MatchMethod=2 then ', DL Method' end)

                                )end


                )end


                )end
              )end


          )else
          (
             

             select case when((f.Target-1) = f.MatchTotal) then
             (
               select 'match drawn'
             )
             when((f.Target-1) > f.MatchTotal) then
             (
                select case when ((f.Target-1)-f.MatchTotal >1) then
                (
                   select concat (p.fullname,' won by ',(f.Target-1)-f.MatchTotal,' runs')
                )else
                (
                  select concat (p.fullname,' won by ',(f.Target-1)-f.MatchTotal,' run')

                )end
             )
             end


          )end

)
ELSE
(
    select case when (f.MatchTotal=1) then
    (

      SELECT CONCAT (t.fullname,' Lead by ',f.MatchTotal,' Run')
    )
    ELSE
    (
      SELECT CONCAT (t.fullname,' Lead by ',f.MatchTotal,' Runs')
    )END
)
END   INTO varResults

FROM  match_extras_analysis f,teams t,teams p,match_extras_analysis q ,match_details m
WHERE f.MatchId = MatchID and q.MatchId = MatchID AND f.Innings =2 AND t.TeamID = f.TeamID and p.teamid =q.TeamID and q.Innings =1 AND m.Matchid = MatchID ;
return varResults;
END ;;
DELIMITER ;
