CREATE DEFINER=`root`@`localhost` FUNCTION `GetActionAreaMinutesPlayed`(vMatchid bigint,iStatActionAreaID int,ifieldHalf1 int,ifieldHalf2 int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare returnMinPlayed int default 0;
	declare returnTotalMinPlayed int default 0;
	declare returnPercentage int default 0;
	





	drop temporary table if exists temp;
	create temporary table temp as 
	
	
	
	
	

	select MatchEventId,StatEvent,PlayerID_1,TimeStamp ActionAreaStartTime,TeamID,MatchID,EventHalf,TimeString,
	(ifnull(if(GetNextActionAreaEventHalf(StatEvent,e.MatchEventId)=e.EventHalf,GetNextActionAreaTimeStamp(StatEvent,e.MatchEventId),DATE_SUB(GetNextActionAreaTimeStamp(StatEvent,e.MatchEventId),INTERVAL GetELapsedTimeDuringBreak(matchid) SECOND)),
	(select if(EventHalf=e.EventHalf,TimeStamp,DATE_SUB(TimeStamp,INTERVAL GetELapsedTimeDuringBreak(matchid) SECOND)) FROM soccer.matchevents WHERE MatchEventId = (select  MAX(MatchEventId) FROM  soccer.matchevents)))) ActionAreaEndTime
	FROM soccer.matchevents e
	WHERE matchid = vMatchid AND (StatEvent =iStatActionAreaID or StatEvent =ifieldHalf1 or StatEvent =ifieldHalf2) AND EventHalf IN (41,43) ;


	select IFNULL(sum(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ActionAreaEndTime,ActionAreaStartTime),'%i:%s'))/60),0)),0) into returnMinPlayed from temp
	where StatEvent = iStatActionAreaID;

	select IFNULL(sum(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ActionAreaEndTime,ActionAreaStartTime),'%i:%s'))/60),0)),0) into returnTotalMinPlayed from temp;
	
	select ifnull(round((returnMinPlayed/returnTotalMinPlayed) * 100,0),0) into returnPercentage;

	RETURN returnPercentage;
END ;;
DELIMITER ;
