CREATE DEFINER=`root`@`localhost` FUNCTION `GetActionAreaPercentage`(vMatchid bigint,iActionhalf int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare iPercentage int default 0;
    declare iSelectedSportCode int default 0;
    declare iCurrentHalf int default 0;
	
    
    
    SELECT sportcodeid,MatchStatus into iSelectedSportCode,iCurrentHalf FROM soccer.`match` where matchid = vMatchid;
    
    case iSelectedSportCode when 4 then
    
    SELECT GetActionAreaPercentageRevamped(vMatchid,iActionhalf,0,iCurrentHalf) into iPercentage;
    
   
    
    when 5 then
    
	select GetActionAreaPercentageRugby(vMatchid,iActionhalf) into iPercentage;
    
    end case;

	RETURN iPercentage;
END ;;
