CREATE DEFINER=`root`@`localhost` FUNCTION `GetActionAreaPercentageRevamped`(vMatchid bigint,iActionhalf int,iSelTeamOrOverall int,iMatchHalf int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare iPercentage int default 0;
	declare iPercentageLeft int default 0;
    declare iPercentageCentre int default 0;
	declare iPercentageRight int default 0;
    
    declare iPercentageLeftSelTeam int default 0;
    declare iPercentageCentreSelTeam int default 0;
	declare iPercentageRightSelTeam int default 0;
    
    declare SelTeamID bigint default 0;
    declare iSelectedSportCode int default 0;
    declare iCurrentHalf int default 0;
    declare iTotalTime int default 0;
    declare iUpdateDiff int default 4;
    
    set @PrevTeamId = 0;
	set @GameStageStart =0;
	set @PrevTimeStamp =0;
	set @SinceStatEvent =0;
	set @PosInPlay =0;
    set @PrevAreaID=0;
    
    
    SELECT sportcodeid,MatchStatus into iSelectedSportCode,iCurrentHalf FROM soccer.`match` where matchid = vMatchid;
    SELECT `SelectedTeam` into SelTeamID FROM soccer.uiselected;
    
    case iSelectedSportCode when 4 then
    
    SELECT ifnull(TIMESTAMPDIFF(SECOND,cast(Variable_Value as datetime),now()),2) into iUpdateDiff  from soccer.ballsport_variables where idVariables = 4;

	if iUpdateDiff > 2 then  
    
		select matchevents.TimeStamp into @GameStageStart from soccer.matchevents where StatEvent = 152 and  MatchID = vMatchid and EventHalf = 41 order by MatchEventId desc limit 1;
		select matchevents.TimeStamp into @PrevTimeStamp from soccer.matchevents where StatEvent = 152 and  MatchID = vMatchid and EventHalf = 41  order by MatchEventId desc limit 1;
       
		drop temporary table if exists TempActionArea;
		create temporary table TempActionArea as 
        SELECT  @PrevTeamId as PreviousTeamID,
         @SinceStatEvent as PreviousStatID,@PrevAreaID as PreviousActionArea,
                case  @SinceStatEvent  
                when 15 then @PrevPos:=1 
                when 152 then @PrevPos:=1 
                when 14 then @PrevPos:=0 
                when 164 then @PrevPos:=0 
                else @PrevPos  end PosInPlay,
        
       `StatEvent`,time_to_sec(timediff(`TimeStamp`,@PrevTimeStamp)) as TimeInbetweenEvents,@PrevTimeStamp,
		@PrevTimeStamp:=`TimeStamp`,@SinceStatEvent:=`StatEvent` assignevent,
        case `StatEvent` when 120 then @PrevAreaID:=`StatEvent` when 121 then @PrevAreaID:=`StatEvent` when 122 then @PrevAreaID:=`StatEvent` else @PrevAreaID  end ActiveActionArea,
	 @PrevTeamId:=TeamID as TeamIDinPos ,
     EventHalf,
		timediff(`TimeStamp`,@GameStageStart) as TimeIntoGame 
		FROM soccer.matchevents s, (select @SinceStatEvent=0) as t
		where (StatEvent = 152 or StatEvent = 14 or StatEvent = 15 or StatEvent = 120 or StatEvent = 121 or StatEvent = 122 or StatEvent = 164 or StatEvent=151) and  MatchID = vMatchid and EventHalf in(41,42,43,44)
		order by MatchEventId;
    
            
		UPDATE `soccer`.`ballsport_variables`
		SET
		Variable_Value = now()
		WHERE  idVariables = 4;   
 
		 if iSelTeamOrOverall=0 then
         
				if iMatchHalf=-1 then
				select ifnull(sum(TimeInbetweenEvents),0) into iTotalTime from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14 and PosInPlay=1  and PreviousActionArea<>0;
                else
                select ifnull(sum(TimeInbetweenEvents),0) into iTotalTime from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14 and PosInPlay=1  and PreviousActionArea<>0 and EventHalf=iMatchHalf;
                end if;
			else
				if iMatchHalf=-1 then
				select ifnull(sum(TimeInbetweenEvents),0) into iTotalTime from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14 and PosInPlay=1 and PreviousTeamID=SelTeamID  and PreviousActionArea<>0;
                else
                select ifnull(sum(TimeInbetweenEvents),0) into iTotalTime from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14 and PosInPlay=1 and PreviousTeamID=SelTeamID  and PreviousActionArea<>0 and EventHalf=iMatchHalf;
                end if;
		end if;
        
       if iMatchHalf=-1 then  
       select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageLeft from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14  
       and PosInPlay=1 and ((PreviousStatID=120) or ((PreviousActionArea=120 and PreviousStatID=151) or (PreviousActionArea=120 and PreviousStatID=152) or (PreviousActionArea=120 and PreviousStatID=15)));
		
       select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageCentre from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14 
        and PosInPlay=1 and ((PreviousStatID=121) or ((PreviousActionArea=121 and PreviousStatID=151)  or (PreviousActionArea=121 and PreviousStatID=152) or (PreviousActionArea=121 and PreviousStatID=15)));
            
		
		if(iPercentageLeft) > 0 and iPercentageCentre > 0 then
			select (100 - (iPercentageLeft + iPercentageCentre)) into iPercentageRight;
		else
        select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageRight from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14  
        and PosInPlay=1 and ((PreviousStatID=122) or ((PreviousActionArea=122 and PreviousStatID=151)  or (PreviousActionArea=122 and PreviousStatID=152) or (PreviousActionArea=122 and PreviousStatID=15)));
        end if;
        
        
        
        
        select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageLeftSelTeam from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14  and PreviousTeamID=SelTeamID 
       and PosInPlay=1 and ((PreviousStatID=120) or ((PreviousActionArea=120 and PreviousStatID=151) or (PreviousActionArea=120 and PreviousStatID=152) or (PreviousActionArea=120 and PreviousStatID=15)));
		
       select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageCentreSelTeam from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14 and PreviousTeamID=SelTeamID 
        and PosInPlay=1 and ((PreviousStatID=121) or ((PreviousActionArea=121 and PreviousStatID=151)  or (PreviousActionArea=121 and PreviousStatID=152) or (PreviousActionArea=121 and PreviousStatID=15)));
            
		
		if(iPercentageLeftSelTeam) > 0 and iPercentageCentreSelTeam > 0 then
			select (100 - (iPercentageLeftSelTeam + iPercentageCentreSelTeam)) into iPercentageRightSelTeam;
		else
        select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageRightSelTeam from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14  and PreviousTeamID=SelTeamID 
        and PosInPlay=1 and ((PreviousStatID=122) or ((PreviousActionArea=122 and PreviousStatID=151)  or (PreviousActionArea=122 and PreviousStatID=152) or (PreviousActionArea=122 and PreviousStatID=15)));
        end if;
        
        else
        
         select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageLeft from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14  
       and PosInPlay=1 and ((PreviousStatID=120) or ((PreviousActionArea=120 and PreviousStatID=151) or (PreviousActionArea=120 and PreviousStatID=152) or (PreviousActionArea=120 and PreviousStatID=15)))  and EventHalf=iMatchHalf;
		
       select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageCentre from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14 
        and PosInPlay=1 and ((PreviousStatID=121) or ((PreviousActionArea=121 and PreviousStatID=151)  or (PreviousActionArea=121 and PreviousStatID=152) or (PreviousActionArea=121 and PreviousStatID=15))) and EventHalf=iMatchHalf;
            
		
		if(iPercentageLeft) > 0 and iPercentageCentre > 0 then
			select (100 - (iPercentageLeft + iPercentageCentre)) into iPercentageRight;
		else
        select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageRight from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14  
        and PosInPlay=1 and ((PreviousStatID=122) or ((PreviousActionArea=122 and PreviousStatID=151)  or (PreviousActionArea=122 and PreviousStatID=152) or (PreviousActionArea=122 and PreviousStatID=15))) and EventHalf=iMatchHalf;
        end if;
        
        
        
        
        select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageLeftSelTeam from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14  and PreviousTeamID=SelTeamID 
       and PosInPlay=1 and ((PreviousStatID=120) or ((PreviousActionArea=120 and PreviousStatID=151) or (PreviousActionArea=120 and PreviousStatID=152) or (PreviousActionArea=120 and PreviousStatID=15))) and EventHalf=iMatchHalf;
		
       select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageCentreSelTeam from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14 and PreviousTeamID=SelTeamID 
        and PosInPlay=1 and ((PreviousStatID=121) or ((PreviousActionArea=121 and PreviousStatID=151)  or (PreviousActionArea=121 and PreviousStatID=152) or (PreviousActionArea=121 and PreviousStatID=15))) and EventHalf=iMatchHalf;
            
		
		if(iPercentageLeftSelTeam) > 0 and iPercentageCentreSelTeam > 0 then
			select (100 - (iPercentageLeftSelTeam + iPercentageCentreSelTeam)) into iPercentageRightSelTeam;
		else
        select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageRightSelTeam from TempActionArea where PreviousStatID<>164 and PreviousStatID<>14  and PreviousTeamID=SelTeamID 
        and PosInPlay=1 and ((PreviousStatID=122) or ((PreviousActionArea=122 and PreviousStatID=151)  or (PreviousActionArea=122 and PreviousStatID=152) or (PreviousActionArea=122 and PreviousStatID=15))) and EventHalf=iMatchHalf;
        end if;
        
        end if;
        
        
        
        
       
       
        if iSelTeamOrOverall=0 then
		UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageLeft WHERE  idVariables =5 ; 
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageCentre WHERE  idVariables = 6;
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageRight WHERE  idVariables = 7;
        
        end if;
        
        
         if iSelTeamOrOverall=1 then
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageLeftSelTeam WHERE  idVariables = 9; 
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageCentreSelTeam WHERE  idVariables = 10;
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageRightSelTeam WHERE  idVariables = 11;
        
        end if;
        
        
        
	
	end if;
    
	
    
    case  iActionhalf
    when 0 then
    if iSelTeamOrOverall=0 then
		SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 5;
    else
		SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 9;
    end if;
    when 1 then
     if iSelTeamOrOverall=0 then
		SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 6;
    else
		SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 10;
    end if;
	when 2 then
	     if iSelTeamOrOverall=0 then
				SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 7;
		else
				SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 11;
		end if;
	end case;
    
    when 5 then
    
	select GetActionAreaPercentageRugby(vMatchid,iActionhalf) into iPercentage;
    
    end case;

	RETURN iPercentage;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP FUNCTION IF EXISTS `GetActionAreaPercentageRugby` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
