CREATE DEFINER=`root`@`localhost` FUNCTION `GetActionAreaPercentageRugby`(vMatchid bigint,iActionhalf int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare iPercentage int default 0;
	declare iPercentageFarLeft int default 0;
    declare iPercentageLeft int default 0;
	declare iPercentageRight int default 0;
    declare iPercentageFarRight int default 0;
    declare iTotalTime int default 0;
    declare iCurrentHalf int default 0;
    declare iUpdateDiff int default 4;
    
    set @PrevTeamId = 0;
	set @GameStageStart =0;
	set @PrevTimeStamp =0;
	set @SinceStatEvent =0;
	set @PosInPlay =0;
    
    SELECT ifnull(TIMESTAMPDIFF(SECOND,cast(Variable_Value as datetime),now()),2) into iUpdateDiff  from soccer.ballsport_variables where idVariables = 4;
    
  
	if iUpdateDiff > 2 then  
    
		SELECT MatchStatus into iCurrentHalf FROM soccer.`match` where matchid = vMatchid;
    
		select matchevents.TimeStamp into @GameStageStart from soccer.matchevents where StatEvent = 152 and  MatchID = vMatchid and EventHalf = iCurrentHalf order by MatchEventId desc limit 1;
		select matchevents.TimeStamp into @PrevTimeStamp from soccer.matchevents where StatEvent = 152 and  MatchID = vMatchid and EventHalf = iCurrentHalf  order by MatchEventId desc limit 1;


		drop temporary table if exists TempActionArea;
		create temporary table TempActionArea as SELECT  @PrevTeamId as PreviousTeamID,@PrevTeamId:=TeamID ,@SinceStatEvent CurStatEvent,
		time_to_sec(timediff(`TimeStamp`,@PrevTimeStamp)) as TimeInbetweenEvents,@PrevTimeStamp,
		@PrevTimeStamp:=`TimeStamp`,@SinceStatEvent:=`StatEvent` assignevent,
		(case 
		when (@SinceStatEvent=14) then @PosInPlay:=0 
		when (@SinceStatEvent=164) then @PosInPlay:=0 
		when (@SinceStatEvent=15) then @PosInPlay:=1 
		when (@SinceStatEvent=152) then @PosInPlay:=1 
		else @PosInPlay end) PosInPlay,
		timediff(`TimeStamp`,@GameStageStart) as TimeIntoGame 
		FROM soccer.matchevents
		where (StatEvent = 152 or StatEvent = 14 or StatEvent = 15 or StatEvent = 143 or StatEvent = 144 or StatEvent = 145 or StatEvent = 146 or StatEvent = 164) and  MatchID = vMatchid and Eventhalf = iCurrentHalf
		order by MatchEventId;
    
            
		UPDATE `soccer`.`ballsport_variables`
		SET
		Variable_Value = now()
		WHERE  idVariables = 4;   
        

		select ifnull(sum(TimeInbetweenEvents),0) into iTotalTime  from TempActionArea 
		where (CurStatEvent = 143 or CurStatEvent = 144 or CurStatEvent = 145 or CurStatEvent = 146) and TimeInbetweenEvents > 0 and (PosInPlay=1 or assignevent=14) and assignevent not in (152,164);
        

		select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageFarLeft from TempActionArea 
		where (CurStatEvent = 143) and TimeInbetweenEvents > 0 and (PosInPlay=1 or assignevent=14)  and assignevent not in (152,164);

		select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageLeft from TempActionArea 
		where (CurStatEvent = 144) and TimeInbetweenEvents > 0 and (PosInPlay=1 or assignevent=14) and assignevent not in (152,164);
        
        select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageRight from TempActionArea 
		where (CurStatEvent = 145) and TimeInbetweenEvents > 0 and (PosInPlay=1 or assignevent=14) and assignevent not in (152,164);
        
            

		if(iPercentageFarLeft + iPercentageLeft + iPercentageRight) > 0 then
			select (100 - (iPercentageFarLeft + iPercentageLeft + iPercentageRight)) into iPercentageFarRight;
		else
			select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageFarRight from TempActionArea 
			where (CurStatEvent = 146) and TimeInbetweenEvents > 0 and (PosInPlay=1 or assignevent=14) and assignevent not in (152,164);
        end if;
        
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageFarLeft WHERE  idVariables = 5; 
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageLeft WHERE  idVariables = 6;
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageRight WHERE  idVariables = 7;
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageFarRight WHERE  idVariables = 8;
	
	end if;
    
	
    
    case  iActionhalf
    when 0 then
    SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 5;
    when 1 then
	SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 6;
	when 2 then
	SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 7;
    when 3 then
	SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 8;
	end case;

	RETURN iPercentage;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP FUNCTION IF EXISTS `GetActionAreaPercentageSoccer` */;
