CREATE DEFINER=`root`@`localhost` FUNCTION `GetActionAreaPercentageSoccer`(vMatchid bigint,iActionhalf int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare iPercentage int default 0;
    declare iPercentageLeft int default 0;
    declare iPercentageCentre int default 0;
    declare iTotalTime int default 0;
    
	set @PrevTeamId = 0;
	set @GameStageStart =0;
	set @PrevTimeStamp =0;
	set @SinceStatEvent =0;

	select matchevents.TimeStamp into @GameStageStart from soccer.matchevents, soccer.uiselected where StatEvent = 152 and  MatchID = SelectedMatchID and EventHalf = 41;
	select matchevents.TimeStamp into @PrevTimeStamp from soccer.matchevents, soccer.uiselected where StatEvent = 152 and  MatchID = SelectedMatchID and EventHalf = 41;

	drop temporary table if exists temp;
	create temporary table temp as SELECT  @PrevTeamId as PreviousTeamID,@PrevTeamId:=TeamID ,@SinceStatEvent CurStatEvent,
	time_to_sec(timediff(`TimeStamp`,@PrevTimeStamp)) as TimeInbetweenEvents,@PrevTimeStamp,
	@PrevTimeStamp:=`TimeStamp`,@SinceStatEvent:=`StatEvent`,
	timediff(`TimeStamp`,@GameStageStart) as TimeIntoGame 
	FROM soccer.matchevents , soccer.uiselected
	where (StatEvent = 152 or StatEvent = 14 or StatEvent = 15 or StatEvent = 120 or StatEvent = 121 or StatEvent = 122) and  MatchID = SelectedMatchID 
	order by MatchEventId,@PrevTimeStamp;
    
    select sum(TimeInbetweenEvents) into iTotalTime  from TempActionArea 
	where (CurStatEvent = 120 or CurStatEvent = 121 or CurStatEvent = 122) and TimeInbetweenEvents > 0;
    
    if iSelectedSportCode = 4 then
		if iActionhalf= 0 then
			select Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0) into iPercentage from TempActionArea 
			where (CurStatEvent = 120) and TimeInbetweenEvents > 0;

		elseif iActionhalf= 1 then
			select Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0) into iPercentage from TempActionArea 
			where (CurStatEvent = 121) and TimeInbetweenEvents > 0;
            
		elseif iActionhalf= 2 then 

			select Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0) into iPercentageLeft from TempActionArea 
			where (CurStatEvent = 120) and TimeInbetweenEvents > 0;
            
            
			select Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0) into iPercentageCentre from TempActionArea 
			where (CurStatEvent = 121) and TimeInbetweenEvents > 0;


			if(iPercentageLeft + iPercentageCentre) > 0 then
				select (100 - (iPercentageLeft + iPercentageCentre)) into iPercentage;
			else
					select Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0) into iPercentageCentre from TempActionArea 
					where (CurStatEvent = 122) and TimeInbetweenEvents > 0;
			end if;
		end if;
	end if;
    

	RETURN iPercentage;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP FUNCTION IF EXISTS `GetActionAreaPerHalf` */;
