CREATE DEFINER=`root`@`localhost` FUNCTION `GetActionAreaPerHalf`(vMatchid bigint,iActionhalf int, iHalf int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare iPercentage int default 0;
	declare iPercentageLeft int default 0;
    declare iPercentageCentre int default 0;
	declare iPercentageRight int default 0;
    declare iSelectedSportCode int default 0;
    declare iCurrentHalf int default 0;
    declare iTotalTime int default 0;
    declare iUpdateDiff int default 4;
    
    set @PrevTeamId = 0;
	set @GameStageStart =0;
	set @PrevTimeStamp =0;
	set @SinceStatEvent =0;
	set @PosInPlay =0;
    
    
    SELECT sportcodeid into iSelectedSportCode FROM soccer.`match` where matchid = vMatchid;
    
    case iSelectedSportCode when 4 then
    
    SELECT ifnull(TIMESTAMPDIFF(SECOND,cast(Variable_Value as datetime),now()),2) into iUpdateDiff  from soccer.ballsport_variables where idVariables = 4;

	if iUpdateDiff > 2 then  
    
    if iHalf > -1 then
    
		select matchevents.TimeStamp into @GameStageStart from soccer.matchevents where StatEvent = 152 and  MatchID = vMatchid and EventHalf = iHalf order by MatchEventId desc limit 1;
		select matchevents.TimeStamp into @PrevTimeStamp from soccer.matchevents where StatEvent = 152 and  MatchID = vMatchid and EventHalf = iHalf  order by MatchEventId desc limit 1;


		drop temporary table if exists TempActionArea;
		create temporary table TempActionArea as SELECT  @PrevTeamId as PreviousTeamID,@PrevTeamId:=TeamID ,@SinceStatEvent CurStatEvent,
		time_to_sec(timediff(`TimeStamp`,@PrevTimeStamp)) as TimeInbetweenEvents,@PrevTimeStamp,
		@PrevTimeStamp:=`TimeStamp`,@SinceStatEvent:=`StatEvent` assignevent,
		(case 
		when (@SinceStatEvent=14) then @PosInPlay:=0 
		when (@SinceStatEvent=164) then @PosInPlay:=0 
		when (@SinceStatEvent=15) then @PosInPlay:=1 
		when (@SinceStatEvent=152) then @PosInPlay:=1 
		else @PosInPlay end) PosInPlay,
		timediff(`TimeStamp`,@GameStageStart) as TimeIntoGame 
		FROM soccer.matchevents
		where (StatEvent = 152 or StatEvent = 14 or StatEvent = 15 or StatEvent = 120 or StatEvent = 121 or StatEvent = 122 or StatEvent = 164) and  MatchID = vMatchid and EventHalf = iHalf
		order by MatchEventId;
        
	else
    
		select matchevents.TimeStamp into @GameStageStart from soccer.matchevents where StatEvent = 152 and  MatchID = vMatchid and EventHalf = 41 order by MatchEventId desc limit 1;
		select matchevents.TimeStamp into @PrevTimeStamp from soccer.matchevents where StatEvent = 152 and  MatchID = vMatchid and EventHalf = 41  order by MatchEventId desc limit 1;


		drop temporary table if exists TempActionArea;
		create temporary table TempActionArea as SELECT  @PrevTeamId as PreviousTeamID,@PrevTeamId:=TeamID ,@SinceStatEvent CurStatEvent,
		time_to_sec(timediff(`TimeStamp`,@PrevTimeStamp)) as TimeInbetweenEvents,@PrevTimeStamp,
		@PrevTimeStamp:=`TimeStamp`,@SinceStatEvent:=`StatEvent` assignevent,
		(case 
		when (@SinceStatEvent=14) then @PosInPlay:=0 
		when (@SinceStatEvent=164) then @PosInPlay:=0 
		when (@SinceStatEvent=15) then @PosInPlay:=1 
		when (@SinceStatEvent=152) then @PosInPlay:=1 
		else @PosInPlay end) PosInPlay,
		timediff(`TimeStamp`,@GameStageStart) as TimeIntoGame 
		FROM soccer.matchevents
		where (StatEvent = 152 or StatEvent = 14 or StatEvent = 15 or StatEvent = 120 or StatEvent = 121 or StatEvent = 122 or StatEvent = 164) and  MatchID = vMatchid
		order by MatchEventId;
        
    end if;
    
            
		UPDATE `soccer`.`ballsport_variables`
		SET
		Variable_Value = now()
		WHERE  idVariables = 4;   
        

		select ifnull(sum(TimeInbetweenEvents),0) into iTotalTime  from TempActionArea 
		where (CurStatEvent = 120 or CurStatEvent = 121 or CurStatEvent = 122) and TimeInbetweenEvents > 0 and (PosInPlay=1 or assignevent=14) and assignevent not in (152,164);
        

		select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageLeft from TempActionArea 
		where (CurStatEvent = 120) and TimeInbetweenEvents > 0 and (PosInPlay=1 or assignevent=14)  and assignevent not in (152,164);

		select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageCentre from TempActionArea 
		where (CurStatEvent = 121) and TimeInbetweenEvents > 0 and (PosInPlay=1 or assignevent=14) and assignevent not in (152,164);
            

		if(iPercentageLeft + iPercentageCentre) > 0 then
			select (100 - (iPercentageLeft + iPercentageCentre)) into iPercentageRight;
		else
			select ifnull(Round(((sum(TimeInbetweenEvents)/iTotalTime)*100),0),0) into iPercentageRight from TempActionArea 
			where (CurStatEvent = 122) and TimeInbetweenEvents > 0 and (PosInPlay=1 or assignevent=14) and assignevent not in (152,164);
        end if;
        
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageLeft WHERE  idVariables = 5; 
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageCentre WHERE  idVariables = 6;
        UPDATE `soccer`.`ballsport_variables` SET Variable_Value = iPercentageRight WHERE  idVariables = 7;
	
	end if;
    
	
    
    case  iActionhalf
    when 0 then
    SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 5;
    when 1 then
	SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 6;
	when 2 then
	SELECT Variable_Value into iPercentage FROM soccer.ballsport_variables where idVariables = 7;
	end case;
    
    when 5 then
    
	select GetActionAreaPercentageRugby(vMatchid,iActionhalf) into iPercentage;
    
    end case;

	RETURN iPercentage;

RETURN 1;
END ;;
