CREATE DEFINER=`root`@`localhost` FUNCTION `GetAwayTeamPossessionFromDataBase`() RETURNS float
    READS SQL DATA
    DETERMINISTIC
BEGIN
DECLARE TotalHomeTeamTime BIGINT  DEFAULT 0;
DECLARE TotalAwayTeamTime BIGINT  DEFAULT 0;
DECLARE TotalTime BIGINT  DEFAULT 0;
declare Pesentage float default 0;

select sum( 
case when a.statevent = 17 and a.teamid = c.awayteamid 
then (select (TimeToMicroSec(TIMEDIFF(GetStatEvenTimeStamp(a.MatchEventId),GetStatEvenTimeStamp(GetPreviousPossesionStatEventID(a.MatchEventId,a.matchID))))))
when a.statevent =14 and a.teamid =hometeamid 
then (select (TimeToMicroSec(TIMEDIFF(GetStatEvenTimeStamp(a.MatchEventId),GetStatEvenTimeStamp(GetPreviousPossesionStatEventID(a.MatchEventId,a.matchID)))))) 
end) into TotalHomeTeamTime
from soccer.matchevents a,`soccer`.`uiselected` b ,soccer.match c
where a.matchID = b.SelectedMatchID and (a.statevent = 12 or a.statevent = 17 or a.statevent = 14 or a.statevent = 15) and c.matchid = a.matchid;



select sum( 
case when a.statevent = 17 and a.teamid = c.Hometeamid 
then (select (TimeToMicroSec(TIMEDIFF(GetStatEvenTimeStamp(a.MatchEventId),GetStatEvenTimeStamp(GetPreviousPossesionStatEventID(a.MatchEventId,a.matchID))))))
when a.statevent =14 and a.teamid =awayteamid 
then (select (TimeToMicroSec(TIMEDIFF(GetStatEvenTimeStamp(a.MatchEventId),GetStatEvenTimeStamp(GetPreviousPossesionStatEventID(a.MatchEventId,a.matchID)))))) 
end) into TotalAwayTeamTime
from soccer.matchevents a,`soccer`.`uiselected` b ,soccer.match c
where a.matchID = b.SelectedMatchID and (a.statevent = 12 or a.statevent = 17 or a.statevent = 14 or a.statevent = 15) and c.matchid = a.matchid;

select (TotalAwayTeamTime/(TotalHomeTeamTime+TotalAwayTeamTime))*100 into Pesentage;

RETURN Pesentage;
END ;;
