CREATE DEFINER=`root`@`localhost` FUNCTION `GetBallsInOver`(_MatchID bigint, _Innings int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare crBallsInOver int default 0;
	declare crOvers float default 0;

	SELECT ROUND(crConvertBallsToOvers(crGetNumberOfValidBallsInInnings(_Innings,_MatchID,-1)),1) into crOvers;
	
	SELECT ROUND(TRUNCATE(Mod(crOvers,6),1) *10,0) into crBallsInOver;

	return crBallsInOver;
END ;;
DELIMITER ;
