CREATE DEFINER=`root`@`localhost` FUNCTION `GetBasketBallBasketPercentage`(Val1 INT,Val2 INT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
DECLARE Percentage INT DEFAULT 0;
DECLARE TotalStat INT DEFAULT 0;

SET TotalStat = Val1+Val2;
SET Percentage = IFNULL(((Val1/TotalStat) * 100),0);

 

RETURN Percentage;
END ;;
