CREATE DEFINER=`root`@`localhost` FUNCTION `GetBasketBallScore`(Selectedteamid bigint,Selectedmatchid bigint,iQtr int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare OnePointers int default 0;
declare TwoPointers int default 0;
declare ThreePointers int default 0;
declare PPOnePointers int default 0;
declare PPTwoPointers int default 0;
declare PPThreePointers int default 0;
declare TotalScore int default 0;

if iQtr = -1 then
SELECT count(StatEvent) into OnePointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 78;
SELECT count(StatEvent) into TwoPointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 79;
SELECT count(StatEvent) into ThreePointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 80;

SELECT count(StatEvent) into PPOnePointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 216;
SELECT count(StatEvent) into PPTwoPointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 217;
SELECT count(StatEvent) into PPThreePointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 218;

else
SELECT count(StatEvent) into OnePointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 78 AND EventHalf = iQtr;
SELECT count(StatEvent) into TwoPointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 79 AND EventHalf = iQtr;
SELECT count(StatEvent) into ThreePointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 80 AND EventHalf = iQtr;


SELECT count(StatEvent) into PPOnePointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 216 AND EventHalf = iQtr;
SELECT count(StatEvent) into PPTwoPointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 217 AND EventHalf = iQtr;
SELECT count(StatEvent) into PPThreePointers FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 218 AND EventHalf = iQtr;

end if;
SET TotalScore = (OnePointers)+(TwoPointers*2)+(ThreePointers*3)+(PPOnePointers*2)+(PPTwoPointers*4)+(PPThreePointers*6);

RETURN TotalScore;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
