CREATE DEFINER=`root`@`localhost` FUNCTION `GetCurrentSelectPlayerCardElaspedTime`() RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	DECLARE iElapsedMin INT DEFAULT 0;
		
	SELECT DISTINCT TIMESTAMPDIFF(MINUTE, IFNULL(e.Timestamp,NOW()),NOW())  TimeElasped INTO  iElapsedMin
	FROM soccer.matchevents e, soccer.uiselected u
	WHERE StatEvent=7 AND PlayerID_1 = u.SelectedPlayer AND e.MatchID = SelectedMatchID
	ORDER BY MatchEventId DESC LIMIT 1; 

		
