CREATE DEFINER=`root`@`localhost` FUNCTION `GetElapesedTimeSinceSelectedPlayerLastEvent`(SelectedEvent int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare EventID int;
declare EventID2 int;
declare PrevoiseEvent int;
declare PrevoiseEventType int; 
declare ElapsedTime int;
select max(MatchEventId) into EventID FROM soccer.matchevents,soccer.uiselected 
where StatEvent = SelectedEvent and uiselected.SelectedPlayer = matchevents.PlayerID_1 and uiselected.SelectedMatchID = matchevents.MatchID and matchevents.statevent = 59;
select min(MatchEventId) into EventID2 FROM soccer.matchevents where (statevent = 74 or statevent = 75)
and MatchEventId > EventID;
select StatEvent into PrevoiseEventType FROM soccer.matchevents where MatchEventId = EventID2;



case when PrevoiseEventType = 74 then
select 1 into ElapsedTime;
when PrevoiseEventType =75 then
select 2 into ElapsedTime;
else
select 0 into ElapsedTime;
end case; 



select sum(case when statevent = 74 then (select 0)
when statevent = 75 then (select TimeToMicroSec(TIMEDIFF(TimeStamp,((GetStatEvenTimeStamp((select GetPreviousStatEventID(MatchEventId,74))))))))
else (select 0)
end) into ElapsedTime
FROM soccer.matchevents where (statevent = 74 or statevent = 75) and  MatchEventId > EventID;






RETURN ElapsedTime;
END ;;
