CREATE DEFINER=`root`@`localhost` FUNCTION `GetELapsedTimeDuringBreak`(vMatchid bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare lapsedtime int default 0;
	declare firsthalfend datetime default null;
	declare secondhalfstart datetime default null;
	
	select TimeStamp into firsthalfend FROM soccer.matchevents WHERE MatchEventId = (select  MAX(MatchEventId) FROM  soccer.matchevents WHERE Eventhalf = 42 AND Matchid = vMatchid);
	select TimeStamp into secondhalfstart FROM soccer.matchevents WHERE MatchEventId = (select  MIN(MatchEventId) FROM  soccer.matchevents WHERE Eventhalf = 43 AND Matchid = vMatchid);
	
	select IFNULL(sum(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(secondhalfstart,firsthalfend),'%i:%s'))/60),0)),0) into lapsedtime;

	RETURN lapsedtime;
END ;;
DELIMITER ;
