CREATE DEFINER=`root`@`localhost` FUNCTION `GetELapsedTimeDuringStartPauseMatch`(vMatchid bigint, iHalf int,iStatMatchEventid bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare lapsedtime int default 0;
	
		set @PrevTeamId = 0;
		set @GameStageStart =0;
		set @PrevTimeStamp =0;
		set @SinceStatEvent =0;

		select matchevents.TimeStamp into @GameStageStart from soccer.matchevents where StatEvent = 152 and  MatchID = vMatchid and EventHalf = iHalf order by MatchEventId desc limit 1;
		select matchevents.TimeStamp into @PrevTimeStamp from soccer.matchevents where StatEvent = 152 and  MatchID = vMatchid and EventHalf = iHalf  order by MatchEventId desc limit 1;


		drop temporary table if exists TempMatchStartStop;
		create temporary table TempMatchStartStop as 
		SELECT  @PrevTeamId as PreviousTeamID,@PrevTeamId:=TeamID ,@SinceStatEvent CurStatEvent,
		time_to_sec(timediff(`TimeStamp`,@PrevTimeStamp)) as TimeInbetweenEvents,@PrevTimeStamp,
		@PrevTimeStamp:=`TimeStamp`,@SinceStatEvent:=`StatEvent` assignevent,
		timediff(`TimeStamp`,@GameStageStart) as TimeIntoGame 
		FROM soccer.matchevents
		where (StatEvent = 152 or StatEvent = 76 or StatEvent = 77) and  MatchID = vMatchid and  MatchEventId > iStatMatchEventid
		order by MatchEventId;
        
        
        select ifnull(sum(TimeInbetweenEvents),0) into lapsedtime  from TempMatchStartStop 
		where TimeInbetweenEvents > 0 and (CurStatEvent = 76  and assignevent=77) and assignevent not in (152,164);

    
    
	RETURN lapsedtime;
END ;;
DELIMITER ;
