CREATE DEFINER=`root`@`localhost` FUNCTION `GetEventTimeAsFormatedTime`(EventID bigint) RETURNS varchar(300) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare timeofevent bigint;
declare returnstring varchar(300);
SELECT TimeString into timeofevent
FROM `soccer`.`matchevents` where MatchEventId = EventID;
select concat(convert(timeofevent,char(11)),case when timeofevent%100 BETWEEN 11 AND 13 THEN 'th' when timeofevent%10 = 1 THEN 'st' WHEN timeofevent%10 = 2 THEN 'nd' WHEN timeofevent%10 = 3 THEN 'rd'  ELSE 'th' end   )  into returnstring;

RETURN returnstring;
END ;;
