CREATE DEFINER=`root`@`localhost` FUNCTION `GetEventTimeIntoGameConvertedToMicroSecond`(MatchEventId int(11)) RETURNS bigint(6)
    READS SQL DATA
BEGIN
declare retTime TIMESTAMP(6) default NULL; 
declare retTimeCast bigint default NULL; 
declare Time1 DATETIME(6) default NULL; 
declare Time2 DATETIME(6) default NULL; 

select GetStatEvenTimeStamp(a.MatchEventId) into Time1
from soccer.matchevents a   ,`soccer`.`uiselected` b ,soccer.match c
where a.matchID = b.SelectedMatchID and a.MatchEventId= MatchEventId and (a.statevent = 12 or a.statevent = 17 or a.statevent = 14 or a.statevent = 15) and c.matchid = a.matchid;



select GetStatEvenTimeStamp((select min(e.MatchEventId) from soccer.matchevents e ,`soccer`.`uiselected` f ,soccer.match g 
where e.matchID = f.SelectedMatchID and e.statevent = 12 and g.matchid = e.matchid)) into Time2;

select TimeToMicroSec(TIMEDIFF(Time1,Time2)) into retTimeCast;


RETURN retTimeCast;
END ;;
