CREATE DEFINER=`root`@`localhost` FUNCTION `GetGameStatPlayerLeader`(vTeamID BIGINT, vEventID1 INT,vEventID2 INT,vEventID3 INT,vEventID4 INT,vEventID5 INT) RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE TopLeaderID BIGINT;
	DROP TEMPORARY TABLE IF EXISTS TempLeader;

	CREATE TEMPORARY TABLE TempLeader AS
	SELECT PlayerID_1, COUNT(*) Stat FROM soccer.matchevents b,`soccer`.`uiselected` c WHERE StatEvent IN (vEventID1,vEventID2,vEventID3,vEventID4,vEventID5) and TeamID = vTeamID and b.matchID = c.SelectedMatchID GROUP BY PlayerID_1;
	
	SELECT PlayerID_1 INTO TopLeaderID FROM TempLeader ORDER BY Stat DESC LIMIT 1;
 
	RETURN TopLeaderID;
END ;;
