CREATE DEFINER=`root`@`localhost` FUNCTION `GetGameStatPlayerLeaderByPoints`(vTeamID BIGINT) RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	DECLARE done INT DEFAULT FALSE;
	DECLARE TopLeaderID BIGINT;
	DECLARE curPlayerID BIGINT DEFAULT 0;
	DECLARE 1p INT DEFAULT 0;
	DECLARE 2p INT DEFAULT 0;
	DECLARE 3p INT DEFAULT 0;


	DECLARE PlayersCURSOR CURSOR FOR SELECT DISTINCT PlayerID_1 FROM soccer.matchevents b,`soccer`.`uiselected` c WHERE TeamID = vTeamID and b.matchID = c.SelectedMatchID;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done=TRUE;

	DROP TEMPORARY TABLE IF EXISTS TempLeaderByPoints;
	CREATE TEMPORARY TABLE TempLeaderByPoints (PlayerID INT,Points INT);

	OPEN PlayersCURSOR;

	read_loop: LOOP

	FETCH PlayersCURSOR INTO curPlayerID;

	IF done THEN
		LEAVE read_loop;
	END IF;

	SELECT COUNT(*) Stat INTO 1p FROM soccer.matchevents b,`soccer`.`uiselected` c WHERE StatEvent = 78 and TeamID = vTeamID and b.matchID = c.SelectedMatchID AND PlayerID_1 = curPlayerID;
	SELECT COUNT(*)*2 Stat INTO 2p FROM soccer.matchevents b,`soccer`.`uiselected` c WHERE StatEvent = 79 and TeamID = vTeamID and b.matchID = c.SelectedMatchID AND PlayerID_1 = curPlayerID;
	SELECT COUNT(*)*3 Stat INTO 3p FROM soccer.matchevents b,`soccer`.`uiselected` c WHERE StatEvent = 80 and TeamID = vTeamID and b.matchID = c.SelectedMatchID AND PlayerID_1 = curPlayerID;
	
	INSERT TempLeaderByPoints VALUES(curPlayerID,(1p+2p+3p));


	END LOOP read_loop;

	SELECT PlayerID INTO TopLeaderID FROM TempLeaderByPoints ORDER BY Points DESC LIMIT 1;
 
	RETURN TopLeaderID;
END ;;
DELIMITER ;
