CREATE DEFINER=`root`@`localhost` FUNCTION `GetGoalScoreListNumberOfRowsGrouped`() RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare HtRowCount int;
declare AtRowCount int;
declare returnVal  int;

SELECT COUNT(DISTINCT(b.PlayerID_1))  into AtRowCount
   FROM soccer.matchevents b,soccer.match  a ,`soccer`.`uiselected` c ,`soccer`.`players` d
   where ((b.statevent = 40 and b.teamid = a.AwayTeamID) or (b.statevent = 42 and b.teamid = a.AwayTeamID ) or (b.statevent = 41 and b.teamid = a.HomeTeamID )) 
   and b.MatchID = a.matchID 
   and b.PlayerID_1 =d.PlayerID 
   and c.SelectedMatchID = a.matchID;


SELECT COUNT(DISTINCT(b.PlayerID_1)) into HtRowCount
   FROM soccer.matchevents b,soccer.match  a ,`soccer`.`uiselected` c ,`soccer`.`players` d
   where ((b.statevent = 40 and b.teamid = a.HomeTeamID) or (b.statevent = 42 and b.teamid = a.HomeTeamID ) or (b.statevent = 41 and b.teamid = a.AwayTeamID )) 
   and b.MatchID = a.matchID 
   and b.PlayerID_1 =d.PlayerID 
   and c.SelectedMatchID = a.matchID;

if HtRowCount > AtRowCount then set returnVal = HtRowCount ;
ELSEIF (HtRowCount < AtRowCount) then set returnVal = AtRowCount ;
	else set returnVal = AtRowCount ;
end if;





RETURN returnVal;



RETURN 1;
END ;;
DELIMITER ;
