CREATE DEFINER=`root`@`%` FUNCTION `GetHockeyCirclePenetrations`(iTeamid bigint,ifield int) RETURNS float
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare iTotalCirclePenetration int default 0;
    declare iLeftPenetration int default 0;
    declare iCentrePenetration int default 0;
    declare iRightPenetration int default 0;
     declare iPercentage float default 0;
    
    SELECT count(StatEvent) into iTotalCirclePenetration FROM soccer.matchevents b,soccer.`match`  a ,
    `soccer`.`uiselected` c where b.teamid = iTeamid and b.MatchID = a.matchID 
    and StatEvent in (9,171,172,173) and  a.matchID = c.SelectedMatchID;
    
    SELECT count(StatEvent) into iLeftPenetration FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c 
    where b.teamid = iTeamid 
    and b.MatchID = a.matchID and StatEvent =171  and a.matchID = c.SelectedMatchID;
    
    SELECT count(StatEvent) into iCentrePenetration FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c 
    where b.teamid = iTeamid 
    and b.MatchID = a.matchID and StatEvent =172  and a.matchID = c.SelectedMatchID;
    
    SELECT count(StatEvent) into iRightPenetration FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c 
    where b.teamid = iTeamid 
    and b.MatchID = a.matchID and StatEvent =173  and a.matchID = c.SelectedMatchID;
    
    if ifield=0 then 
		select TRUNCATE((iLeftPenetration/iTotalCirclePenetration)*100,1) into iPercentage;
    elseif ifield=1 then
		select TRUNCATE((iCentrePenetration/iTotalCirclePenetration)*100,1) into iPercentage;
    elseif ifield=2 then
		
		
		
			select TRUNCATE((iRightPenetration/iTotalCirclePenetration)*100,1) into iPercentage;
		
    end if;
    

	RETURN iPercentage;
END ;;
DELIMITER ;
