CREATE DEFINER=`root`@`%` FUNCTION `GetHockeyCirclePenetrationsColour`(ifield int,iCompareVal1 int,iCompareVal2 int) RETURNS float
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare result int default 0;
    
    select case 
when ifield > iCompareVal1 and ifield >  iCompareVal2 then 1
when ifield > iCompareVal1 and ifield =  iCompareVal2 then 1
when ifield = iCompareVal1 and ifield >  iCompareVal2 then 1

when ifield < iCompareVal1 and ifield >  iCompareVal2 then 2
when ifield = iCompareVal1 and ifield <  iCompareVal2 then 2
when ifield < iCompareVal1 and ifield =  iCompareVal2 then 2
when ifield > iCompareVal1 and ifield <  iCompareVal2 then 2

when ifield < iCompareVal1 and ifield <  iCompareVal2 then 3

 end into result;

RETURN result;
END ;;
