    READS SQL DATA
    DETERMINISTIC
BEGIN
declare iReturnScore int default 0;

select (select count(statevent) FROM soccer.matchevents 
where  ((statevent = 1 or statevent = 2 or statevent = 115 ) 
and teamid = vTeamid and matchid = vMatchid) or (statevent = 10 
and teamid = vAwayTeam and matchid = vMatchid)) + 

(SELECT count(e.StatEvent)*2  
FROM soccer.matchevents e,soccer.`match` m 
where e.teamid = vTeamid and e.MatchID = m.MatchID 
and e.MatchID = vMatchid and (e.StatEvent = 169 or e.StatEvent = 170 or e.StatEvent = 210)) into iReturnScore;

RETURN iReturnScore;
END ;;
