(TIMEDIFF(now(6),GetStatEvenTimeStamp(a.MatchEventId))) < "00:05:00.000000";



select sum( 
case when a.statevent = 17 and a.teamid = c.Hometeamid 
then (select (TimeToMicroSec(TIMEDIFF(GetStatEvenTimeStamp(a.MatchEventId),GetStatEvenTimeStamp(GetPreviousPossesionStatEventID(a.MatchEventId,a.matchID))))))
when a.statevent =14 and a.teamid =c.awayteamid 
then (select (TimeToMicroSec(TIMEDIFF(GetStatEvenTimeStamp(a.MatchEventId),GetStatEvenTimeStamp(GetPreviousPossesionStatEventID(a.MatchEventId,a.matchID)))))) 
end) into TotalAwayTeamTime
from soccer.matchevents a,`soccer`.`uiselected` b ,soccer.match c
where a.matchID = b.SelectedMatchID and (a.statevent = 12 or a.statevent = 17 or a.statevent = 14 or a.statevent = 15) and c.matchid = a.matchid and a.eventhalf = c.MatchStatus and 
(TIMEDIFF(now(6),GetStatEvenTimeStamp(a.MatchEventId))) < "00:05:00.000000";


select ifnull((TotalHomeTeamTime/(TotalHomeTeamTime+TotalAwayTeamTime))*100,50) into Pesentage;

RETURN Pesentage;
END ;;
