CREATE DEFINER=`root`@`localhost` FUNCTION `GetLastGoalScorerTeamID`() RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare returnid BIGINT;
declare EventsID bigint;
declare EventStat int;
declare tempID BIGINT;
select max(matcheventid) into EventsID 
FROM soccer.matchevents a,`soccer`.`uiselected` b 
where (a.statevent = 40 or a.statevent = 42 or a.statevent = 41) and a.matchid = b.`SelectedMatchID`;

select TeamID,statevent into tempID,EventStat
FROM soccer.matchevents a where MatchEventId = EventsID;

if(EventStat = 41)  then


select distinct TeamID  into returnid
FROM soccer.matchevents a,`soccer`.`uiselected` b 
where a.matchid = b.`SelectedMatchID` and a.TeamID <> tempID and a.Teamid <> 0;

else

select TeamID into returnid
FROM soccer.matchevents a where MatchEventId = EventsID;
end if;

RETURN returnid;
END ;;
