CREATE DEFINER=`root`@`localhost` FUNCTION `GetLogBonusPointsBasketballInTournament`(SelTeamID BIGINT,SelTournaMent BIGINT,SelGroup INT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE iResult INT DEFAULT 0;
    declare iLossBy INT DEFAULT 0;

	IF(SelTournaMent = 35) THEN
	SELECT COUNT(*) as Goals INTO iResult FROM Soccer.`match`  m 
	WHERE adminTournament = SelTournaMent and m.Groupid = SelGroup
	AND ((m.HomeTeamID = SelTeamID AND HometeamScore >= 65) OR 
	(m.AwayTeamID = SelTeamID AND AwayteamScore >= 65));
    
    select GetLogNumberOfGamesLostInTournamentLessThan(SelTeamID,SelTournaMent,6) into  iLossBy;
    

	RETURN (iResult+iLossBy);
	ELSE
	RETURN 0;
	END IF;
END ;;
DELIMITER ;
