CREATE DEFINER=`root`@`localhost` FUNCTION `GetLogBonusPointsHockeyInTournament`(SelTeamID BIGINT,SelTournaMent BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE iResultScore INT DEFAULT 0;
	DECLARE iResult INT DEFAULT 0;

	SELECT COUNT(*) as Goals INTO iResultScore FROM Soccer.`Match`  m 
	WHERE adminTournament = SelTournaMent 
	AND ((m.HomeTeamID = SelTeamID AND (HometeamScore-AwayteamScore) >= 3) OR 
	(m.AwayTeamID = SelTeamID AND (AwayteamScore-HometeamScore) >= 3));

	

	RETURN iResult + iResultScore;
END ;;
DELIMITER ;
