CREATE DEFINER=`root`@`localhost` FUNCTION `GetLogGoalsAgainstInTournament`(SelTeamID BIGINT,SelTournaMent BIGINT,SelGroup int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN


declare returnsnumber int default 0;

declare score1 int default 0;
declare score2 int default 0;

select ifnull(sum(b.hometeamscore),0) into score1
FROM soccer.match b 
where b.AdminTournament = SelTournaMent and b.Groupid = SelGroup and b.MatchStatus <> (SELECT min(idGameStages) FROM soccer.gamestages where gametype = b.SportCodeID) 
and b.AwayTeamID = SelTeamID;

select ifnull(sum(b.awayteamscore),0) into score2
FROM soccer.match b 
where b.AdminTournament = SelTournaMent and b.Groupid = SelGroup and b.MatchStatus <> (SELECT min(idGameStages) FROM soccer.gamestages where gametype = b.SportCodeID) 
and b.HomeTeamID = SelTeamID;

IF (score1 < 0) then
	SET score1 = (score1 * (-1));
end if;

IF (score2 < 0) then
	SET score2 = (score2 * (-1));
end if;

select score1+score2 into returnsnumber;

RETURN returnsnumber;
END ;;
DELIMITER ;
