CREATE DEFINER=`root`@`localhost` FUNCTION `GetLogNumberOfGamesLostInTournament`(SelTeamID BIGINT,SelTournaMent BIGINT,SelGroup int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare totalwinsNormalPeriod int default 0;
declare totalwinsinAfterPeriod int default 0;
declare returnsnumber int;

if SelTournaMent=35 then

select count(b.matchid)  into totalwinsNormalPeriod
FROM soccer.`match` b 
where b.AdminTournament = SelTournaMent and b.Groupid = SelGroup 
and b.MatchStatus <> (SELECT min(idGameStages) FROM soccer.gamestages where gametype = b.SportCodeID) 
and ((b.HomeTeamID = SelTeamID and b.HomeTeamScore < b.AwayTeamScore and b.HomeTeamScore<> 0) 
or (b.AwayTeamID = SelTeamID and b.HomeTeamScore > b.AwayTeamScore and b.AwayTeamScore<> 0));

elseif SelTournaMent=63 then

select count(b.matchid)   into totalwinsinAfterPeriod
FROM soccer.`match` b 
where b.AdminTournament = SelTournaMent and b.Groupid = SelGroup 
and ((b.HomeTeamID = SelTeamID and b.HomeTeamLogPoint < b.AwayTeamLogPoint) 
or (b.AwayTeamID = SelTeamID and b.HomeTeamLogPoint > b.AwayTeamLogPoint));

else 

select count(b.matchid)  into totalwinsNormalPeriod
FROM soccer.`match` b 
where b.AdminTournament = SelTournaMent and b.Groupid = SelGroup 
and b.MatchStatus <> (SELECT min(idGameStages) FROM soccer.gamestages where gametype = b.SportCodeID) 
and ((b.HomeTeamID = SelTeamID and b.HomeTeamScore < b.AwayTeamScore) 
or (b.AwayTeamID = SelTeamID and b.HomeTeamScore > b.AwayTeamScore));

end if;

select (totalwinsNormalPeriod  +  totalwinsinAfterPeriod) into returnsnumber;

RETURN returnsnumber;
END ;;
DELIMITER ;
