CREATE DEFINER=`root`@`localhost` FUNCTION `GetLogTeamPosition`(iTeamid bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare returnPos int default 0;
    
   drop temporary table if exists tempLogTeams;
    
	CREATE TEMPORARY TABLE tempLogTeams
				AS
				SELECT teamid,GetTeamNameFromID(teamid) FROM soccer.soccertournamentlog AS t    WHERE t.TeamID > 0
                order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid);
                
 drop temporary table if exists tempPos;

     CREATE TEMPORARY TABLE tempPos
				AS           
	SELECT (@cnt := @cnt + 1) AS Position,teamid  FROM tempLogTeams, (SELECT @cnt := 0) AS dummy;
                 
			SELECT Position into returnPos  FROM tempPos WHERE teamid = iTeamid;
            
			DROP TEMPORARY TABLE tempPos;
            			DROP TEMPORARY TABLE tempLogTeams;

RETURN returnPos;
END ;;
DELIMITER ;
