CREATE DEFINER=`root`@`localhost` FUNCTION `GetNeballAwayTeamGoalPersentage`() RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
DECLARE HomeScore float DEFAULT 0;
DECLARE HomeAttempts float DEFAULT 0;
DECLARE Persentage INT DEFAULT 0;
DECLARE isportcode INT DEFAULT 0;


SELECT sportcodeid into isportcode FROM soccer.`match`,soccer.`uiselected` WHERE matchid = SelectedMatchID;

if isportcode = 9 then
SELECT count(StatEvent) into HomeScore FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c where b.teamid = a.AwayTeamID and b.MatchID = a.matchID and StatEvent IN (123,124,125,126,127,128) and a.matchID = c.SelectedMatchID;
SELECT count(StatEvent) into HomeAttempts FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c where b.teamid = a.AwayTeamID and b.MatchID = a.matchID and StatEvent IN (129,130,131) and a.matchID = c.SelectedMatchID;

else

SELECT count(StatEvent) into HomeScore FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c where b.teamid = a.AwayTeamID and b.MatchID = a.matchID and (StatEvent = 18 or StatEvent = 72) and a.matchID = c.SelectedMatchID;
SELECT count(StatEvent) into HomeAttempts FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c where b.teamid = a.AwayTeamID and b.MatchID = a.matchID and (StatEvent = 20 or statevent = 183) and a.matchID = c.SelectedMatchID;
end if;
if (HomeAttempts+HomeScore) > 0 then
select (HomeScore /(HomeAttempts+HomeScore))*100 into Persentage;
END IF;

RETURN Persentage;
END ;;
