declare AmountOfPowerPlay4Goals int default 0;
declare AmountOfPowerPlay6Goals int default 0;
declare TotalScore int default null;
if SelectedQuater = -1 then
SELECT count(StatEvent) into AmountOf1Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 123;
SELECT count(StatEvent) into AmountOf2Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 124;
SELECT count(StatEvent) into AmountOf3Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 125;

SELECT count(StatEvent) into AmountOfPowerPlay2Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 126;
SELECT count(StatEvent) into AmountOfPowerPlay4Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 127;
SELECT count(StatEvent) into AmountOfPowerPlay6Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 128;

else

SELECT count(StatEvent) into AmountOf1Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 123 and EventHalf = SelectedQuater;
SELECT count(StatEvent) into AmountOf2Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 124 and EventHalf = SelectedQuater;
SELECT count(StatEvent) into AmountOf3Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 125 and EventHalf = SelectedQuater;

SELECT count(StatEvent) into AmountOfPowerPlay2Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 126 and EventHalf = SelectedQuater;
SELECT count(StatEvent) into AmountOfPowerPlay4Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 127 and EventHalf = SelectedQuater;
SELECT count(StatEvent) into AmountOfPowerPlay6Goals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 128 and EventHalf = SelectedQuater;

end if;




select (AmountOf1Goals*1)+(AmountOf2Goals*2) +(AmountOf3Goals*3)+
		(AmountOfPowerPlay2Goals*2)+(AmountOfPowerPlay4Goals*4) +(AmountOfPowerPlay6Goals*6)
 into TotalScore;



RETURN TotalScore;
END ;;
