CREATE DEFINER=`root`@`localhost` FUNCTION `GetNetballTeamScore`(Selectedteamid BIGINT,Selectedmatchid BIGINT,SelectedQuater int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare AmountOfGoals int default 0;
declare AmountOfPowerGoals int default 0;
declare TotalScore int default null;
if SelectedQuater = -1 then
SELECT count(StatEvent) into AmountOfGoals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 18;
SELECT count(StatEvent) into AmountOfPowerGoals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 72;
else
SELECT count(StatEvent) into AmountOfGoals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 18 and EventHalf = SelectedQuater;
SELECT count(StatEvent) into AmountOfPowerGoals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 72 and EventHalf = SelectedQuater;
end if;




select (AmountOfGoals*1)+(AmountOfPowerGoals*2) into TotalScore;



RETURN TotalScore;
END ;;
DELIMITER ;
