		MatchEventId =GetNextStatActionAreaEventID(iMatcheventid,145)or 
		MatchEventId =GetNextStatActionAreaEventID(iMatcheventid,146)) LIMIT 1;

	when 145 then
		select EventHalf into resulteventhalf
		FROM soccer.matchevents 
