CREATE DEFINER=`root`@`localhost` FUNCTION `GetPlayerGoalsCountString`(iPlayerid bigint,iMatchid bigint) RETURNS varchar(45) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare returnResult varchar(45);
    declare rTotalStat int default 0;
    
    SELECT count(StatEvent) INTO rTotalStat FROM soccer.matchevents
	where matchevents.PlayerID_1 = iPlayerid and matchevents.StatEvent IN (40,42) and matchevents.Matchid = iMatchid;

	select case rTotalStat 
    when 1 then 'GOAL' 
    when 2 then '2nd GOAL'
    when 3 then '3rd GOAL'
    else
    CONCAT(rTotalStat,'th GOAL') 
    end into returnResult;
    
	RETURN returnResult;
END ;;
