CREATE DEFINER=`root`@`localhost` FUNCTION `GetPlayerMinsPlayed`(vPlayerID BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
		DECLARE MatchStartTime TIME DEFAULT NULL;
		DECLARE PlayerOnTime TIME DEFAULT NULL;
		DECLARE PlayerOffTime TIME DEFAULT NULL;
		DECLARE FirstHalfStartTime TIME DEFAULT NULL;
		DECLARE FirstHalfStopTime TIME DEFAULT NULL;
		DECLARE SecondHalfStartTime TIME DEFAULT NULL;
		DECLARE SecondHalfStopTime TIME DEFAULT NULL;

		DECLARE MinPlayed1stHalf INT DEFAULT 0;
		DECLARE MinPlayed2ndHalf INT DEFAULT 0;
		DECLARE MinPlayed INT DEFAULT 0;

		DECLARE MatchCurHalf INT DEFAULT 0;
		DECLARE PlayerOffHalf INT DEFAULT 0;
		DECLARE CurrTime TIME DEFAULT NULL;
		DECLARE bSub BOOLEAN DEFAULT FALSE;

		DECLARE ExtraTime INT DEFAULT 0;
		DECLARE ExtraTime1 INT DEFAULT 0;
		DECLARE ExtraTime2 INT DEFAULT 0;
		DECLARE ExtTime1Start TIME DEFAULT NULL;
		DECLARE ExtTime1Stop TIME DEFAULT NULL;
		DECLARE ExtTime2Start TIME DEFAULT NULL;
		DECLARE ExtTime2Stop TIME DEFAULT NULL;


		SELECT TimeStamp INTO FirstHalfStartTime FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 41 LIMIT 1;
	
		SELECT TimeStamp INTO FirstHalfStopTime FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 42 LIMIT 1;

		SELECT TimeStamp INTO SecondHalfStartTime FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 43 ORDER BY TimeStamp ASC LIMIT 1;

		SELECT TimeStamp INTO SecondHalfStopTime FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 44 LIMIT 1;

		SELECT distinct TimeStamp INTO PlayerOnTime FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND e.PlayerID_2 =vPlayerID AND e.EventHalf <> (SELECT MIN(idGameStages) FROM soccer.gamestages WHERE GameType = 4) AND e.StatEvent = 106 LIMIT 1;

		SELECT distinct TimeStamp,EventHalf INTO PlayerOffTime,PlayerOffHalf FROM Soccer.matchevents e,Soccer.uiselected u  WHERE e.Matchid = u.selectedMatchid AND e.PlayerID_1 =vPlayerID AND e.EventHalf <> (SELECT MIN(idGameStages) FROM soccer.gamestages WHERE GameType = 4) AND e.StatEvent = 106 LIMIT 1;

		SELECT Now() INTO CurrTime;

		SELECT MatchStatus INTO MatchCurHalf FROM Soccer.`match` m,Soccer.uiselected u WHERE m.Matchid = u.selectedMatchid;

		IF PlayerOnTime IS NULL THEN
			SET MatchStartTime =FirstHalfStartTime;
			
		ELSE
			SET MatchStartTime = PlayerOnTime;
			SET bSub = TRUE;
		END IF;
		
		IF(PlayerOffTime IS NOT NULL AND PlayerOffHalf=41) THEN
			SELECT TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(PlayerOffTime,MatchStartTime),'%H:%i'))/60),0) INTO MinPlayed;
			RETURN MinPlayed;
		
		ELSEIF (PlayerOffTime IS NOT NULL AND PlayerOffHalf=43) THEN  

			SELECT TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(FirstHalfStopTime,MatchStartTime),'%H:%i'))/60),0) INTO MinPlayed1stHalf;
			
			IF SecondHalfStopTime IS NULL THEN
				SELECT TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(PlayerOffTime,SecondHalfStartTime),'%H:%i'))/60),0) INTO MinPlayed2ndHalf;
			END IF;

			SET MinPlayed = (MinPlayed1stHalf + MinPlayed2ndHalf);
			RETURN MinPlayed;
		
		ELSE

			IF FirstHalfStopTime  IS NULL THEN
				SELECT TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,MatchStartTime),'%H:%i'))/60),0) INTO MinPlayed;
				RETURN MinPlayed;
			ELSE

				IF bSub = TRUE THEN

					IF SecondHalfStopTime IS NULL THEN
						SELECT TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,MatchStartTime),'%H:%i'))/60),0) INTO MinPlayed2ndHalf;
					ELSE
						SELECT TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(SecondHalfStopTime,MatchStartTime),'%H:%i'))/60),0) INTO MinPlayed2ndHalf;
					END IF;
					
					IF MatchCurHalf > 45 THEN 
						SELECT TimeStamp INTO ExtTime1Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 46 ORDER BY TimeStamp ASC LIMIT 1;

						IF MatchStartTime < ExtTime1Start THEN

								IF(MatchCurHalf = 46)	 THEN

									SELECT TimeStamp INTO ExtTime1Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 46 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,ExtTime1Start),'%H:%i'))/60),0),0) INTO ExtraTime;

								ELSEIF (MatchCurHalf > 47 AND MatchCurHalf < 49) THEN

									SELECT TimeStamp INTO ExtTime1Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 46 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT TimeStamp INTO ExtTime1Stop FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 47 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT TimeStamp INTO ExtTime2Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 48 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ExtTime1Stop,ExtTime1Start),'%H:%i'))/60),0),0) INTO ExtraTime1;
									SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,ExtTime2Start),'%H:%i'))/60),0),0) INTO ExtraTime2;
							
									SET ExtraTime = (ExtraTime1+ExtraTime2);
								ELSEIF MatchCurHalf = 49 THEN
									SELECT TimeStamp INTO ExtTime1Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 46 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT TimeStamp INTO ExtTime1Stop FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 47 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT TimeStamp INTO ExtTime2Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 48 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT TimeStamp INTO ExtTime2Stop FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 49 ORDER BY TimeStamp ASC LIMIT 1;

									SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ExtTime1Stop,ExtTime1Start),'%H:%i'))/60),0),0) INTO ExtraTime1;
							
									IF ExtTime2Stop IS NULL THEN
										SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,ExtTime2Start),'%H:%i'))/60),0),0) INTO ExtraTime2;
									ELSE
										SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ExtTime2Stop,ExtTime2Start),'%H:%i'))/60),0),0) INTO ExtraTime2;
									END IF;
									SET ExtraTime = (ExtraTime1+ExtraTime2);
								ELSE
									SET ExtraTime = 0;
							
								END IF;	

						ELSE

								IF(MatchCurHalf = 46)	 THEN

									SELECT TimeStamp INTO ExtTime1Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 46 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,MatchStartTime),'%H:%i'))/60),0),0) INTO ExtraTime;
									RETURN ExtraTime;

								ELSEIF (MatchCurHalf > 47 AND MatchCurHalf < 49) THEN

									SELECT TimeStamp INTO ExtTime1Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 46 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT TimeStamp INTO ExtTime1Stop FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 47 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT TimeStamp INTO ExtTime2Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 48 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ExtTime1Stop,MatchStartTime),'%H:%i'))/60),0),0) INTO ExtraTime1;
									SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,ExtTime2Start),'%H:%i'))/60),0),0) INTO ExtraTime2;
							
									SET ExtraTime = (ExtraTime1+ExtraTime2);
									RETURN ExtraTime;

								ELSEIF MatchCurHalf = 49 THEN
									SELECT TimeStamp INTO ExtTime1Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 46 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT TimeStamp INTO ExtTime1Stop FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 47 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT TimeStamp INTO ExtTime2Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 48 ORDER BY TimeStamp ASC LIMIT 1;
									SELECT TimeStamp INTO ExtTime2Stop FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 49 ORDER BY TimeStamp ASC LIMIT 1;

									SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ExtTime1Stop,MatchStartTime),'%H:%i'))/60),0),0) INTO ExtraTime1;
							
									IF ExtTime2Stop IS NULL THEN
										SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,ExtTime2Start),'%H:%i'))/60),0),0) INTO ExtraTime2;
									ELSE
										SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ExtTime2Stop,ExtTime2Start),'%H:%i'))/60),0),0) INTO ExtraTime2;
									END IF;
									SET ExtraTime = (ExtraTime1+ExtraTime2);
									RETURN ExtraTime;
								ELSE
									SET ExtraTime = 0;
							
								END IF;	

						
						END IF;
					
					END IF;
					

				ELSE

					
					IF MatchCurHalf > 45 THEN 

						
						IF(MatchCurHalf = 46)	 THEN

							SELECT TimeStamp INTO ExtTime1Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 46 ORDER BY TimeStamp ASC LIMIT 1;
							SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,ExtTime1Start),'%H:%i'))/60),0),0) INTO ExtraTime;

						ELSEIF (MatchCurHalf > 47 AND MatchCurHalf < 49) THEN

							SELECT TimeStamp INTO ExtTime1Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 46 ORDER BY TimeStamp ASC LIMIT 1;
							SELECT TimeStamp INTO ExtTime1Stop FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 47 ORDER BY TimeStamp ASC LIMIT 1;
							SELECT TimeStamp INTO ExtTime2Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 48 ORDER BY TimeStamp ASC LIMIT 1;
							SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ExtTime1Stop,ExtTime1Start),'%H:%i'))/60),0),0) INTO ExtraTime1;
							SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,ExtTime2Start),'%H:%i'))/60),0),0) INTO ExtraTime2;
							
							SET ExtraTime = (ExtraTime1+ExtraTime2);

						ELSEIF MatchCurHalf = 49 THEN
							SELECT TimeStamp INTO ExtTime1Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 46 ORDER BY TimeStamp ASC LIMIT 1;
							SELECT TimeStamp INTO ExtTime1Stop FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 47 ORDER BY TimeStamp ASC LIMIT 1;
							SELECT TimeStamp INTO ExtTime2Start FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 12 AND EventHalf = 48 ORDER BY TimeStamp ASC LIMIT 1;
							SELECT TimeStamp INTO ExtTime2Stop FROM Soccer.matchevents e,Soccer.uiselected u WHERE e.Matchid = u.selectedMatchid AND  e.StatEvent = 164 AND EventHalf = 49 ORDER BY TimeStamp ASC LIMIT 1;

							SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ExtTime1Stop,ExtTime1Start),'%H:%i'))/60),0),0) INTO ExtraTime1;
							
							IF ExtTime2Stop IS NULL THEN
							SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,ExtTime2Start),'%H:%i'))/60),0),0) INTO ExtraTime2;
							ELSE
							SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ExtTime2Stop,ExtTime2Start),'%H:%i'))/60),0),0) INTO ExtraTime2;
							END IF;
							SET ExtraTime = (ExtraTime1+ExtraTime2);
						ELSE
							SET ExtraTime = 0;
							
						END IF;	

					END IF;
					
					SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(FirstHalfStopTime,MatchStartTime),'%H:%i'))/60),0),0) INTO MinPlayed1stHalf;
					IF SecondHalfStopTime IS NULL THEN
						SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(CurrTime,SecondHalfStartTime),'%H:%i'))/60),0),0) INTO MinPlayed2ndHalf;
					ELSE
						SELECT IFNULL(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(SecondHalfStopTime,SecondHalfStartTime),'%H:%i'))/60),0),0) INTO MinPlayed2ndHalf;
					END IF;

				END IF;

				SET MinPlayed = (MinPlayed1stHalf + MinPlayed2ndHalf) + (ExtraTime);
				
			END IF;

		END IF;
	
		RETURN MinPlayed;

END ;;
