CREATE DEFINER=`root`@`%` FUNCTION `GetPlayerPassesRatio`(iMatchid bigint, iPlayerid bigint) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare Result int default 0;

select round(ifnull(TRUNCATE((`GetPlayerStatCount`(16,iPlayerid,iMatchid)/(`GetPlayerStatCount`(16,iPlayerid,iMatchid)+ `GetPlayerStatCount`(17,iPlayerid,iMatchid)))*100,0),100),0) into Result;

RETURN Result;
END ;;
