    READS SQL DATA
    DETERMINISTIC
BEGIN

declare Result int default 0;

case iStatType
when 0 then
SELECT GetPlayerSelectExtraStat(iPlayerid,29)+(SELECT count(StatEvent) FROM soccer.matchevents m 	where m.PlayerID_1 =iPlayerid  and m.StatEvent = 182 and m.EventHalf=41 and m.Matchid = iMatchid) +(SELECT count(StatEvent) FROM soccer.matchevents b,soccer.`match`  a  where b.MatchID = a.matchID and StatEvent = 106 and a.matchID = iMatchid and b.PlayerID_2 = iPlayerid)  into Result;
when 1 then
SELECT GetPlayerSelectExtraStat(iPlayerid,17)+GetPlayerStatCount(40,iPlayerid,iMatchid) +GetPlayerStatCount(42,iPlayerid,iMatchid)  into Result;

end case;

RETURN Result;
END ;;
