CREATE DEFINER=`root`@`localhost` FUNCTION `GetRugbyCurrentSelectedPlayerKickingStats`() RETURNS varchar(100) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare iTotalKicks int default 0;
declare iTotalKicksSuccesfull int default 0;

declare iConevertions int default 0;
declare iPenalties int default 0;
declare iDropGoal int default 0;


declare iConevertionsSuccesfull int default 0;
declare iPenaltiesSuccesfull int default 0;



declare Result VARCHAR(100) default '';
declare OutOfString VARCHAR(100) default '';
declare KicksDeferiationConevertions VARCHAR(100) default '';
declare KicksDeferiationPenalties VARCHAR(100) default '';
declare KicksDropGoal VARCHAR(100) default '';



select count(StatEvent) FROM soccer.matchevents,soccer.uiselected u  
where MatchID =u.selectedMatchid and PlayerID_1 = u.selectedPlayer 
and  StatEvent = 44 and eventresult IN (0,1) into iConevertions;


select count(StatEvent) FROM soccer.matchevents,soccer.uiselected u  
where MatchID =u.selectedMatchid and PlayerID_1 = u.selectedPlayer 
and  StatEvent = 46 and eventresult IN (0,1) into iPenalties;


select count(StatEvent) FROM soccer.matchevents,soccer.uiselected u  
where MatchID =u.selectedMatchid and PlayerID_1 = u.selectedPlayer 
and  StatEvent = 61 into iDropGoal;







select GetCurrentSelectPlayerStatCountSuccesfull(44) into iConevertionsSuccesfull;
select GetCurrentSelectPlayerStatCountSuccesfull(46) into iPenaltiesSuccesfull;


select iConevertions+iPenalties into iTotalKicks;
select iConevertionsSuccesfull+iPenaltiesSuccesfull into iTotalKicksSuccesfull;


if iConevertionsSuccesfull > 0 then 
if iConevertionsSuccesfull = 1 then 
set KicksDeferiationConevertions = concat(iConevertionsSuccesfull,' ','CON');
ELSE
set KicksDeferiationConevertions = concat(iConevertionsSuccesfull,' ','CONS');
end if;
end if;

if iPenaltiesSuccesfull > 0 then 
if iPenaltiesSuccesfull = 1 then 

set KicksDeferiationPenalties = concat(iPenaltiesSuccesfull,' ','PEN');
ELSE
set KicksDeferiationPenalties = concat(iPenaltiesSuccesfull,' ','PENS');
end if;


if iConevertionsSuccesfull > 0 then 
set KicksDeferiationPenalties = concat(', ',KicksDeferiationPenalties);
end if;
end if;

if iDropGoal > 0 then

if iDropGoal = 1 then 
set KicksDropGoal = concat(iDropGoal,' ','DROP GOAL');
ELSE
set KicksDropGoal = concat(iDropGoal,' ','DROP GOALS');
end if;

end if;

if iDropGoal > 0 then 
set KicksDropGoal = concat(', ',KicksDropGoal);
end if;


select concat(FORMAT((iTotalKicksSuccesfull/iTotalKicks*100),0),'%') into Result;

IF(iTotalKicks>0) THEN 
select concat('KICKS: (',iTotalKicksSuccesfull,' of ',iTotalKicks,')  ',Result,'  ',KicksDeferiationConevertions,KicksDeferiationPenalties,KicksDropGoal) into OutOfString;
ELSE
select 'FIRST KICK OF THE MATCH' into OutOfString;

END IF;

RETURN OutOfString;
END ;;
DELIMITER ;
