CREATE DEFINER=`root`@`localhost` FUNCTION `GetRugbyCuurentSelectedPlayerKickingStats`() RETURNS varchar(100) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare iTotalKicks int default 0;
declare iTotalKicksSuccesfull int default 0;
declare Result VARCHAR(100) default '';
select GetCurrentSelectPlayerStatCount(44)+GetCurrentSelectPlayerStatCount(63)+GetCurrentSelectPlayerStatCount(61) into iTotalKicks;
select GetCurrentSelectPlayerStatCountSuccesfull(44)+GetCurrentSelectPlayerStatCountSuccesfull(63)+GetCurrentSelectPlayerStatCount(61) into iTotalKicksSuccesfull ;
select concat(iTotalKicksSuccesfull,' of ',iTotalKicks) into Result;


RETURN Result;
END ;;
