CREATE DEFINER=`root`@`localhost` FUNCTION `GetRugbyPlayerKickingStats`( iMatchid bigint ,iPlayerID bigint, iStatid int) RETURNS varchar(45) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare returnStats varchar(45);
SELECT concat((select count(StatEvent) FROM soccer.matchevents 
where MatchID =iMatchid and PlayerID_1 = iPlayerID and StatEvent = iStatid and eventresult =1),'/',
(select count(StatEvent) FROM soccer.matchevents where MatchID =iMatchid and PlayerID_1 = iPlayerID 
and  StatEvent = iStatid and eventresult IN (0,1))) into returnStats; 

if returnStats = '0/0' then
return '';
end if;

RETURN returnStats;
