CREATE DEFINER=`root`@`localhost` FUNCTION `GetRugbyTeamScore`(Selectedteamid BIGINT,Selectedmatchid BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare AmountOfTries int default 0;
declare AmountOfPenaltyKicks int default 0;
declare AmountOfDropGoals int default 0;
declare AmountOfPenaltyTries int default 0;
declare AmountOfConvertions int default 0;
declare AmountOfPowerTry int default 0;
declare TotalScore int default 0;

SELECT count(StatEvent) into AmountOfTries FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 43;
SELECT count(StatEvent) into AmountOfPenaltyTries FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 52;
SELECT count(StatEvent) into AmountOfDropGoals FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 61;
SELECT count(StatEvent) into AmountOfPenaltyKicks FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 46 and eventresult = 1;
SELECT count(StatEvent) into AmountOfConvertions FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 44 and eventresult = 1;
SELECT count(StatEvent) into AmountOfPowerTry FROM soccer.matchevents where teamid = Selectedteamid and MatchID = Selectedmatchid and StatEvent = 168;

select (AmountOfPowerTry*10)+(AmountOfTries*5)+(AmountOfPenaltyTries*5)+(AmountOfDropGoals*3)+(AmountOfPenaltyKicks*3)+(AmountOfConvertions*2) into TotalScore;

RETURN TotalScore;
END ;;
DELIMITER ;
