CREATE DEFINER=`root`@`localhost` FUNCTION `GetRugbyTurnOversStat`(selTeamIDint BIGINT,selmatchID BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare turnovers int default 0;
declare turnoversLineOuts int default 0;
declare turnoversScrums int default 0;
declare turnoversTotal int default 0;

SELECT count(StatEvent) into turnoversScrums   FROM soccer.matchevents where teamid = selTeamIDint and MatchID = selmatchID and StatEvent = 50 and eventresult = 0;
SELECT count(StatEvent) into turnovers 		   FROM soccer.matchevents where teamid = selTeamIDint and MatchID = selmatchID and StatEvent = 64;
SELECT count(StatEvent) into turnoversLineOuts FROM soccer.matchevents where teamid = selTeamIDint and MatchID = selmatchID and StatEvent = 48 and eventresult = 0;
SELECT (turnovers+turnoversScrums+turnoversLineOuts) into turnoversTotal;


RETURN turnoversTotal;
END ;;
