CREATE DEFINER=`root`@`localhost` FUNCTION `GetSecondaryPlayerSelTournamentGamesPlayed`(selTourmant BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE NumMatches INT;
	DROP TEMPORARY TABLE IF EXISTS TempMatches;

	CREATE TEMPORARY TABLE TempMatches AS
	SELECT DISTINCT e.MatchID
	FROM soccer.uiselected u,soccer.matchevents e,soccer.match m
	WHERE e.PlayerID_1 = u.SecondaryPlayer AND e.MatchID = m.MatchID
	AND admintournament = selTourmant
	GROUP BY e.MatchID;

	SELECT IFNULL(COUNT(*),0) INTO NumMatches FROM TempMatches;

	RETURN NumMatches;
END ;;
