CREATE DEFINER=`root`@`localhost` FUNCTION `GetServeIndicator`(iHalf int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare ReturnIndicator int default 0;

SELECT IF(e.TeamID = m.HomeTeamID,1,2)  into  ReturnIndicator
FROM soccer.matchevents e, soccer.`match` m,soccer.uiselected u  where e.MatchID = m.MatchID  
and e.MatchID = SelectedMatchID and (e.StatEvent =163 ) and e.eventhalf = iHalf ORDER BY MatchEventID DESC LIMIT 1;

case  
when iHalf in (220,222,224,226,228,230,232) then
	RETURN ReturnIndicator;
else 
	RETURN 0;
end case;

END ;;
