CREATE DEFINER=`root`@`%` FUNCTION `GetSoccerAttackPenetrations`(iTeamid bigint,ifield int) RETURNS varchar(10) CHARSET utf8
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare iTotalAttacks int default 0;
    declare iLeftAttacks int default 0;
    declare iCentreAttacks int default 0;
    declare iRightAttacks int default 0;
     declare iPercentage float default 0;
     declare iReturnVal varchar(10) default 0;
    
    SELECT count(StatEvent) into iTotalAttacks FROM soccer.matchevents b,soccer.`match`  a ,
    `soccer`.`uiselected` c where b.teamid = iTeamid and b.MatchID = a.matchID 
    and StatEvent in (175,176,177) and  a.matchID = c.SelectedMatchID;
    
    SELECT count(StatEvent) into iLeftAttacks FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c 
    where b.teamid = iTeamid 
    and b.MatchID = a.matchID and StatEvent =175  and a.matchID = c.SelectedMatchID;
    
    SELECT count(StatEvent) into iCentreAttacks FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c 
    where b.teamid = iTeamid 
    and b.MatchID = a.matchID and StatEvent =176  and a.matchID = c.SelectedMatchID;
    
    SELECT count(StatEvent) into iRightAttacks FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c 
    where b.teamid = iTeamid 
    and b.MatchID = a.matchID and StatEvent =177  and a.matchID = c.SelectedMatchID;
    
    if ifield=0 then 
		select TRUNCATE((iLeftAttacks/iTotalAttacks)*100,1) into iPercentage;
    elseif ifield=1 then
		select TRUNCATE((iCentreAttacks/iTotalAttacks)*100,1) into iPercentage;
    elseif ifield=2 then
		
		
		
			select TRUNCATE((iRightAttacks/iTotalAttacks)*100,1) into iPercentage;
		
    end if;
    
		select if(substring_index(iPercentage,'.',-1)=0,truncate(iPercentage,0),iPercentage) into   iReturnVal;
	RETURN iReturnVal;
END ;;
DELIMITER ;
