CREATE DEFINER=`root`@`localhost` FUNCTION `GetSoccerLastGoalScorerNumberOfGoalsStringWithTOurnamentGoals`() RETURNS varchar(200) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare returnstring varchar (200);
declare PlayerNumberOfGoals int;
declare PlayerNumberOfGoalsTournament int default 0;
declare TeamNameShort varchar(200);

select ShortName into TeamNameShort from soccer.teams where GetLastGoalScorerTeamID()=IdTeams;

if GetLastGoalScorerStatEvent() = 41 then
	select'OWN GOAL' into returnstring ;
else

select count(statevent)  into PlayerNumberOfGoals
 FROM `soccer`.`matchevents`,`soccer`.`uiselected`  where (statevent = 40 or statevent = 42) and `matchevents`.`MatchID` = `uiselected`.`SelectedMatchID` and playerid_1 =(select playerid_1 from soccer.matchevents  
where matcheventid = (select GetLastGoalScorerMatchEventID()));

select  ifnull(NULLIF(GetPlayerSelectExtraStat((select playerid_1 from soccer.matchevents  
where matcheventid = (select GetLastGoalScorerMatchEventID())),1),''),0) into PlayerNumberOfGoalsTournament;

select if((PlayerNumberOfGoals+PlayerNumberOfGoalsTournament)=1,'1st GOAL IN THIS TOURNAMENT',
concat(convert((PlayerNumberOfGoals+PlayerNumberOfGoalsTournament),char(11)),case 
when (PlayerNumberOfGoals+PlayerNumberOfGoalsTournament)%100 BETWEEN 11 AND 13 THEN 'th GOAL IN THIS TOURNAMENT' 
when (PlayerNumberOfGoals+PlayerNumberOfGoalsTournament)%10 = 1 THEN 'st GOAL IN THIS TOURNAMENT' 
WHEN (PlayerNumberOfGoals+PlayerNumberOfGoalsTournament)%10 = 2 THEN 'nd GOAL IN THIS TOURNAMENT' 
WHEN (PlayerNumberOfGoals+PlayerNumberOfGoalsTournament)%10 = 3 THEN 'rd GOAL IN THIS TOURNAMENT'  ELSE 'th GOAL IN THIS TOURNAMENT' end   ))  into returnstring;

end if;


RETURN returnstring;
END ;;
DELIMITER ;
