    READS SQL DATA
    DETERMINISTIC
BEGIN

declare returnstring varchar (200);
declare PlayerNumberOfGoals int;

if GetLastGoalScorerStatEvent() = 41 then
	select'OWN GOAL' into returnstring ;
else

select count(statevent)  into PlayerNumberOfGoals
 FROM `soccer`.`matchevents`,`soccer`.`uiselected`  where (statevent = 40 or statevent = 42) and`matchevents`.`MatchID` = `uiselected`.`SelectedMatchID` and playerid_1 =(select playerid_1 from soccer.matchevents  
where matcheventid = (select GetLastGoalScorerMatchEventID()));
select if(PlayerNumberOfGoals=1,'GOAL SCORER',concat(convert(PlayerNumberOfGoals,char(11)),case when PlayerNumberOfGoals%100 BETWEEN 11 AND 13 THEN 'th GOAL IN THIS MATCH' when PlayerNumberOfGoals%10 = 1 THEN 'st GOAL IN THIS MATCH' WHEN PlayerNumberOfGoals%10 = 2 THEN 'nd GOAL IN THIS MATCH' WHEN PlayerNumberOfGoals%10 = 3 THEN 'rd GOAL IN THIS MATCH'  ELSE 'th GOAL IN THIS MATCH' end   ))  into returnstring;

end if;


RETURN returnstring;
END ;;
