CREATE DEFINER=`root`@`localhost` FUNCTION `GetSoccerMaxScorers`() RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare iHomeScorersCount int default 0;
declare iAwayScorersCount int default 0;
declare result int default 0;


SELECT count(*) from (
select distinct PlayerID
    FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c ,`soccer`.`players` d
    where ((b.statevent = 40 and b.teamid = a.HomeTeamID) or (b.statevent = 42 and b.teamid = a.HomeTeamID ) or (b.statevent = 41 and b.teamid = a.AwayTeamID )) 
    and b.MatchID = a.matchID 
    and b.PlayerID_1 =d.PlayerID 
    and c.SelectedMatchID = a.matchID
    group by b.PlayerID_1) as t  into iHomeScorersCount;
    
    
SELECT count(*)  from (
select distinct PlayerID
   FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c ,`soccer`.`players` d
   where ((b.statevent = 40 and b.teamid = a.AwayTeamID) or (b.statevent = 42 and b.teamid = a.AwayTeamID ) or (b.statevent = 41 and b.teamid = a.HomeTeamID )) 
   and b.MatchID = a.matchID 
   and b.PlayerID_1 =d.PlayerID 
   and c.SelectedMatchID = a.matchID
   group by b.PlayerID_1) as t into iAwayScorersCount;
   
   select if(iHomeScorersCount >iAwayScorersCount ,iHomeScorersCount,iAwayScorersCount) into result;

RETURN result;
END ;;
DELIMITER ;
