CREATE DEFINER=`root`@`localhost` FUNCTION `GetSoccerPenaltyResultString`(iNameSelect int,iStadid int) RETURNS varchar(400) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare iCountEventsHome int DEFAULT 0;
declare iCountEventsAway int DEFAULT 0;
declare returnstring varchar(400);
declare TeamName varchar(400);
declare WinningTeamID BIGINT;

select count(EventResult) into iCountEventsHome
FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
where `match`.matchID=uiselected.SelectedMatchID and matchevents.EventResult =1 and matchevents.teamid = `match`.HomeTeamID and matchevents.MatchID = uiselected.SelectedMatchID and matchevents.StatEvent = iStadid;

select count(EventResult) into iCountEventsAway
FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
where `match`.matchID=uiselected.SelectedMatchID and matchevents.EventResult =1 and matchevents.teamid = `match`.AwayTeamID and matchevents.MatchID = uiselected.SelectedMatchID and matchevents.StatEvent = iStadid;


if iCountEventsHome > iCountEventsAway then select `match`.HomeTeamID from `soccer`.`match`,`soccer`.`uiselected`
 where `uiselected`.SelectedMatchID = `match`.matchID into WinningTeamID;
 
 
 if iStadid = 27 then

if iNameSelect = 0 then
select CONCAT(GetTeamNameFromID(WinningTeamID),' WON ',iCountEventsHome,' - ',iCountEventsAway,' ON PENALTY SHOOTOUT') into returnstring;
elseif iNameSelect = 1 then
select CONCAT(GetTeamNameShortFromID(WinningTeamID),' WON ',iCountEventsHome,' - ',iCountEventsAway,' ON PENALTY SHOOTOUT') into returnstring;
else
select CONCAT('PENALTY SHOOTOUT ',iCountEventsHome,' - ',iCountEventsAway) into returnstring;
end if;

else

if iNameSelect = 0 then
select CONCAT(GetTeamNameFromID(WinningTeamID),' won ',iCountEventsHome,' - ',iCountEventsAway,' on penalties') into returnstring;
elseif iNameSelect = 1 then
select CONCAT(GetTeamNameShortFromID(WinningTeamID),' won ',iCountEventsHome,' - ',iCountEventsAway,' on penalties') into returnstring;
else
select CONCAT(iCountEventsHome,' - ',iCountEventsAway) into returnstring;
end if;
end if;

else 
select `match`.AwayTeamID from `soccer`.`match`,`soccer`.`uiselected`
 where `uiselected`.SelectedMatchID = `match`.matchID into WinningTeamID;
 
  if iStadid = 27 then
  
  if iNameSelect = 0 then
select CONCAT(GetTeamNameFromID(WinningTeamID),' WON ',iCountEventsAway,' - ',iCountEventsHome,' ON PENALTY SHOOTOUT') into returnstring;
elseif iNameSelect = 1 then 
select CONCAT(GetTeamNameShortFromID(WinningTeamID),' WON ',iCountEventsAway,' - ',iCountEventsHome,' ON PENALTY SHOOTOUT') into returnstring;
else
select CONCAT('PENALTY SHOOTOUT ',iCountEventsHome,' - ',iCountEventsAway) into returnstring;
end if;

  else
  

if iNameSelect = 0 then
select CONCAT(GetTeamNameFromID(WinningTeamID),' won ',iCountEventsAway,' - ',iCountEventsHome,' on penalties') into returnstring;
elseif iNameSelect = 1 then 
select CONCAT(GetTeamNameShortFromID(WinningTeamID),' won ',iCountEventsAway,' - ',iCountEventsHome,' on penalties') into returnstring;
else
select CONCAT(iCountEventsAway,' - ',iCountEventsHome) into returnstring;
end if;
end if;

end if;











RETURN returnstring;
END ;;
DELIMITER ;
