CREATE DEFINER=`root`@`localhost` FUNCTION `GetSoccerPenaltyWinningTeamID`() RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare iCountEventsHome int DEFAULT 0;
declare iCountEventsAway int DEFAULT 0;
declare WinningTeamID BIGINT;

select count(EventResult) into iCountEventsHome
FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
where `match`.matchID=uiselected.SelectedMatchID and matchevents.EventResult =1 and matchevents.teamid = `match`.HomeTeamID and matchevents.MatchID = uiselected.SelectedMatchID and matchevents.StatEvent = 71;

select count(EventResult) into iCountEventsAway
FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
where `match`.matchID=uiselected.SelectedMatchID and matchevents.EventResult =1 and matchevents.teamid = `match`.AwayTeamID and matchevents.MatchID = uiselected.SelectedMatchID and matchevents.StatEvent = 71;



if iCountEventsAway<iCountEventsHome then select `match`.HomeTeamID from `soccer`.`match`,`soccer`.`uiselected`
 where `uiselected`.SelectedMatchID = `match`.matchID into WinningTeamID;
elseif iCountEventsAway>iCountEventsHome then
select `match`.AwayTeamID from `soccer`.`match`,`soccer`.`uiselected`
 where `uiselected`.SelectedMatchID = `match`.matchID into WinningTeamID;
else
select 9999999 into WinningTeamID;
end if;



RETURN WinningTeamID;
END ;;
