CREATE DEFINER=`root`@`localhost` FUNCTION `GetSoccerTotalPenalties`() RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare iMaxEvent int default 5;
declare iCountEventsHome int default 0;
declare iCountEventsAway int default 0;

select count(EventResult) into iCountEventsHome
FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
where `match`.matchID=uiselected.SelectedMatchID and `match`.matchID = matchevents.MatchID and matchevents.teamid = `match`.HomeTeamID and matchevents.MatchID = uiselected.SelectedMatchID and matchevents.StatEvent = 71;

select count(EventResult) into iCountEventsAway
FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
where `match`.matchID=uiselected.SelectedMatchID and `match`.matchID = matchevents.MatchID and matchevents.teamid = `match`.AwayTeamID and matchevents.MatchID = uiselected.SelectedMatchID and matchevents.StatEvent = 71;


if iCountEventsHome > iCountEventsAway then 
set iMaxEvent= iCountEventsHome; 
else 
set iMaxEvent=iCountEventsAway; 
end if;

if iMaxEvent < 5 then
return 5;
else
return iMaxEvent;
end if;

end ;;
