CREATE DEFINER=`root`@`localhost` FUNCTION `GetTeamNumberOfReplacements`(iTeamid bigint,iReplacementStart int,iReplacementLimit int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare iNumberOfReplacements int default 0;
	
    drop temporary table if exists tempSubs;
	create temporary table tempSubs as 
	select @totalReplacement + 1 as Replacements 
    FROM soccer.players,soccer.UISelected ,soccer.sportcodes s,soccer.`match` m ,(select @totalReplacement := 0) t 
    where teamid=UISelected.SelectedTeam and  TeamListPosion >-1 
    and PersonType NOT IN (49,48,47,44) and s.sportcodesid = m.sportcodeid and m.matchid = UISelected.SelectedMatchID
    and TeamListPosion >= s.NumberOfPlayer  order by TeamListPosion;
    
	select sum(Replacements)  into iNumberOfReplacements from tempSubs;
		
	RETURN iNumberOfReplacements;
END ;;
