CREATE DEFINER=`root`@`localhost` FUNCTION `GetTeamPossessionBreakdown`(SelectedMatchID bigint,SelectedEventHalf int,SelectedTeamID bigint,StartTimeInseconds int,EndTimeInseconds int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare HomeTeamIDLocal bigint default 0;
declare AwayTeamIDLocal bigint default 0;
declare Team1Pos float default 0;
declare Team2Pos float default 0;
declare TotalPos float default 0 ;

set @EventCount =0;
set @Pos = -1;
set @PrevTeamId = 0;
set @GameStageStart =0;
set @PrevTimeStamp =0;
set @StartTime=StartTimeInseconds*1000000;
set @EndTime=EndTimeInseconds*1000000;

set @PosBottom =0;
set @PosTop =0;


set @TimeDiffBottom =0;
set @TimeDiffTop =0;

set @PrevTeamIdBot = 0;
set @PrevTeamIdTop = 0;

    

DROP TEMPORARY TABLE IF EXISTS  posbreakdown ;
SELECT HomeTeamID into @HomeTeamIDLocal FROM soccer.`match` where matchID= SelectedMatchID;
SELECT AwayTeamID into @AwayTeamIDLocal FROM soccer.`match` where matchID= SelectedMatchID;
select matchevents.TimeStamp into @GameStageStart from soccer.matchevents where StatEvent = 152 and  MatchID = SelectedMatchID and EventHalf = SelectedEventHalf;
select matchevents.TimeStamp into @PrevTimeStamp from soccer.matchevents where StatEvent = 152 and  MatchID = SelectedMatchID and EventHalf = SelectedEventHalf;
create TEMPORARY table posbreakdown as( SELECT @Pos:=@Pos+1 AS Pos ,@PrevTeamId as PreviosTeamID,@PrevTeamId:=TeamID as teamid, `StatEvent`,TimeToMicroSec(timediff(`TimeStamp`,@PrevTimeStamp)) as TimeInbetweenEvents, @PrevTimeStamp:=`TimeStamp`,(TimeToMicroSec(timediff(`TimeStamp`,@GameStageStart))) as TimeIntoGame,timediff(`TimeStamp`,@GameStageStart) FROM soccer.matchevents 
where (StatEvent = 152 or StatEvent = 15 or StatEvent = 14 or StatEvent = 151) and  MatchID = SelectedMatchID and EventHalf = SelectedEventHalf order by MatchEventId);

select max(Pos) into @PosBottom from posbreakdown where TimeIntoGame <= @StartTime;
select max(Pos) into @PosTop from posbreakdown where TimeIntoGame <= @EndTime;

select count(Pos) into @EventCount from posbreakdown where TimeIntoGame >@EndTime ;

select @StartTime-TimeIntoGame into @TimeDiffBottom from posbreakdown where Pos = @PosBottom;
select @EndTime-timeintogame into @TimeDiffTop from posbreakdown where Pos = @PosTop;

select PreviosTeamID into @PrevTeamIdBot from posbreakdown where Pos = @PosBottom;
select teamid into @PrevTeamIdTop from posbreakdown where Pos = @PosTop;

select sum(TimeInbetweenEvents)into @Team1Pos from posbreakdown where TimeIntoGame >@StartTime and TimeIntoGame <@EndTime and (statevent=151 or statevent=14) and PreviosTeamID=@HomeTeamIDLocal;
select sum(TimeInbetweenEvents)into @Team2Pos from posbreakdown where TimeIntoGame >@StartTime and TimeIntoGame <@EndTime and (statevent=151 or statevent=14) and PreviosTeamID=@AwayTeamIDLocal;


if @HomeTeamIDLocal = @PrevTeamIdBot then
		select @Team1Pos-@TimeDiffBottom into @Team1Pos;  
	ELSEIF @AwayTeamIDLocal = @PrevTeamIdBot then
		select @Team2Pos-@TimeDiffBottom into @Team2Pos; 
end if;

 if @EventCount <> 0 then

	if @HomeTeamIDLocal = @PrevTeamIdTop then
		select @Team1Pos+@TimeDiffTop into @Team1Pos;  
	ELSEIF @AwayTeamIDLocal = @PrevTeamIdTop then
		select @Team2Pos+@TimeDiffTop into @Team2Pos; 
	end if;
 end if;

select  (@Team1Pos+@Team2Pos) into @TotalPos;

return TRUNCATE((@Team1Pos/@TotalPos),2)*100;
 

END ;;
DELIMITER ;
