CREATE DEFINER=`root`@`localhost` FUNCTION `GetTennisMatchScore`(Selectedteamid BIGINT,Selectedmatchid BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare 1stSet int default 0;
declare 2ndSet int default 0;
declare 3rdSet int default 0;
declare 4rdSet int default 0;
declare 5rdSet int default 0;
declare 6rdSet int default 0;
declare 7rdSet int default 0;
declare iHalf  int default 0;

SELECT m.MatchStatus INTO iHalf  FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;



SELECT IFNULL(IF(GetTennisSetScore(Selectedteamid,m.MatchID,220) > 
GetTennisSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,220),1, 0),0) INTO 1stSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

SELECT IFNULL(IF(GetTennisSetScore(Selectedteamid,m.MatchID,222) > 
GetTennisSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,222),1, 0),0) INTO 2ndSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

SELECT IFNULL(IF(GetTennisSetScore(Selectedteamid,m.MatchID,224) > 
GetTennisSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,224),1, 0),0) INTO 3rdSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

SELECT IFNULL(IF(GetTennisSetScore(Selectedteamid,m.MatchID,226) > 
GetTennisSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,226),1, 0),0) INTO 4rdSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

SELECT IFNULL(IF(GetTennisSetScore(Selectedteamid,m.MatchID,228) > 
GetTennisSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,228),1, 0),0) INTO 5rdSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

SELECT IFNULL(IF(GetTennisSetScore(Selectedteamid,m.MatchID,230) > 
GetTennisSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,230),1, 0),0) INTO 6rdSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

SELECT IFNULL(IF(GetTennisSetScore(Selectedteamid,m.MatchID,232) > 
GetTennisSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,232),1, 0),0) INTO 7rdSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

case 
when iHalf in (220) then
	RETURN 0; 
when iHalf in (221) then
	RETURN 1stSet;
when iHalf in (222) then
	RETURN 1stSet;
when iHalf in (223) then
	RETURN 1stSet+2ndSet;
when iHalf in (224) then
	RETURN 1stSet+2ndSet;
when iHalf in (225) then
	RETURN 1stSet+2ndSet+3rdSet;
when iHalf in (226) then
	RETURN 1stSet+2ndSet+3rdSet;
when iHalf in (227) THEN
	RETURN 1stSet+2ndSet+3rdSet+4rdSet;
when iHalf in (228) THEN
	RETURN 1stSet+2ndSet+3rdSet+4rdSet;
when iHalf in (229) THEN
	RETURN 1stSet+2ndSet+3rdSet+4rdSet+5rdSet;
when iHalf in (230) THEN
	RETURN 1stSet+2ndSet+3rdSet+4rdSet+5rdSet;
when iHalf in (231) THEN
	RETURN 1stSet+2ndSet+3rdSet+4rdSet+5rdSet+6rdSet;
when iHalf in (232) THEN
	RETURN 1stSet+2ndSet+3rdSet+4rdSet+5rdSet+6rdSet;
when iHalf in (233) THEN
RETURN 1stSet+2ndSet+3rdSet+4rdSet+5rdSet+6rdSet+7rdSet;
else 
	RETURN 0;
end case;

END ;;
DELIMITER ;
