CREATE DEFINER=`root`@`localhost` FUNCTION `GetTennisSetScore`(Selectedteamid BIGINT,Selectedmatchid BIGINT,SetNumber int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare TotalScore int default 0;
declare iPerido int default 0;

if(SetNumber != -1) then
SELECT count(e.StatEvent) into TotalScore 
FROM soccer.matchevents e,soccer.`match` m 
where e.teamid = Selectedteamid and e.MatchID = m.MatchID and e.EventHalf = 
(CASE SetNumber WHEN 221 THEN 220 WHEN 223 THEN 222 WHEN 225 THEN 224 
WHEN 227 THEN 226 WHEN 229 THEN 228 WHEN 231 THEN 230 WHEN 233 THEN 232 ELSE SetNumber END)
and e.MatchID = Selectedmatchid and e.StatEvent = 153;
else
SELECT m.MatchStatus into iPerido FROM soccer.`match` m WHERE m.MatchID = SelectedMatchid  AND ActiveGame = 1;
SELECT count(e.StatEvent) into TotalScore 
FROM soccer.matchevents e,soccer.`match` m 
where e.teamid = Selectedteamid and e.StatEvent = 153 and e.MatchID = m.MatchID and e.EventHalf = (CASE iPerido WHEN 221 THEN 220 WHEN 223 THEN 222 WHEN 225 THEN 224 
WHEN 227 THEN 226 WHEN 229 THEN 228 WHEN 231 THEN 230 WHEN 233 THEN 232 ELSE iPerido END);
end if;

RETURN TotalScore;
END ;;
DELIMITER ;
