CREATE DEFINER=`root`@`localhost` FUNCTION `GetVizTimeString`(iDWTimeSeconds int,iDirection int,iStatus int) RETURNS varchar(1000) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare FinalString varchar(1000);
declare TimerStatus varchar(200);
declare TimerDirection varchar(100);


case iDirection 
when 0 then
select "*LIMIT SET 0,*DIRECTION SET DOWN" into TimerDirection;
when 1 then
select "*LIMIT SET NONE,*DIRECTION SET UP" into TimerDirection;
else
select "*LIMIT SET NONE,*DIRECTION SET UP" into TimerDirection;
end case;
case iStatus
when 0 then
select "START" into TimerStatus;
when 1 then 
select "STOP" into TimerStatus;
else
select "START" into TimerStatus;
end case;

select concat('*TIME SET ',iDWTimeSeconds,',',TimerDirection,',',TimerStatus,',','UPDATE_TEXT SET 1 ') into FinalString;



RETURN FinalString;
END ;;
DELIMITER ;
