BEGIN

declare TotalScore int default 0;
declare 1stSet int default 0;
declare 2ndSet int default 0;
declare 3rdSet int default 0;
declare 4thSet int default 0;
declare 5thSet int default 0;
declare iHalf int default 0;

SELECT m.MatchStatus INTO iHalf  FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;



SELECT IFNULL(IF(GetVolleyBallSetScore(Selectedteamid,m.MatchID,151) > 
GetVolleyBallSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,151),1, 0),0) INTO 1stSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

SELECT IFNULL(IF(GetVolleyBallSetScore(Selectedteamid,m.MatchID,153) > 
GetVolleyBallSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,153),1, 0),0) INTO 2ndSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

SELECT IFNULL(IF(GetVolleyBallSetScore(Selectedteamid,m.MatchID,155) > 
GetVolleyBallSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,155),1, 0),0) INTO 3rdSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

SELECT IFNULL(IF(GetVolleyBallSetScore(Selectedteamid,m.MatchID,157) > 
GetVolleyBallSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,157),1, 0),0) INTO 4thSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;

SELECT IFNULL(IF(GetVolleyBallSetScore(Selectedteamid,m.MatchID,159) > 
GetVolleyBallSetScore(if(m.HomeTeamID=Selectedteamid,m.AwayTeamID,m.HomeTeamID),m.MatchID,159),1, 0),0) INTO 5thSet
FROM soccer.uiselected u,soccer.`match` m 
WHERE m.MatchID = SelectedMatchid;


IF(iHalf = 151) THEN
	RETURN 0;
ELSEIF(iHalf = 152) THEN
	RETURN 1stSet;
ELSEIF(iHalf = 153) THEN
	RETURN 1stSet;
ELSEIF(iHalf = 154) THEN
	RETURN 1stSet+2ndSet;
ELSEIF(iHalf = 155) THEN
	RETURN 1stSet+2ndSet;
ELSEIF(iHalf = 156) THEN
	RETURN 1stSet+2ndSet+3rdSet;
ELSEIF(iHalf = 157) THEN
	RETURN 1stSet+2ndSet+3rdSet;
ELSEIF(iHalf = 158) THEN
	RETURN 1stSet+2ndSet+3rdSet+4thSet;
ELSEIF(iHalf = 159) THEN
	RETURN 1stSet+2ndSet+3rdSet+4thSet;
ELSEIF(iHalf = 160) THEN
	RETURN 1stSet+2ndSet+3rdSet+4thSet+5thSet;
ELSE 
	RETURN 0;
END IF;

END ;;
