CREATE DEFINER=`root`@`localhost` FUNCTION `GetVolleyBallScore`(Selectedteamid BIGINT,Selectedmatchid BIGINT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare TotalScore int default 0;

SELECT count(e.StatEvent) into TotalScore 
FROM soccer.matchevents e,soccer.`match` m 
where e.teamid = Selectedteamid and e.MatchID = m.MatchID and e.EventHalf =
(CASE WHEN m.MatchStatus = 152 THEN 151 
	  WHEN m.MatchStatus = 154 THEN 153 
	  WHEN m.MatchStatus = 156 THEN 155
      WHEN m.MatchStatus = 158 THEN 157
      WHEN m.MatchStatus = 160 THEN 159 ELSE m.MatchStatus END) and
e.MatchID = Selectedmatchid and e.StatEvent = 94;

RETURN TotalScore;
END ;;
