CREATE DEFINER=`root`@`localhost` FUNCTION `HTGetPenaltyShotResult`(iShot int, iStatEvent int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare iResult  INT DEFAULT 0;
declare iRetResult  INT DEFAULT 0;

declare iCountEventsHome int DEFAULT 0;
declare iCountEventsAway int DEFAULT 0;
declare iCountEventsReal int DEFAULT 0;
declare iShotToRetrieve int DEFAULT 0;




select count(EventResult) into iCountEventsHome
FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
where `match`.matchID=uiselected.SelectedMatchID and `match`.matchID = matchevents.MatchID and matchevents.teamid = `match`.HomeTeamID and matchevents.MatchID = uiselected.SelectedMatchID and matchevents.StatEvent = iStatEvent and eventresult in (0,1);

select count(EventResult) into iCountEventsAway
FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
where `match`.matchID=uiselected.SelectedMatchID and `match`.matchID = matchevents.MatchID and matchevents.teamid = `match`.AwayTeamID and matchevents.MatchID = uiselected.SelectedMatchID and matchevents.StatEvent = iStatEvent and eventresult in (0,1);

if iCountEventsAway > iCountEventsHome then set iCountEventsReal=iCountEventsAway;
else set iCountEventsReal=iCountEventsHome;
  end if;


select (TRUNCATE((iCountEventsReal-1)/5,0)*5)+iShot into iShotToRetrieve;



select EventResult into iResult
 FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
 where `match`.matchID=uiselected.SelectedMatchID 
and matchevents.teamid = `match`.HomeTeamID 
and matchevents.StatEvent = iStatEvent and `match`.matchID = matchevents.MatchID
order by MatchEventId ASC
 limit iShotToRetrieve,1;


if iShotToRetrieve > (iCountEventsHome-1) then set iRetResult = 0;
ELSEIF iResult = 0 then set iRetResult = 1;
ELSEIF iResult = 1 then set iRetResult = 2;
else set iRetResult = 0;

end if;










RETURN iRetResult;
END ;;
DELIMITER ;
