CREATE DEFINER=`root`@`localhost` FUNCTION `UpdateMatchOfficials`(iPlayerid bigint,iMatchid bigint, iPersontypeid int) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN
declare iExist bigint default -1;

select Playerid into iExist FROM soccer.officials where `PersonType` =  iPersontypeid and `MatchID` = iMatchid limit 1;

if iExist > -1 then 

UPDATE `soccer`.`officials`
SET `PlayerID` = iPlayerid
WHERE `idOfficials` > 0 and `PersonType` =  iPersontypeid and `MatchID` = iMatchid;
RETURN 0;

else

INSERT INTO `soccer`.`officials` (`idOfficials`,`PlayerID`,`MatchID`,`PersonType`)
VALUES (null,iPlayerid,iMatchid,iPersontypeid);

RETURN 1;
end if;



END ;;
