CREATE DEFINER=`root`@`localhost` FUNCTION `UpdateMatchScoreFromFile`(vDate VARCHAR(100),vHomeTeamName VARCHAR(100),vHomeTeamScore INT,vAwayTeamName VARCHAR(100),vAwayTeamScore INT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE iMatchID BIGINT DEFAULT NULL;
	DECLARE iHomeTeamID BIGINT;
	DECLARE iAwayTeamID BIGINT;

	SELECT idTeams INTO iHomeTeamID  FROM Teams WHERE TeamName Like 
	CONCAT('%',CASE WHEN vHomeTeamName LIKE '%Maritzburg Utd%' THEN 'Maritzburg United'
					WHEN vHomeTeamName LIKE '%Celtic%' THEN 'Bloemfontein Celtic' ELSE vHomeTeamName  END,'%') AND TeamType = 4 AND ExtraDescription LIKE 'PSL';

	SELECT idTeams INTO iAwayTeamID  FROM Teams WHERE TeamName Like 
	CONCAT('%',CASE WHEN vAwayTeamName LIKE '%Maritzburg Utd%' THEN 'Maritzburg United'
					WHEN vAwayTeamName LIKE '%Celtic%' THEN 'Bloemfontein Celtic' ELSE vAwayTeamName  END,'%') AND TeamType = 4 AND ExtraDescription LIKE 'PSL';

	SELECT MatchID INTO iMatchID
	FROM soccer.match 
	WHERE date_format(DateTimeStamp,'%Y-%m-%d') = date_format(vDate,'%Y-%m-%d')
	AND HomeTeamID = iHomeTeamID AND AwayTeamID = iAwayTeamID;

	IF iMatchID IS NOT NULL THEN

		UPDATE soccer.Match
		SET HomeTeamScore = vHomeTeamScore,AwayTeamScore = vAwayTeamScore,MatchStatus = 44
		WHERE Matchid = iMatchID;
		RETURN 1;
	ELSE
		RETURN 0;
	END IF;



END ;;
DELIMITER ;
