CREATE DEFINER=`root`@`localhost` FUNCTION `UpdatePlayerSeriesStats`(curPlayerID BIGINT) RETURNS varchar(10) CHARSET latin1
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE my_Steals INT DEFAULT 0;
	DECLARE my_Assists INT DEFAULT 0;
	DECLARE my_Blocks INT DEFAULT 0;
	DECLARE my_PersonalF INT DEFAULT 0;
	DECLARE my_TechnicalF INT DEFAULT 0;
	DECLARE my_OffensiveR INT DEFAULT 0;
	DECLARE my_DefensiveR INT DEFAULT 0;
	DECLARE my_TurnOvers INT DEFAULT 0;
	DECLARE my_3P INT DEFAULT 0;
	DECLARE my_3PAttempts INT DEFAULT 0;
	DECLARE my_2P INT DEFAULT 0;
	DECLARE my_2PAttempts INT DEFAULT 0;
	DECLARE my_FreeThrows INT DEFAULT 0;
	DECLARE my_FreeThrowsAttempts INT DEFAULT 0;
	DECLARE PlayerExist BIGINT DEFAULT NULL;
	DECLARE my_TeamID BIGINT DEFAULT 0;

	SELECT PlayerID INTO PlayerExist
	FROM soccer.basketballplayertournamentstats
	WHERE PlayerID = curPlayerID;

	
	SELECT GetPlayerTournamentStat(78,curPlayerID) INTO my_FreeThrows;
	SELECT GetPlayerTournamentStat(79,curPlayerID) INTO my_2P;
	SELECT GetPlayerTournamentStat(80,curPlayerID) INTO my_3P;
	SELECT GetPlayerTournamentStat(82,curPlayerID) INTO my_FreeThrowsAttempts;
	SELECT GetPlayerTournamentStat(83,curPlayerID) INTO my_2PAttempts;
	SELECT GetPlayerTournamentStat(84,curPlayerID) INTO my_3PAttempts;
	SELECT GetPlayerTournamentStat(85,curPlayerID) INTO my_PersonalF;
	SELECT GetPlayerTournamentStat(86,curPlayerID) INTO my_TechnicalF;
	SELECT GetPlayerTournamentStat(87,curPlayerID) INTO my_Steals;
	SELECT GetPlayerTournamentStat(88,curPlayerID) INTO my_TurnOvers;
	SELECT GetPlayerTournamentStat(89,curPlayerID) INTO my_OffensiveR;
	SELECT GetPlayerTournamentStat(90,curPlayerID) INTO my_DefensiveR;
	SELECT GetPlayerTournamentStat(92,curPlayerID) INTO my_Assists;
	SELECT GetPlayerTournamentStat(93,curPlayerID) INTO my_Blocks;
	SELECT DISTINCT TeamID INTO my_TeamID FROM soccer.players WHERE PlayerID=curPlayerID;

	IF(PlayerExist IS NULL) THEN
		
		INSERT INTO soccer.BasketballPlayerTournamentStats(Playerid,Teamid,2PointFG,3PointFG,Freethrow,
				2PointFGAttempt,3PointFGAttempt,FreethrowAttempt,PersonalF,TechnicalF,Steals,
				TurnOvers,OffensiveR,DefensiveR,Assists,Blocks)
		VALUES(curPlayerID,my_TeamID,my_2P,my_3P,my_Freethrows,
				my_2PAttempts,my_3PAttempts,my_FreethrowsAttempts,my_PersonalF,my_TechnicalF,my_Steals,
				my_TurnOvers,my_OffensiveR,my_DefensiveR,my_Assists,my_Blocks);


	ELSE

	UPDATE Soccer.BasketballPlayerTournamentStats
	SET 2PointFG = my_2P,3PointFG = my_3P,Freethrow = my_Freethrows,2PointFGAttempt=my_2PAttempts,
	3PointFGAttempt = my_3PAttempts,FreethrowAttempt = my_FreethrowsAttempts,PersonalF = my_PersonalF,TechnicalF=my_TechnicalF,
	Steals = my_Steals,TurnOvers = my_TurnOvers,OffensiveR = my_OffensiveR,DefensiveR = my_DefensiveR,Assists=my_Assists,Blocks=my_Blocks
	WHERE BasketballPlayerTournamentStats.Playerid = curPlayerID LIMIT 1;
	END IF;
RETURN '';
END ;;
DELIMITER ;
