CREATE DEFINER=`root`@`localhost` PROCEDURE `AppendRecords`(vTableName VARCHAR(45),vCommand VARCHAR(45),
vTableValues VARCHAR(500),vGUID CHAR(45),vDateUpdate DATETIME)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE sql_statement VARCHAR(500);

	SET @TableName = vTableName;
	SET @GUID = vGUID;
	SET @LastUpdate = 0;
	SET @tableValues = vTableValues;
	SET @Command = vCommand;

	if vCommand like 'REPLACE' then

		SET @smt = CONCAT('SELECT DateUpdated INTO @LastUpdate  FROM ', @TableName,' WHERE GUID = "',@GUID,'"')  ;
		PREPARE sql_statement FROM @smt;
		EXECUTE sql_statement;
		DEALLOCATE PREPARE sql_statement;

		if(vDateUpdate > @LastUpdate AND @LastUpdate <> 0) then
			SET @smtUpdate = CONCAT(@Command , ' INTO ' , @TableName, ' ' , 'VALUES(',@tableValues ,')');
			PREPARE sql_statement FROM @smtUpdate;
			EXECUTE sql_statement;
			DEALLOCATE PREPARE sql_statement;
			
			SELECT 1;
		else
			SELECT -1;
		end if;

	else
		SET @smt = CONCAT( vCommand, ' INTO ' , vTableName, ' ' , 'VALUES(', vTableValues,')');
		PREPARE sql_statement FROM @smt;
		EXECUTE sql_statement;
		DEALLOCATE PREPARE sql_statement;
		SELECT 0;
	end if;
END ;;
DELIMITER ;
