CREATE DEFINER=`root`@`localhost` PROCEDURE `CalculateHistoricalStats`(iSportCode INT)
    READS SQL DATA
    DETERMINISTIC
BEGIN

		declare PlayerExist bigint default null;
        
		SELECT e.Matcheventid,e.Playerid_1,e.Teamid,e.Matchid,m.sportcodeid,e.StatEvent,
		case when StatEvent=79 then sum(@count:=1)*2 when StatEvent=80 then sum(@count:=1)*3 else sum(@count:=1) end   Total
		FROM soccer.matchevents e, soccer.uiselected u, soccer.`match` m,soccer.Players p
		WHERE e.MatchID = m.matchid AND m.matchid = SelectedMatchID AND p.Playerid = e.Playerid_1
		AND StatEvent IN (Select concat(statid) FROM soccer.stats where gametype = 6) 
        group by StatEvent,playerid_1;
        
END ;;
