CREATE DEFINER=`root`@`localhost` PROCEDURE `crCalculateCurrentStats`(_MatchID bigint,_Innings int)
    READS SQL DATA
    DETERMINISTIC
BEGIN


DELETE FROM `soccer`.`crbattingcurrent` WHERE idcrbattingcurrent > 0 and matchid = _MatchID and Innings =_Innings and BatsmanBatted=0;
DELETE FROM `soccer`.`crbowlingcurrent` WHERE idcrbowlingcurrent > 0 and matchid = _MatchID and Innings =_Innings and BowlerBowled=0;

END ;;
DELIMITER ;
