CREATE DEFINER=`root`@`localhost` PROCEDURE `crCheckStartBallConditions`(FacingID BIGINT,NonFacingID BIGINT,BowlerID BIGINT,_MatchID BIGINT,_Innings int)
    READS SQL DATA
    DETERMINISTIC
BEGIN

declare startballCondition int default 1;

select distinct batsmanFlag into startballCondition from ( SELECT if(BatsmanStatus != 'not out',0,1) batsmanFlag  FROM soccer.crbattingcurrent 
where (PlayerID =FacingID or PlayerID =NonFacingID) and innings = _Innings and Matchid = _MatchID) as b
where batsmanFlag = 0;




case startballCondition 
	when 0 then

		SELECT startballCondition,message FROM soccer.crwarnings where idcrwarnings=1; 

		when 1 then 

				SELECT if(b.Overs >= g.MaxOverPerBolwer,0,1) into startballCondition FROM soccer.crbowlingcurrent b,soccer.crgamesetup g 
                where g.matchid =b.matchid and b.innings = _Innings 
                and b.Matchid = _MatchID and Playerid =BowlerID  and g.MaxOverPerBolwer <> 0;

					case startballCondition when 0 then
							SELECT startballCondition,message FROM soccer.crwarnings where idcrwarnings=2; 
                            else
								select startballCondition,'Proceed';
					end case;

	else
		select startballCondition,'Proceed';
end case;


END ;;
DELIMITER ;
