CREATE DEFINER=`root`@`localhost` PROCEDURE `crDisplayInfoBasedOnInnings`(iColumn int)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare iInnings int default 0;

	SELECT selectedInnings into iInnings  FROM soccer.uiselected;

	if(iInnings = 177) then

	SELECT case iColumn when 0 then
	(SELECT Overs FROM soccer.crmatchdetails m, soccer.uiselected u WHERE m.MatchID = u.SelectedMatchid AND Innings = u.SelectedInnings) 
	when 1 then
	(SELECT concat('RR ',forMAT(ROUND(RunRate,2),2)) FROM soccer.crmatchdetails m, soccer.uiselected u WHERE m.MatchID = u.SelectedMatchid AND Innings = u.SelectedInnings)
	when 2 then '' end;
	elseif(iInnings = 178) then
	SELECT case iColumn when 0 then
	(SELECT ROUND(Overs,1) FROM soccer.crmatchdetails m, soccer.uiselected u WHERE m.MatchID = u.SelectedMatchid AND Innings = u.SelectedInnings)
	when 1 then
	(SELECT if((g.Target - m.MatchScore) > 0,CONCAT('TO WIN ',(g.Target - m.MatchScore)),CONCAT('TO WIN 0')) 	FROM soccer.crmatchdetails m,soccer.crgamesetup g,soccer.uiselected u 	WHERE m.MatchID = g.MatchID AND m.MatchID = u.SelectedMatchID  AND m.Innings = 178)
	when 2 then
	(SELECT if(g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,m.MatchID,-1))> 1,CONCAT('BALLS  ',g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,m.MatchID,-1))),CONCAT('LAST BALL')) ballsneeded 	FROM soccer.crmatchdetails m,soccer.crgamesetup g,soccer.uiselected u 	WHERE m.MatchID = g.MatchID AND m.MatchID = u.SelectedMatchID  AND m.Innings = 178)
    when 3 then
	(SELECT if ( crConvertBallsToOvers((g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,m.MatchID,-1))))> 1,CONCAT('OVERS  ',crConvertBallsToOvers(g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,m.MatchID,-1)))),CONCAT('OVER  ',crConvertBallsToOvers(g.TotalBalls - (crGetNumberOfValidBallsInInnings(178,m.MatchID,-1))))) Oversneeded 	FROM soccer.crmatchdetails m,soccer.crgamesetup g,soccer.uiselected u 	WHERE m.MatchID = g.MatchID AND m.MatchID = u.SelectedMatchID  AND m.Innings = 178)

	end Infoline;

	end if;
	
END ;;
DELIMITER ;
