CREATE DEFINER=`root`@`localhost` PROCEDURE `crEndBall`(IN _MatchID BIGINT, IN _InningsID int,IN _ballid bigint)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	declare crRunRate float default 0;
    declare idMatchKey int default 0;
    declare idBowlerid bigint default 0;

	if(_ballid = -1) then
		call `crCalculateCurrentStats`(_MatchID,_InningsID);    
    end if;
    
    SELECT idMatchDetailsCricket into idMatchKey FROM soccer.crmatchdetails WHERE Matchid=_MatchID AND Innings = _InningsID;
	
	UPDATE `soccer`.`crmatchdetails`
	SET `RunRate`= (SELECT FORMAT(ROUND(crGetBattingTeamRunRate(_MatchID,_InningsID),2),2)),`EndOfOver` =(select `crEndOfOver`())
	WHERE idMatchDetailsCricket=idMatchKey;

		SELECT  `soccer`.`crUpdateBatting`(_MatchID,_InningsID,FacingBatsmanID,idcrball) UpdatedFacingBatsman,
				`soccer`.`crUpdateBatting`(_MatchID,_InningsID,NonFacingBatsmanID,idcrball) UpdatedNonFacingBatsman,
				`soccer`.`crUpdateBowling`(_MatchID,_InningsID,BowlerID) UpdatedActiveBowler,
                `soccer`.`crUpdatePartnerships`(MatchID,Innings,FacingBatsmanID,NonFacingBatsmanID,idcrball) UpdatedPartnerships,
				`soccer`.`crUpdateTempTable`(_MatchID,_InningsID,FacingBatsmanID,NonFacingBatsmanID,BowlerID) UpdateTemp,
                `soccer`.`crUpdateBallsPerFifty`(_MatchID,_InningsID,idcrball) PerFifty
                FROM soccer.crBall WHERE idcrball = _ballid;

END ;;
DELIMITER ;
