CREATE DEFINER=`root`@`localhost` PROCEDURE `crEndInnings`(_MatchID BIGINT,_InningsID int)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare iTarget int default 0;
	declare iMatchid int default 0;
	declare iInnings int default 0;

	SELECT (m.MatchScore+1) into iTarget
	FROM soccer.crmatchdetails m
	WHERE m.MatchID = _MatchID AND Innings = _InningsID;
	
	UPDATE `soccer`.`crgamesetup`
	SET	`Target` = iTarget
	WHERE `idcrgamesetup` > 0 AND `Matchid` = _MatchID;

	UPDATE `soccer`.`crmatchdetails`
	SET	`InningsEnded` = 1
	WHERE `idMatchDetailsCricket` > 0
	AND `Innings` = _InningsID
	AND `Matchid` = _MatchID;

END ;;
