CREATE DEFINER=`root`@`localhost` PROCEDURE `crGetBowlerSpells`()
    READS SQL DATA
    DETERMINISTIC
BEGIN


DROP TEMPORARY TABLE IF EXISTS  temp;
create temporary table temp as
SELECT BowlerID, crGetOverRuns(Matchid,Innings,BallNumber) runs,substring_index(BallNumber,'.',1) as over
, 
if(@lastBall = 0, 
 substring_index(BallNumber,'.',1), 
 substring_index(@lastBall,'.',1)) prevOver, 
 @lastBall := BallNumber as ball

 FROM soccer.crball,soccer.uiselected u ,(select @lastBall := 0) as t
where  MatchID = u.selectedMatchid AND Innings = u.SelectedInnings 
group by substring_index(BallNumber,'.',1);

select * from temp;




END ;;
DELIMITER ;
