CREATE DEFINER=`root`@`localhost` PROCEDURE `crGetManHattanOverValues`()
    READS SQL DATA
    DETERMINISTIC
BEGIN

set @MaxOverRuns = 0;

SELECT crGetOversMaxRuns(selectedMatchid,SelectedInnings)  into @MaxOverRuns FROM soccer.uiselected;


select * from (SELECT round((crGetOverRuns(c.Matchid,c.Innings,BallNumber)/@MaxOverRuns)*100,0) ManhattanValues FROM soccer.crball c,soccer.uiselected u,soccer.crmatchdetails m 
where  c.MatchID = u.selectedMatchid AND c.Innings = u.SelectedInnings and m.Matchid = selectedMatchid and m.Innings= SelectedInnings  and (BallNumber <> -1) 
group by substring_index(BallNumber,'.',1)  order by BallNumber) as t union all select 0 from information_schema.tables limit 50
;


END ;;
