CREATE DEFINER=`root`@`localhost` PROCEDURE `crUpdateMatchStatsCurrent`()
    READS SQL DATA
    DETERMINISTIC
begin

declare iMatchid bigint default 0;
declare iInnings int default 0;
declare ifacingid bigint default -1;
declare iNonFacingid bigint default -1;
declare iBowlerid bigint default -1;
SELECT Matchid,MatchStatus into iMatchid,iInnings FROM `soccer`.`match` WHERE ActiveGame = 1;




SELECT FacingBatsmanID,NonFacingBatsmanID,BowlerID into ifacingid,iNonFacingid,iBowlerid  FROM soccer.crball WHERE idcrball = -1;

SELECT `soccer`.`crUpdateBatting`(iMatchid,iInnings,ifacingid,-1) UpdatedFacingBatsman,
