			   `soccer`.`crUpdateBowling`(iMatchid,iInnings,iBowlerid) UpdatedActiveBowler;
			   
			   
		
        
SELECT `soccer`.`crGetBatsmanStatusUpdate`(iMatchid,iInnings,ifacingid,idcrball) UpdatedFacingBatsmanStatus
      FROM soccer.crBall WHERE Matchid = iMatchid and Innings =iInnings and (FacingBatsmanID=ifacingid or NonFacingBatsmanID=ifacingid);   
      
SELECT `soccer`.`crGetBatsmanStatusUpdate`(iMatchid,iInnings,iNonFacingid,idcrball) UpdatedNonFacingBatsmanStatus
      FROM soccer.crBall WHERE Matchid = iMatchid and Innings =iInnings and (FacingBatsmanID=iNonFacingid or NonFacingBatsmanID=iNonFacingid);  
        



end ;;
