CREATE DEFINER=`root`@`localhost` PROCEDURE `DoLogHideShow`()
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE iTeamsTotal INT DEFAULT 0;
	DECLARE iHalf INT DEFAULT 0;

	SELECT COUNT(*) INTO iTeamsTotal FROM soccer.soccertournamentlog;

	SET iHalf = (iTeamsTotal/2);

	IF iTeamsTotal <= 12 THEN
		SELECT * FROM (SELECT 1 Active FROM soccer.soccertournamentlog LIMIT iTeamsTotal) as a UNION ALL SELECT 0 UNION ALL SELECT 0 UNION ALL SELECT 0 UNION ALL SELECT 0;
	ELSE
		SELECT * FROM (SELECT 1 Active FROM soccer.soccertournamentlog LIMIT iHalf) as a UNION ALL SELECT 0 UNION ALL SELECT 0 UNION ALL SELECT 0 UNION ALL SELECT 0;
	END IF;

END ;;
