CREATE DEFINER=`root`@`localhost` PROCEDURE `ElapsedTimeSinceEventInSeconds`(SelectedMatchEventId INT(11))
BEGIN


DROP TEMPORARY TABLE IF EXISTS  TimeBreakdown ;
set @GameStageStart =0;
set @PrevStatEvent =0;
set @LastEventID = 0;
set @Pos=-1;
select matchevents.TimeStamp into @EventTime from soccer.matchevents where MatchEventId=SelectedMatchEventId;
select matchevents.TimeStamp into @PrevTimeStamp from soccer.matchevents where MatchEventId=SelectedMatchEventId;

create TEMPORARY table TimeBreakdown as( SELECT @Pos:=@Pos+1 AS Pos ,@PrevStatEvent as prestatevent,@PrevStatEvent:=`StatEvent` as statevent,TimeToMicroSec(timediff(`TimeStamp`,@PrevTimeStamp)) as TimeInbetweenEvents, @PrevTimeStamp:=`TimeStamp`,(TimeToMicroSec(timediff(`TimeStamp`,@EventTime))) as TimeFromEvent,timediff(`TimeStamp`,@EventTime) FROM soccer.matchevents 
where (StatEvent = 12 or StatEvent = 76 or StatEvent = 77 or StatEvent = 164 ) and  MatchEventId>SelectedMatchEventId order by MatchEventId);

if @Pos = -1 then 
select TIME_TO_SEC(timediff(NOW()+1,@EventTime)) INTO @ElapsedTime  ;
SELECT @ElapsedTime+TIME_TO_SEC(CleintServerTimeDiff) as ElapsedSeconds FROM soccer.uiselected;

else


if @PrevStatEvent = 77 or @PrevStatEvent = 12  then
select TimeToMicroSec(timediff(NOW(),@EventTime)) INTO @ElapsedTime;
ELSEIF   @PrevStatEvent = 76 or @PrevStatEvent = 164 then 
select TimeToMicroSec(timediff(@PrevTimeStamp,@EventTime)) INTO @ElapsedTime;
ELSEIF @PrevStatEvent = 0 then 
select TimeToMicroSec(timediff(NOW(),@EventTime)) INTO @ElapsedTime;
end if;
select ifnull(sum(TimeInbetweenEvents),0) into @SumTotalPauseTime from TimeBreakdown where ((statevent= 77 and prestatevent =76) or (statevent= 164 and  prestatevent= 12));
SELECT cast((((@ElapsedTime-@SumTotalPauseTime)/1000000))+TIME_TO_SEC(CleintServerTimeDiff) as signed) as ElapsedSeconds FROM soccer.uiselected;

end if;
END ;;
DELIMITER ;
