CREATE DEFINER=`root`@`localhost` PROCEDURE `GenerateStatsXML`()
    READS SQL DATA
    DETERMINISTIC
BEGIN

set group_concat_max_len=4000;
SELECT CONCAT('<?xml version="1.0"?><Seb4VisionStats>','<MatchInfo Tournament="',tr.TournamentName,'" Venue="',v.Venue,'"> </MatchInfo>',
'<Teams> <HomeTeam FullName="',t.TeamName,'" ShortName="',t.ShortName,'" Abbr="',t.AbbreviatedName,'"/> ', 
			'<Players>',
				(SELECT  GROUP_CONCAT(PName SEPARATOR '') 
				 FROM (
						SELECT    CONCAT('<Player Name="',p.Name,'" Surname="',p.Surname,'" Jersey="',p.JerseyNumber,'"/>') PName
						FROM soccer.players p,soccer.match m,soccer.uiselected u
						WHERE teamid=m.HomeTeamID AND m.MatchID = SelectedMatchID 
						AND  TeamListPosion > -1 ORDER BY TeamListPosion LIMIT 5
						) a
				)
			,'</Players>'
				'<Stats>',
				'<Goals>',GetHomeTeamStatCount(40)+GetHomeTeamStatCount(41)+GetHomeTeamStatCount(42),'</Goals>'
				'<ShotsAtGoal>',GetHomeTeamStatCount(36)+GetHomeTeamStatCount(37)+GetHomeTeamStatCount(40)+GetHomeTeamStatCount(42),'</ShotsAtGoal>'
				'<ShortOnTarget>',GetHomeTeamStatCount(37)+GetHomeTeamStatCount(40)+GetHomeTeamStatCount(42),'</ShortOnTarget>'
				'<Offsides>',GetHomeTeamStatCount(33),'</Offsides>'
				
				
				
				
				
				
				
				
				
				
				
				,'</Stats>',

			'<AwayTeam FullName="',t2.TeamName,'" ShortName="',t2.ShortName,'" Abbr="',t2.AbbreviatedName,'"/> ' 

			,'<Players>',
				(SELECT  GROUP_CONCAT(PName SEPARATOR '') 
				 FROM (
						SELECT    CONCAT('<Player Name="',p.Name,'" Surname="',p.Surname,'" Jersey="',p.JerseyNumber,'"/>') PName
						FROM soccer.players p,soccer.match m,soccer.uiselected u
						WHERE teamid=m.AwayTeamID AND m.MatchID = SelectedMatchID 
						AND  TeamListPosion > -1 ORDER BY TeamListPosion LIMIT 5
						) b
				)
			,'</Players>','<Stats>',
				'<Goals>',GetAwayTeamStatCount(40)+GetAwayTeamStatCount(41)+GetAwayTeamStatCount(42),'</Goals>'
				'<ShotsAtGoal>',GetAwayTeamStatCount(36)+GetAwayTeamStatCount(37)+GetAwayTeamStatCount(40)+GetAwayTeamStatCount(42),'</ShotsAtGoal>'
				'<ShortOnTarget>',GetAwayTeamStatCount(37)+GetAwayTeamStatCount(40)+GetAwayTeamStatCount(42),'</ShortOnTarget>'
				'<Offsides>',GetAwayTeamStatCount(33),'</Offsides>'
				
				
				
				
				
				
				
				
				
				
				
				,'</Stats>',

'</Teams>'
,'</Seb4VisionStats>')
			
FROM soccer.uiselected u,soccer.Match m ,soccer.Match m2,Tournament tr,Venue v,Teams t,Teams t2
WHERE m.MatchID = SelectedMatchID AND m2.MatchID = SelectedMatchID AND tr.TournamentID = m.Tournament
AND v.idVenue = m.Venue AND t.idTeams = m.HomeTeamID AND t2.idTeams = m2.AwayTeamID INTO OUTFILE 'c:/temp/Seb4VisionStatistics.xml';
END ;;
