CREATE DEFINER=`root`@`localhost` PROCEDURE `GetGamePlayerLeadersBASKETBALL`(iSportCode INT,iTeamSelect INT,iStatEvent1 INT,iStatEvent2 INT,iStatEvent3 INT)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DROP TEMPORARY TABLE IF EXISTS TempLeaders;
    
    CREATE TEMPORARY TABLE TempLeaders AS 
		SELECT e.Matcheventid,e.Playerid_1,e.Teamid,e.Matchid,
		case when StatEvent=79 then sum(@count:=1)*2 when StatEvent=80 then sum(@count:=1)*3 else sum(@count:=1) end   Total,e.StatEvent,CONCAT(SUBSTRING(p.Name,1,1),'. ',p.Surname) PlayerName
		FROM soccer.matchevents e, soccer.uiselected u, soccer.`match` m,soccer.Players p
		WHERE e.MatchID = m.matchid AND m.matchid = SelectedMatchID AND p.Playerid = e.Playerid_1
		AND StatEvent IN (Select concat(statid) FROM soccer.stats where gametype = iSportCode) group by StatEvent,playerid_1;
        
        case  iTeamSelect 
        when 1 then
           select PlayerName,sum(Total) GrandTotal from TempLeaders t,soccer.`match` m
			where (StatEvent = iStatEvent1 or StatEvent = iStatEvent2 or StatEvent = iStatEvent3) and t.matchid = m.matchid
			and teamid = hometeamid
			group by Playerid_1 order by GrandTotal desc limit 1; 
		when 2 then
           select PlayerName,sum(Total) GrandTotal from TempLeaders t,soccer.`match` m
			where (StatEvent = iStatEvent1 or StatEvent = iStatEvent2 or StatEvent = iStatEvent3) and t.matchid = m.matchid
			and teamid = awayteamid
			group by Playerid_1 order by GrandTotal desc limit 1; 
		else
   
		select PlayerName,sum(Total) GrandTotal from TempLeaders where (StatEvent =iStatEvent1 or StatEvent =iStatEvent2 or StatEvent = iStatEvent3)
		group by Playerid_1 order by GrandTotal desc limit 1;
        
        end case;
        
END ;;
DELIMITER ;
