CREATE DEFINER=`root`@`localhost` PROCEDURE `GetGameStatAwayTeamPlayerLeaderByPoints`(iStat INT)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	DECLARE done INT DEFAULT FALSE;
	DECLARE TopLeaderID BIGINT;
	DECLARE curPlayerID BIGINT DEFAULT 0;
	DECLARE v1p INT DEFAULT 0;
	DECLARE v2p INT DEFAULT 0;
	DECLARE v3p INT DEFAULT 0;
	DECLARE att1p INT DEFAULT 0;
	DECLARE att2p INT DEFAULT 0;
	DECLARE att3p INT DEFAULT 0;
	

	DECLARE PlayersCURSOR CURSOR FOR SELECT DISTINCT PlayerID_1 
	FROM soccer.matchevents b,`soccer`.`uiselected` c,soccer.match m WHERE TeamID = m.AwayTeamID and m.matchID = c.SelectedMatchID and b.matchID = c.SelectedMatchID;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done=TRUE;

	DROP TEMPORARY TABLE IF EXISTS TempLeaderByPoints;
	CREATE TEMPORARY TABLE TempLeaderByPoints (PlayerID INT,1p INT,2p INT,3p INT,Points INT,att1p INT,att2p INT,att3p INT);

	OPEN PlayersCURSOR;

	read_loop: LOOP

	FETCH PlayersCURSOR INTO curPlayerID;

	IF done THEN
		LEAVE read_loop;
	END IF;

	SELECT COUNT(*) Stat,GetPlayerStatCount(82,curPlayerID,b.matchID) Attmpt INTO v1p,att1p FROM soccer.matchevents b,`soccer`.`uiselected` c,soccer.match m WHERE StatEvent = 78 and b.matchID = m.matchID and b.TeamID = m.AwayTeamID and b.matchID = c.SelectedMatchID AND PlayerID_1 = curPlayerID;
	SELECT COUNT(*)*2 Stat,GetPlayerStatCount(83,curPlayerID,b.matchID) INTO v2p,att2p FROM soccer.matchevents b,`soccer`.`uiselected` c,soccer.match m WHERE StatEvent = 79 and b.matchID = m.matchID and  b.TeamID = m.AwayTeamID and b.matchID = c.SelectedMatchID AND PlayerID_1 = curPlayerID;
	SELECT COUNT(*)*3 Stat,GetPlayerStatCount(84,curPlayerID,b.matchID) INTO v3p,att3p FROM soccer.matchevents b,`soccer`.`uiselected` c,soccer.match m WHERE StatEvent = 80 and b.matchID = m.matchID and b.TeamID = m.AwayTeamID and b.matchID = c.SelectedMatchID AND PlayerID_1 = curPlayerID;
	
	INSERT TempLeaderByPoints VALUES(curPlayerID,v1p,v2p,v3p,v1p+v2p+v3p,att1p,att2p,att3p);


	END LOOP read_loop;

	IF iStat = 0 THEN

	SELECT Players.JerseyNumber,CONCAT(SUBSTRING(Name,1,1),'. ',Surname) Name,3p,2p,1p FROM TempLeaderByPoints t,Players 
	WHERE t.PlayerID = Players.PlayerID  ORDER BY Points DESC,3p DESC,2p DESC,1p DESC LIMIT 1;
	
	ELSEIF iStat = 1 THEN
	
	SELECT Points FROM TempLeaderByPoints t,Players 
	WHERE t.PlayerID = Players.PlayerID  ORDER BY Points DESC,3p DESC,2p DESC,1p DESC LIMIT 1;

	ELSEIF iStat = 2 THEN
	
	SELECT CONCAT(SUBSTRING(Name,1,1),'. ',Surname) Name FROM TempLeaderByPoints t,Players 
	WHERE t.PlayerID = Players.PlayerID  ORDER BY Points DESC,3p DESC,2p DESC,1p DESC LIMIT 1;


	ELSE	
	SELECT Players.JerseyNumber,CONCAT(SUBSTRING(Name,1,1),'. ',Surname) Name,1p,2p,3p,Points,att1p,att2p,att3p FROM TempLeaderByPoints t,Players 
	WHERE t.PlayerID = Players.PlayerID  ORDER BY Points DESC,3p DESC,2p DESC,1p DESC LIMIT 1;
	END IF;
	

END ;;
DELIMITER ;
