CREATE DEFINER=`root`@`localhost` PROCEDURE `GetGameStatHomeTeamPlayerLeaderByPoints`(iStat INT)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	DECLARE done INT DEFAULT FALSE;
	DECLARE TopLeaderID BIGINT;
	DECLARE curPlayerID BIGINT DEFAULT 0;
	DECLARE v1p INT DEFAULT 0;
	DECLARE v2p INT DEFAULT 0;
	DECLARE v3p INT DEFAULT 0;
	

	DECLARE PlayersCURSOR CURSOR FOR SELECT DISTINCT PlayerID_1 FROM soccer.matchevents b,`soccer`.`uiselected` c,soccer.match m WHERE TeamID = m.HomeTeamID and m.matchID = c.SelectedMatchID and b.matchID = c.SelectedMatchID;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done=TRUE;

	DROP TEMPORARY TABLE IF EXISTS TempLeaderByPoints;
	CREATE TEMPORARY TABLE TempLeaderByPoints (PlayerID INT,1p INT,2p INT,3p INT,Points INT);

