	FETCH PlayersCURSOR INTO curPlayerID;

	IF done THEN
		LEAVE read_loop;
	END IF;

	SELECT COUNT(*) Stat INTO v1p FROM soccer.matchevents b,`soccer`.`uiselected` c,soccer.match m WHERE StatEvent = 78 and b.matchID = m.matchID and b.TeamID = m.HomeTeamID and b.matchID = c.SelectedMatchID AND PlayerID_1 = curPlayerID;
	SELECT COUNT(*)*2 Stat INTO v2p FROM soccer.matchevents b,`soccer`.`uiselected` c,soccer.match m WHERE StatEvent = 79 and b.matchID = m.matchID and b.TeamID = m.HomeTeamID and b.matchID = c.SelectedMatchID AND PlayerID_1 = curPlayerID;
	SELECT COUNT(*)*3 Stat INTO v3p FROM soccer.matchevents b,`soccer`.`uiselected` c,soccer.match m WHERE StatEvent = 80 and b.matchID = m.matchID and b.TeamID = m.HomeTeamID and b.matchID = c.SelectedMatchID AND PlayerID_1 = curPlayerID;
	
	INSERT TempLeaderByPoints VALUES(curPlayerID,v1p,v2p,v3p,v1p+v2p+v3p);


	END LOOP read_loop;

	IF iStat = 0 THEN

	SELECT Players.JerseyNumber,CONCAT(SUBSTRING(Name,1,1),'. ',Surname) Name FROM TempLeaderByPoints t,Players 
	WHERE t.PlayerID = Players.PlayerID  ORDER BY Points DESC,3p DESC,2p DESC,1p DESC LIMIT 1;
	
	ELSEIF iStat = 1 THEN
	
	SELECT Points FROM TempLeaderByPoints t,Players 
	WHERE t.PlayerID = Players.PlayerID  ORDER BY Points DESC,3p DESC,2p DESC,1p DESC LIMIT 1;
	
	ELSEIF iStat = 2 THEN
	
	SELECT CONCAT(SUBSTRING(Name,1,1),'. ',Surname) Name FROM TempLeaderByPoints t,Players 
	WHERE t.PlayerID = Players.PlayerID  ORDER BY Points DESC,3p DESC,2p DESC,1p DESC LIMIT 1;

	ELSE	
	SELECT Players.JerseyNumber,CONCAT(SUBSTRING(Name,1,1),'. ',Surname) Name,1p,2p,3p,Points FROM TempLeaderByPoints t,Players 
	WHERE t.PlayerID = Players.PlayerID  ORDER BY Points DESC,3p DESC,2p DESC,1p DESC LIMIT 1;
	END IF;

END ;;
