CREATE DEFINER=`root`@`localhost` PROCEDURE `GetGameStatPlayerLeader`(vHomeAway INT, vEventID1 INT,vEventID2 INT,vEventID3 INT,vEventID4 INT,vEventID5 INT)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	DECLARE TopLeaderID BIGINT;
	DECLARE vTeamID BIGINT;
	DROP TEMPORARY TABLE IF EXISTS TempLeader;

	IF vHomeAway = 0 THEN 
	SELECT DISTINCT m.HomeTeamID INTO vTeamID FROM soccer.match m,soccer.matchevents b,`soccer`.`uiselected` c WHERE m.MatchID = b.matchID and b.matchID = c.SelectedMatchID; 
	ELSE
	SELECT DISTINCT m.AwayTeamID INTO vTeamID FROM soccer.match m,soccer.matchevents b,`soccer`.`uiselected` c WHERE m.MatchID = b.matchID and b.matchID = c.SelectedMatchID; 
	END IF;

	CREATE TEMPORARY TABLE TempLeader AS
	SELECT PlayerID_1, COUNT(*) Stat,TeamID FROM soccer.matchevents b,`soccer`.`uiselected` c WHERE StatEvent IN (vEventID1,vEventID2,vEventID3,vEventID4,vEventID5) and TeamID = vTeamID and b.matchID = c.SelectedMatchID GROUP BY PlayerID_1;
	
	IF vHomeAway = 0 THEN
	SELECT CONCAT(SUBSTRING(Name,1,1),'. ',Surname) Name,stat FROM TempLeader t,Players p
	WHERE t.PlayerID_1 = p.PlayerID
	ORDER BY Stat DESC LIMIT 1;
	ELSE
		SELECT CONCAT(SUBSTRING(Name,1,1),'. ',Surname),stat Name FROM TempLeader t,Players p
	WHERE t.PlayerID_1 = p.PlayerID
	ORDER BY Stat DESC LIMIT 1;
	END IF;

END ;;
