CREATE DEFINER=`root`@`localhost` PROCEDURE `GetGameStatTeamPlayerLeaderByPoints`(vHomeAway INT)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE vTeamID BIGINT DEFAULT 0;
	
	IF vHomeAway = 0 THEN 
	SELECT DISTINCT m.HomeTeamID INTO vTeamID FROM soccer.match m,soccer.matchevents b,`soccer`.`uiselected` c WHERE m.MatchID = b.matchID and b.matchID = c.SelectedMatchID; 
	ELSE
	SELECT DISTINCT m.AwayTeamID INTO vTeamID FROM soccer.match m,soccer.matchevents b,`soccer`.`uiselected` c WHERE m.MatchID = b.matchID and b.matchID = c.SelectedMatchID; 
	END IF;

	DROP TEMPORARY TABLE IF EXISTS TempLeaderByPoints;

	CREATE TEMPORARY TABLE TempLeaderByPoints (PlayerID BIGINT,Points INT);
	
	
	
	
	
	
	

	INSERT INTO TempLeaderByPoints(SELECT  DISTINCT PlayerID_1,GetPlayerStatCount(78,PlayerID_1,MatchID) FROM soccer.matchevents e,uiselected u 
	WHERE MatchID = u.SelectedMatchID
	AND TeamID = vTeamID AND StatEvent = 78);

	INSERT INTO TempLeaderByPoints(SELECT  DISTINCT PlayerID_1,GetPlayerStatCount(79,PlayerID_1,MatchID)*2 FROM soccer.matchevents e,uiselected u 
	WHERE MatchID = u.SelectedMatchID
	AND TeamID = vTeamID AND StatEvent = 79);

	

	INSERT INTO TempLeaderByPoints(SELECT  DISTINCT PlayerID_1,GetPlayerStatCount(80,PlayerID_1,MatchID)*3 FROM soccer.matchevents e,uiselected u 
	WHERE MatchID = u.SelectedMatchID
	AND TeamID = vTeamID AND StatEvent = 80);
	
	
	IF vHomeAway = 0 THEN 
		SELECT CONCAT(SUBSTRING(Name,1,1),'. ',Surname)Name,SUM(Points) Stat  FROM TempLeaderByPoints t,Players p
		WHERE t.PlayerID = p.PlayerID
		GROUP BY t.PlayerID
		ORDER BY Stat DESC LIMIT 1;
	ELSE
		SELECT CONCAT(SUBSTRING(Name,1,1),'. ',Surname) Name,SUM(Points) Stat FROM TempLeaderByPoints t,Players p
		WHERE t.PlayerID = p.PlayerID
		GROUP BY t.PlayerID
		ORDER BY Stat DESC LIMIT 1;
	END IF;


	

END ;;
DELIMITER ;
