CREATE DEFINER=`root`@`localhost` PROCEDURE `GetLogBottomHalf`(iColumn INT)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE ihalf INT DEFAULT 0;
    DECLARE iAdmin INT DEFAULT 0;
	SELECT TRUNCATE(COUNT(*)/2,0) INTO ihalf FROM soccer.soccertournamentlog;
    
    SELECT admintournament into iAdmin FROM soccer.`match`,`soccer`.`uiselected` 
	WHERE matchid = SelectedMatchID;

	IF (ihalf >= 6) OR (iAdmin=47 ) THEN
	CASE iColumn 
		WHEN 0 THEN
		SELECT  GetTeamNameShortFromID(Teamid) FROM soccer.SoccerTournamentLog Where Groupid = 1 		 order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid) LIMIT ihalf,20;

		WHEN 1 THEN
		SELECT GetTeamNameFromID(Teamid) FROM soccer.SoccerTournamentLog Where Groupid = 1 		 order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid) LIMIT ihalf,20;
		
		WHEN 2 THEN
		SELECT Played FROM soccer.SoccerTournamentLog Where Groupid = 1 order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid)  LIMIT ihalf,20;
	
		WHEN 3 THEN
		SELECT Win FROM soccer.SoccerTournamentLog Where Groupid = 1 order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid) LIMIT ihalf,20;
		
		WHEN 4 THEN
		SELECT Lost FROM soccer.SoccerTournamentLog Where Groupid = 1 order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid) LIMIT ihalf,20;

		WHEN 5 THEN
		SELECT Draw FROM soccer.SoccerTournamentLog Where Groupid = 1 order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid) LIMIT ihalf,20;

		WHEN 6 THEN
		SELECT GoalsFor FROM soccer.SoccerTournamentLog Where Groupid = 1 order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid) LIMIT ihalf,20;
		
		WHEN 7 THEN
		SELECT GoalsAgainst FROM soccer.SoccerTournamentLog Where Groupid = 1 order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid) LIMIT ihalf,20;

		WHEN 8 THEN
		SELECT GoalDiff FROM soccer.SoccerTournamentLog Where Groupid = 1 order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid) LIMIT ihalf,20;

		WHEN 9 THEN
		SELECT Points FROM soccer.SoccerTournamentLog Where Groupid = 1 order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameFromID(Teamid) LIMIT ihalf,20;
		WHEN 10 THEN
		DROP TEMPORARY TABLE IF EXISTS temp;

			CREATE TEMPORARY TABLE temp
				AS
				SELECT (@cnt := @cnt + 1) AS Position FROM soccer.soccertournamentlog AS t   , (SELECT @cnt := 0) AS dummy WHERE t.TeamID > 0 ORDER BY t.TeamID;

			SELECT Position FROM temp LIMIT ihalf,20;
			DROP TEMPORARY TABLE temp;

		WHEN 11 THEN
		SELECT IF((TeamID = HometeamID OR TeamID =AwayTeamID),1,0) Highlight FROM soccer.`match` m ,soccer.soccertournamentlog l WHERE m.ActiveGame = 1 order by points desc,GoalDiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid) LIMIT ihalf,20;
        WHEN 12 THEN
        SELECT Themelogos.Logo FROM soccer.SoccerTournamentLog,soccer.Themelogos,soccer.UISelected WHERE SoccerTournamentLog.Teamid = Themelogos.Teamid AND themelogos.LogoIndex = 1  AND  UISelected.SelectedTheme = themelogos.theme order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw, GetTeamNameShortFromID(SoccerTournamentLog.Teamid) LIMIT ihalf,20;
        WHEN 13 THEN
        SELECT Themelogos.Logo FROM soccer.SoccerTournamentLog,soccer.Themelogos,soccer.UISelected WHERE SoccerTournamentLog.Teamid = Themelogos.Teamid AND themelogos.LogoIndex = 2  AND  UISelected.SelectedTheme = themelogos.theme order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw, GetTeamNameShortFromID(SoccerTournamentLog.Teamid) LIMIT ihalf,20;
		WHEN 14 THEN
        SELECT Themelogos.Logo FROM soccer.SoccerTournamentLog,soccer.Themelogos,soccer.UISelected WHERE SoccerTournamentLog.Teamid = Themelogos.Teamid AND themelogos.LogoIndex = 3  AND  UISelected.SelectedTheme = themelogos.theme order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc ,lost ,draw, GetTeamNameShortFromID(SoccerTournamentLog.Teamid) LIMIT ihalf,20;
		WHEN 15 THEN
        SELECT GetLogNumberOfGamesWonAfterPeriodsInTournament(Teamid,47,Groupid) FROM soccer.SoccerTournamentLog  order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc , lost ,draw,GetTeamNameShortFromID(Teamid) LIMIT ihalf,20;
        WHEN 16 THEN
        SELECT GetLogNumberOfGamesWonNormalTimeInTournament(Teamid,47,Groupid) FROM soccer.SoccerTournamentLog  order by points desc,goaldiff desc,goalsfor desc,goalsagainst,win desc , lost ,draw,GetTeamNameShortFromID(Teamid) LIMIT ihalf,20;



        
	END CASE;
	END IF;

END ;;
DELIMITER ;
