CREATE DEFINER=`root`@`localhost` PROCEDURE `GetLogBottomHalfBASKETBALL`(iColumn INT)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE ihalf INT DEFAULT 0;
    DECLARE iAdmin INT DEFAULT 0;
	SELECT TRUNCATE(COUNT(*)/2,0) INTO ihalf FROM soccer.basketballtournamentlog;
    
    SELECT admintournament into iAdmin FROM soccer.`match`,`soccer`.`uiselected` 
