		WHEN 1 THEN
		SELECT GetTeamNameFromID(Teamid)  FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;
		
		WHEN 2 THEN
		SELECT Played FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;
	
		WHEN 3 THEN
		SELECT Win FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;
		
		WHEN 4 THEN
		SELECT Lost FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

		WHEN 5 THEN
		SELECT Draw FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

		WHEN 6 THEN
		SELECT GoalsFor FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;
		
		WHEN 7 THEN
		SELECT GoalsAgainst FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

		WHEN 8 THEN
		SELECT goalave FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

