		SELECT ROUND(GoalsFor/Played,0) AVGPPG FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)   LIMIT ihalf,20;
		
        WHEN 10 THEN
		SELECT Points FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

		WHEN 11 THEN
		SELECT BonusPoints FROM soccer.BasketballTournamentLog where Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

        WHEN 12 THEN
		DROP TEMPORARY TABLE IF EXISTS temp;

			CREATE TEMPORARY TABLE temp
				AS
				SELECT (@cnt := @cnt + 1) AS Position FROM soccer.soccertournamentlog AS t   , (SELECT @cnt := 0) AS dummy WHERE t.TeamID > 0 ORDER BY t.TeamID;

			SELECT Position FROM temp LIMIT ihalf,20;
			DROP TEMPORARY TABLE temp;
            
		WHEN 13 THEN
        SELECT IF(TeamID = HometeamID OR TeamID =AwayTeamID,1,0) Highlight FROM soccer.`match` , soccer.BasketballTournamentLog l WHERE ActiveGame = 1  and l.Groupid = 1 order by points desc,goalave desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid) LIMIT ihalf,20;

	END CASE;
	END IF;

END ;;
