CREATE DEFINER=`root`@`localhost` PROCEDURE `GetLogBottomHalfNetBall`(iColumn INT)
    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE ihalf INT DEFAULT 0;

	SELECT TRUNCATE(COUNT(*)/2,0) INTO ihalf FROM soccer.`nedballtournamentlog`;
    

	IF (ihalf >= 4) THEN
	CASE iColumn 
		WHEN 0 THEN
		SELECT GetTeamNameShortFromID(Teamid) FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

		WHEN 1 THEN
		SELECT GetTeamNameFromID(Teamid)  FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;
		
		WHEN 2 THEN
		SELECT Played FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;
	
		WHEN 3 THEN
		SELECT Win FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;
		
		WHEN 4 THEN
		SELECT Lost FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

		WHEN 5 THEN
		SELECT Draw FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

		WHEN 6 THEN
		SELECT GoalsFor FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;
		
		WHEN 7 THEN
		SELECT GoalsAgainst FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

		WHEN 8 THEN
		SELECT GoalDiff FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

		WHEN 9 THEN
		SELECT GoalDiffPesentage FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)   LIMIT ihalf,20;
		
        WHEN 10 THEN
		SELECT Points FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

		WHEN 11 THEN
		SELECT BonusPoints FROM soccer.`nedballtournamentlog` where Groupid = 1 order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

        WHEN 12 THEN
		DROP TEMPORARY TABLE IF EXISTS temp;

			CREATE TEMPORARY TABLE temp
				AS
				SELECT (@cnt := @cnt + 1) AS Position FROM soccer.`nedballtournamentlog` AS t   , (SELECT @cnt := 0) AS dummy WHERE t.TeamID > 0 ORDER BY t.TeamID;

			SELECT Position FROM temp LIMIT ihalf,20;
			DROP TEMPORARY TABLE temp;
		
        WHEN 13 THEN
        
			SELECT IF((TeamID = HometeamID OR TeamID =AwayTeamID) AND MatchStatus !=28,1,0) Highlight  FROM soccer.NedballTournamentLog,soccer.`match`  m ,`soccer`.`uiselected` u where m.MatchID = u.SelectedMatchID  order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid) LIMIT ihalf,20;
            
		WHEN 14 THEN
        
			SELECT GetTeamNameAbrFromID(Teamid) FROM soccer.NedballTournamentLog order by points desc,GoalDiffPesentage desc,goalsfor desc,goalsagainst,win desc ,lost ,draw,GetTeamNameShortFromID(Teamid)  LIMIT ihalf,20;

	END CASE;
	END IF;

END ;;
