CREATE DEFINER=`root`@`localhost` PROCEDURE `GetRugbyPlayerYellowCardSinBinVizTime`(homeorawy int)
BEGIN

declare SelectedMatchEventId bigint default -1;
declare elapsedsec int default 0;


if homeorawy > -1  then
if(homeorawy=0) then
select GetPlayerFromLastStatid(StatID,hometeamid,m.matchid) into SelectedMatchEventId from soccer.stats,soccer.`match` m ,soccer.uiselected u  where m.ActiveGame = 1 and StatID=59;
else
select GetPlayerFromLastStatid(StatID,awayteamid,m.matchid) into SelectedMatchEventId from soccer.stats,soccer.`match` m ,soccer.uiselected u  where m.ActiveGame = 1 and StatID=59;
end if;

else
 
 SELECT MAX(MatchEventId) into  SelectedMatchEventId
FROM soccer.matchevents b,soccer.`match`  a ,`soccer`.`uiselected` c 
where b.MatchID = a.matchID and b.teamid = selectedTeam  and StatEvent = 59 and a.matchID = selectedMatchid and b.playerid_1= selectedplayer;

end if;



DROP TEMPORARY TABLE IF EXISTS  TimeBreakdown ;
set @GameStageStart =0;
set @PrevStatEvent =0;
set @LastEventID = 0;
set @Pos=-1;
select matchevents.TimeStamp into @EventTime from soccer.matchevents where MatchEventId=SelectedMatchEventId;
select matchevents.TimeStamp into @PrevTimeStamp from soccer.matchevents where MatchEventId=SelectedMatchEventId;

create TEMPORARY table TimeBreakdown as( SELECT @Pos:=@Pos+1 AS Pos ,@PrevStatEvent as prestatevent,@PrevStatEvent:=`StatEvent` as statevent,TimeToMicroSec(timediff(`TimeStamp`,@PrevTimeStamp)) as TimeInbetweenEvents, @PrevTimeStamp:=`TimeStamp`,(TimeToMicroSec(timediff(`TimeStamp`,@EventTime))) as TimeFromEvent,timediff(`TimeStamp`,@EventTime) FROM soccer.matchevents 
where (StatEvent = 12 or StatEvent = 76 or StatEvent = 77 or StatEvent = 164 or statevent = 152) and  MatchEventId>SelectedMatchEventId order by MatchEventId);

if @Pos = -1 then 
select TimeToMicroSec(timediff(NOW()+1,@EventTime)) INTO @ElapsedTime  ;
SELECT format(((@ElapsedTime)/1000000),0)+TIME_TO_SEC(CleintServerTimeDiff) as ElapsedSeconds  into elapsedsec  FROM soccer.uiselected;

else


if @PrevStatEvent = 77 or @PrevStatEvent = 12  then
select TimeToMicroSec(timediff(NOW(),@EventTime)) INTO @ElapsedTime;
ELSEIF   @PrevStatEvent = 76 or @PrevStatEvent = 164 then 
select TimeToMicroSec(timediff(@PrevTimeStamp,@EventTime)) INTO @ElapsedTime;
ELSEIF @PrevStatEvent = 0 then 
select TimeToMicroSec(timediff(NOW(),@EventTime)) INTO @ElapsedTime;
end if;
select ifnull(sum(TimeInbetweenEvents),0) into @SumTotalPauseTime from TimeBreakdown where ((statevent= 77 and prestatevent =76) or (statevent= 164 and  prestatevent= 12) or (statevent= 152 and  prestatevent= 164));
SELECT cast((((@ElapsedTime-@SumTotalPauseTime)/1000000))+TIME_TO_SEC(CleintServerTimeDiff) as signed) as ElapsedSeconds into elapsedsec FROM soccer.uiselected;
end if;

if homeorawy > -1  then
if(homeorawy=0) then
select if(GetPlayerFromLastStatid(StatID,Hometeamid,m.matchid)!=-1 AND GetHomeTeamStatCount(67)>0,GetVizTimeString(EventCountDownTime - elapsedsec,0,GetVizTimeStatus()),'') yellowcardtime from soccer.stats,soccer.`match` m ,soccer.uiselected u  where m.ActiveGame = 1 and StatID=59;
else
select if(GetPlayerFromLastStatid(StatID,Awayteamid,m.matchid)!=-1 AND GetAwayTeamStatCount(67)>0,GetVizTimeString(EventCountDownTime - elapsedsec,0,GetVizTimeStatus()),'') yellowcardtime from soccer.stats,soccer.`match` m ,soccer.uiselected u  where m.ActiveGame = 1 and StatID=59;
end if;

else
 
 select if(SelectedMatchEventId != -1,GetVizTimeString(EventCountDownTime - elapsedsec,0,GetVizTimeStatus()),'') yellowcardtime from soccer.stats,soccer.`match` m ,soccer.uiselected u  where m.ActiveGame = 1 and StatID=59;


end if;



END ;;
DELIMITER ;
