CREATE DEFINER=`root`@`localhost` PROCEDURE `GetSelectedTeamFixtures`(iLimit INT,iColumn INT,OnlyOpponet INT)
    READS SQL DATA
    DETERMINISTIC
BEGIN

proc_label:BEGIN

	DROP TEMPORARY TABLE IF EXISTS temp;

	if OnlyOpponet=0 then
	CREATE TEMPORARY TABLE temp
	AS
	SELECT t1.ShortName Team1,t2.ShortName Team2,DateTimeStamp MatchDate 
	FROM soccer.`match` m,soccer.Teams t1,soccer.Teams t2, soccer.uiselected u 
	WHERE m.HometeamID = t1.IdTeams AND m.AwayteamID = t2.IdTeams 
	AND (m.HometeamID = u.SelectedTeam OR m.AwayteamID = u.SelectedTeam) AND m.DateTimeStamp > 
	(SELECT DateTimeStamp FROM soccer.`match` WHERE ActiveGame = 1)  AND m.ActiveGame <> 1 ORDER BY 
	DateTimeStamp asc LIMIT iLimit;
	
	else

	CREATE TEMPORARY TABLE temp
	AS
	SELECT if(m.HometeamID = u.SelectedTeam,'(H)','(A)')HomeAway,if(m.HometeamID = u.SelectedTeam,'HOME','AWAY')HomeAwayString,if(m.HometeamID = u.SelectedTeam,GetTeamNameShortFromID(m.AwayteamID),GetTeamNameShortFromID(m.HometeamID))Opponet,DateTimeStamp MatchDate 
	FROM soccer.`match` m, soccer.uiselected u 
	WHERE (m.HometeamID = u.SelectedTeam OR m.AwayteamID = u.SelectedTeam) AND m.DateTimeStamp > 
	(SELECT DateTimeStamp FROM soccer.`match` WHERE ActiveGame = 1)  AND m.ActiveGame <> 1 ORDER BY 
	DateTimeStamp asc LIMIT iLimit;

	end if;

	CASE  iColumn 
	WHEN 1 THEN
		SELECT Team1 FROM temp LIMIT iLimit;
	WHEN 2 THEN
		SELECT Team2 FROM temp LIMIT iLimit;
	WHEN 3 THEN
		SELECT DATE_FORMAT(MatchDate,'%d %M %Y') FROM temp LIMIT iLimit;
	WHEN 4 THEN
		SELECT Opponet FROM temp LIMIT iLimit;
	WHEN 5 THEN
		SELECT HomeAway FROM temp LIMIT iLimit;
	WHEN 6 THEN
		SELECT DATE_FORMAT(MatchDate,'%d/%m/%y') FROM temp LIMIT iLimit;
	WHEN 7 THEN
		SELECT count(*) FixturesCount FROM temp;
	WHEN 8 THEN
		SELECT HomeAwayString FROM temp LIMIT iLimit;
	WHEN 9 THEN
		SELECT DATE_FORMAT(MatchDate,'%d/%m/%Y') FROM temp LIMIT iLimit;
    
	END CASE;

END;

END ;;
DELIMITER ;
