		when m.AwayteamID = u.SelectedTeam and HomeTeamScore > AwayTeamScore
	then CONCAT('L: ',AwayTeamScore,' - ',HomeTeamScore)
when (m.HometeamID = u.SelectedTeam or m.AwayteamID = u.SelectedTeam)  and HomeTeamScore = AwayTeamScore
	then  CONCAT('D: ',HomeTeamScore,' - ',AwayTeamScore)
	
when m.HometeamID = u.SelectedTeam and HomeTeamScore > AwayTeamScore
	then  CONCAT('W: ',HomeTeamScore,' - ',AwayTeamScore)
		when m.AwayteamID = u.SelectedTeam and HomeTeamScore < AwayTeamScore
	then CONCAT('W: ',AwayTeamScore,' - ',HomeTeamScore)
end ScoreString,if(m.HometeamID = u.SelectedTeam,'(H)','(A)')HomeAway
	FROM soccer.`match` m,soccer.Teams t1,soccer.Teams t2, soccer.uiselected u 
	WHERE m.HometeamID = t1.IdTeams AND m.AwayteamID = t2.IdTeams 
	AND (m.HometeamID = u.SelectedTeam OR m.AwayteamID = u.SelectedTeam) 
	AND m.DateTimeStamp < (SELECT DateTimeStamp FROM soccer.`match` WHERE ActiveGame = 1) 
	AND m.ActiveGame <> 1 AND m.MatchStatus <> (SELECT min(idGameStages) FROM soccer.gamestages where gametype = m.SportCodeID) ORDER BY DateTimeStamp DESC LIMIT iLimit;

	CASE  iColumn 
	WHEN 1 THEN
		SELECT Team1 FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
	WHEN 2 THEN
		SELECT HomeTeamScore FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
	WHEN 3 THEN
		SELECT AwayTeamScore FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
	WHEN 4 THEN
		SELECT Team2 FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
	WHEN 5 THEN
		SELECT DATE_FORMAT(DateTimeStamp,'%d %b %Y') MatchDate FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
	WHEN 6 THEN
		SELECT result FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
	WHEN 7 THEN
		SELECT OpponetOnly FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
	WHEN 8 THEN
		SELECT Score FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
	WHEN 9 THEN
		SELECT ScoreString FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
    WHEN 10 THEN
		SELECT HomeAway FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
	WHEN 11 THEN
		SELECT DATE_FORMAT(DateTimeStamp,'%d/%m/%y') MatchDate FROM temp ORDER BY DateTimeStamp ASC LIMIT iLimit;
	WHEN 12 THEN
		SELECT count(*) MatchesResultsCount FROM temp;
	END CASE;

END;

END ;;
