CREATE DEFINER=`root`@`localhost` PROCEDURE `GetSoccerActionAreasPercentage`(vMatchid bigint,iStatActionAreaID int,ifieldHalf1 int,ifieldHalf2 int,ihalf int)
    READS SQL DATA
    DETERMINISTIC
BEGIN
	declare returnMinPlayed int default 0;
	declare returnTotalMinPlayed int default 0;
	declare returnPercentage int default 0;


	drop temporary table if exists temp;
	create temporary table temp as 

	select MatchEventId,StatEvent,PlayerID_1,TimeStamp ActionAreaStartTime,TeamID,MatchID,EventHalf,TimeString,
	(ifnull(DATE_SUB(GetNextActionAreaTimeStamp(StatEvent,e.MatchEventId),INTERVAL GetTimeLapsedDuringBreak(MatchID) MINUTE),
	(select DATE_SUB(TimeStamp,INTERVAL GetTimeLapsedDuringBreak(MatchID) MINUTE) FROM soccer.matchevents WHERE MatchEventId = (select  MAX(MatchEventId) FROM  soccer.matchevents)))) ActionAreaEndTime
	FROM soccer.matchevents e
	WHERE matchid = vMatchid AND (StatEvent =iStatActionAreaID or StatEvent =ifieldHalf1 or StatEvent =ifieldHalf2) AND EventHalf IN (41,43) ;

	select IFNULL(sum(TRUNCATE((TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ActionAreaEndTime,ActionAreaStartTime),'%H:%i'))/60),0)),0) into returnTotalMinPlayed from temp;

	select 
round(
(sum(TIME_TO_SEC(TIME_FORMAT(TIMEDIFF(ActionAreaEndTime,ActionAreaStartTime),'%H:%i'))/60)
   /returnTotalMinPlayed) * 100,0)
	from temp
	group by StatEvent order by StatEvent ASC limit ihalf,1;

	
	
	

END ;;
