CREATE DEFINER=`root`@`localhost` PROCEDURE `GetSoccerTeamPenalties`(vHomeOrAway int)
BEGIN
declare icount int default 0;
declare iMaxEvent int default 0;
declare iCountEventsHome int default 0;
declare iCountEventsAway int default 0;
declare iLimitStart int default 0;

select count(EventResult) into iCountEventsHome
FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
where `match`.matchID=uiselected.SelectedMatchID and `match`.matchID = matchevents.MatchID and matchevents.teamid = `match`.HomeTeamID and matchevents.MatchID = uiselected.SelectedMatchID and matchevents.StatEvent = 71;

select count(EventResult) into iCountEventsAway
FROM soccer.matchevents,soccer.uiselected,soccer.`match` 
where `match`.matchID=uiselected.SelectedMatchID and `match`.matchID = matchevents.MatchID and matchevents.teamid = `match`.AwayTeamID and matchevents.MatchID = uiselected.SelectedMatchID and matchevents.StatEvent = 71;


if iCountEventsHome > iCountEventsAway then 
set iMaxEvent= iCountEventsHome; 
else 
set iMaxEvent=iCountEventsAway; 
end if;

drop temporary table if exists temp;

if vHomeOrAway=0 then
create temporary table temp as select * from (select case EventResult when 1 then 2 else 1 end PenaltyResult
from soccer.matchevents e,`soccer`.`uiselected` u,soccer.`match` m
where m.Matchid = selectedMatchid and e.matchid = m.matchid and e.teamid = m.hometeamid and StatEvent = 71
order by e.MatchEventId) t union all select 0  union all select 0  
union all select 0  union all select 0  union all select 0;

else

create temporary table temp as select * from (select case EventResult when 1 then 2 else 1 end PenaltyResult
from soccer.matchevents e,`soccer`.`uiselected` u,soccer.`match` m
where m.Matchid = selectedMatchid and e.matchid = m.matchid and e.teamid = m.awayteamid and StatEvent = 71
order by e.MatchEventId) t union all select 0  union all select 0 
union all select 0  union all select 0  union all select 0;

end if;


if iMaxEvent > 5 then
select (TRUNCATE((iMaxEvent-1)/5,0)*5) into iLimitStart;
select PenaltyResult from temp limit iLimitStart,5;
else
select PenaltyResult from temp limit 5;
end if;

END ;;
DELIMITER ;
