CREATE DEFINER=`root`@`localhost` PROCEDURE `GetTimeLineEvents`(SelectedMatchID bigint,SelectedEventHalf int,iEvent int)
BEGIN

set @GameStageStart =0;
if SelectedEventHalf <> -1 then
select matchevents.TimeStamp into @GameStageStart from soccer.matchevents where StatEvent = 152 and  MatchID = SelectedMatchID and EventHalf = SelectedEventHalf;

SELECT  `MatchEventId`, `PlayerID_1`,TimeToMicroSec(timediff(`TimeStamp`,@GameStageStart)) as TimeIntoGame FROM soccer.matchevents 
where StatEvent = iEvent and  MatchID = SelectedMatchID and EventHalf = SelectedEventHalf order by MatchEventId;
else

