    READS SQL DATA
    DETERMINISTIC
BEGIN

	DECLARE rTeamID BIGINT;
	
	SELECT idTeams INTO rTeamID  FROM Teams WHERE TeamName Like 
	CONCAT('%',CASE WHEN vTeamName LIKE '%Maritzburg Utd%' THEN 'Maritzburg United'
					WHEN vTeamName LIKE '%Celtic%' THEN 'Bloemfontein Celtic' ELSE vTeamName  END,'%') AND TeamType = 4 AND ExtraDescription LIKE 'PSL';

	insert into `soccer`.`SoccerTournamentLog`(TeamID,Played,win,lost,draw,GoalsFor,GoalsAgainst,GoalDiff,Points,GroupID) 
	VALUES(rTeamID,
		rPlayed,
		rwin,
		rlost,
		rdraw,
		rGoalsFor,
		rGoalsAgainst,
		rGoalDiff,
		rPoints,
		1);
END ;;
