CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateStatsTable`()
BEGIN

declare matchIDVar BIGINT;

declare SportCodeIDVar  INTEGER;
DECLARE done INT DEFAULT FALSE;
DECLARE StatRetrievalQueryTeamVar varchar(1000);
DECLARE StatRetrievalQueryTeamPreparedVar varchar(1000);
DECLARE StatRetrievalResultVar varchar(1000);
DECLARE StatIDvar INT;
DECLARE HomeTeamIDVAR BIGINT;
DECLARE AwayTeamIDVAR BIGINT;
DECLARE cur1 CURSOR FOR select StatID,`StatRetrievalQueryTeam` from temptable01;


DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;





drop table IF EXISTS temptable01;



SELECT selectedMatchID into matchIDVar FROM soccer.uiselected where UISelectedID =0;
select SportCodeID into SportCodeIDVar from soccer.match where  matchID = matchIDVar;
select HomeTeamID into HomeTeamIDVAR from soccer.match where matchID = matchIDVar;
select AwayTeamID into AwayTeamIDVAR from soccer.match where matchID = matchIDVar;
CREATE TEMPORARY TABLE temptable01 ENGINE=MEMORY
as (SELECT `StatID`,`StatRetrievalQueryTeam` FROM soccer.stats where gametype = SportCodeIDVar or gametype = 1);

OPEN cur1;

read_loop: LOOP
	FETCH cur1 INTO StatIDvar, StatRetrievalQueryTeamVar;
	IF done THEN
      LEAVE read_loop;
    END IF;
	select concat('UPDATE `soccer`.`stats` SET `HTResult` = (',REPLACE(REPLACE(REPLACE(StatRetrievalQueryTeamVar,'teamid = %d',concat('teamid = ',HomeTeamIDVAR)),'MatchID = %d',concat('MatchID = ',matchIDVar)),';',' ' ),') ','WHERE StatId = ',StatIDvar,';') into @StatRetrievalQueryTeamPreparedVar;

  PREPARE stmt1 FROM @StatRetrievalQueryTeamPreparedVar;
  EXECUTE stmt1;
  DEALLOCATE PREPARE stmt1;

select concat('UPDATE `soccer`.`stats` SET `ATResult` = (',REPLACE(REPLACE(REPLACE(StatRetrievalQueryTeamVar,'teamid = %d',concat('teamid = ',AwayTeamIDVAR)),'MatchID = %d',concat('MatchID = ',matchIDVar)),';',' ' ),') ','WHERE StatId = ',StatIDvar,';') into @StatRetrievalQueryTeamPreparedVar;


  PREPARE stmt1 FROM @StatRetrievalQueryTeamPreparedVar;
  EXECUTE stmt1;
  DEALLOCATE PREPARE stmt1;

 

  END LOOP;
CLOSE cur1;



END ;;
DELIMITER ;
